const A=[{artist:{country:[{nameLocalized:"Norwegen",shortNameDe:"Norwegen",shortNameEn:"Norway",uid:158}],events:[],pathSegment:"1349",title:"1349",uid:968},biography:'<p class="docData;DOCY;v5;1905;">The year the plague raged and ended Norway’s golden age – 1349 not only teach us about history. The Black Metal outfit, with Satyricon drummer Frost, return to the Holy Ground with their latest record “The Wolf &amp; The King” to send billowing clouds of darkness over Wacken. Beware, it’s&nbsp;going&nbsp;to&nbsp;get&nbsp;cold.</p>',detailLink:"/de/programm/bands/band/1349/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=TH5Zf7qmUPM",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"1349_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/1349_25.jpg",title:"",type:2,uid:30716}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3631,uri:"http://legion1349.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3632,uri:"https://www.facebook.com/1349official/"},{socialnetwork:{title:"Instagram",uid:5},uid:3633,uri:"https://www.instagram.com/1349official/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"50xbiJGnTy1tSBZ9EFKnT",subtitle:"",thumbnail:"/fileadmin/_processed_/a/0/csm_1349_25_494e1b960b.jpg",uid:1298},{artist:{country:[{nameLocalized:"Kanada",shortNameDe:"Kanada",shortNameEn:"Canada",uid:36}],events:[],pathSegment:"3-inches-of-blood",title:"3 Inches of Blood",uid:1007},biography:`<p class="docData;DOCY;v5;3224;">What would our beloved Heavy Metal cosmos be without bands that unfold truly grand stories before us?</p>\r
<p>Canadian Metal warriors 3 INCHES OF BLOOD are exactly that kind of storytellers, weaving their epic blend of traditional Metal and Death Metal with dragons, swordfighters, and battles from realms beyond our earthly imagination.</p>\r
<p>Founded in the late ’90s, not even an eight-year hiatus could stop these five North Americans.</p>\r
<p>So, what would Metal be without its great storytellers? Probably a pretty sad place!</p>`,detailLink:"/de/programm/bands/band/3-inches-of-blood/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=ov1XxyvCS3o",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"3_inches_of_blood_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/3_inches_of_blood_25.jpg",title:"",type:2,uid:33611}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3794,uri:"https://www.facebook.com/threeinchesofblood/"},{socialnetwork:{title:"Instagram",uid:5},uid:3795,uri:"https://www.instagram.com/3iob/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0gNkDUN42nBxKOcpoF7iQ4",subtitle:"",thumbnail:"/fileadmin/_processed_/a/5/csm_3_inches_of_blood_25_44fdef1216.jpg",uid:1355},{artist:{country:[{nameLocalized:"Dänemark",shortNameDe:"Dänemark",shortNameEn:"Denmark",uid:56}],events:[],pathSegment:"802",title:"802",uid:1051},biography:`<p class="docData;DOCY;v5;2413;">A singing drummer with a soft spot for the ’80s—case closed, must be Phil Collins. Or is it?</p>\r
<p>802 create a wonderful mix of shoegaze walls of sound, driving guitars, synthesizers, and a glorious touch of Venom attitude. For the past three years, this Danish trio has been drifting across stages around the world, and now they’re set to challenge W:O:A and the Landgasthof with their distinctive blend.</p>\r
<p>Anyone who loves the ’80s will love 802—and let’s be honest: don’t we all love the ’80s just a little?</p>`,detailLink:"/de/programm/bands/band/802/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=tLUnyotLmSM",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"802_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/802_25.jpg",title:"",type:2,uid:34293}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3960,uri:"https://www.facebook.com/802Band/"},{socialnetwork:{title:"Instagram",uid:5},uid:3961,uri:"https://www.instagram.com/802band/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5YDGrpBSOHoiFr9ic1hss5",subtitle:"",thumbnail:"/fileadmin/_processed_/7/a/csm_802_25_0c032b0adb.jpg",uid:1417},{artist:{country:[{nameLocalized:"Puerto Rico",shortNameDe:"Puerto Rico",shortNameEn:"Puerto Rico",uid:173}],events:[],pathSegment:"a-burning-rose",title:"A Burning Rose",uid:1047},biography:'<p class="docData;DOCY;v5;1881;">A Burning Rose is a Melodic Death Metal band from Puerto Rico, formed in 2019 by Jorge M. Neris (vocals), Jam Luis (drums), Fabian Milian (lead guitar), Diego Garcia (bass), and Ralph Butler (rhythm guitar &amp; keyboards). Drawing inspiration from bands like Arch Enemy, Cradle of Filth, and Dark Tranquillity, their intense sound and strong musicianship have earned them slots opening for acts such as CRYPTA and Unto Others.</p>',detailLink:"/de/programm/bands/band/a-burning-rose/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=-kN7accZGdw",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"A_Burning_Rose_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/A_Burning_Rose_25.jpg",title:"",type:2,uid:34167}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3951,uri:"https://www.facebook.com/aburningrosebandpr"},{socialnetwork:{title:"Instagram",uid:5},uid:3952,uri:"https://www.instagram.com/a_burningrosebandpr"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"1CVrT8uQWesc3fdPvVM9Oq",subtitle:"Metal Battle - Caribbean",thumbnail:"/fileadmin/_processed_/1/d/csm_A_Burning_Rose_25_85f180781b.jpg",uid:1413},{artist:{country:[{nameLocalized:"Uruguay",shortNameDe:"Uruguay",shortNameEn:"Uruguay",uid:221}],events:[],pathSegment:"alpha",title:"Alpha",uid:1048},biography:`<p class="docData;DOCY;v5;2260;">Alpha is a pure metal band from Montevideo, Uruguay, known for blending death and thrash influences into raw, powerful, and authentic music. Formed in 2014, they’ve performed alongside legends like Malón, Fleshgod Apocalypse, and Wolfheart, and appeared at major events including Heresy Fest, Carnival Fest, and more.</p>\r
<p>With releases like Origin of Chaos, A Hero We Hate, and Fist of Vengeance, Alpha continues to evolve, delivering high-energy live shows and pushing the boundaries of the Uruguayan metal scene.</p>`,detailLink:"/de/programm/bands/band/alpha/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=b6UTsmvb0Ww",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"alpha_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/alpha_25.jpg",title:"",type:2,uid:34168}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3953,uri:"https://www.facebook.com/alphametaluy"},{socialnetwork:{title:"Instagram",uid:5},uid:3954,uri:"https://www.instagram.com/alphametaluy"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"",subtitle:"Metal Battle - Uruguay",thumbnail:"/fileadmin/_processed_/d/7/csm_alpha_25_eda003de93.jpg",uid:1414},{artist:{country:[{nameLocalized:"Belgien",shortNameDe:"Belgien",shortNameEn:"Belgium",uid:20}],events:[],pathSegment:"amenra",title:"Amenra",uid:970},biography:"<p>Ritual, remembrance and hard-won rebirth have always been at the heart of Amenra’s colossal, soul-purging approach. Centred around frontman Colin H. Van Eeckhout, but marked out by a transcendent unity of purpose, their albums have acted as totemic, personal marker points, a means to process individual grief as a shared, cathartic experience. Their live shows are acts of incendiary, communal exorcism that reach a cusp of sublime, out-of-body experience. A closely knit collective, they transport you to a febrile state where confrontation of pain, transformation and true healing can occur.</p>",detailLink:"/de/programm/bands/band/amenra/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=CD7bxyzFbC4",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"amenra25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/amenra25.jpg",title:"",type:2,uid:32214}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3648,uri:"https://amenra-official.tumblr.com/?fbclid=IwY2xjawGz4GtleHRuA2FlbQIxMAABHShyhiYLZ0IInxvkpUDwAmmtRsD903-ogUcu1c0j_V5_EhW9xXz22ROq4w_aem_rSofaNLimKkevqmPL1TYZg"},{socialnetwork:{title:"Facebook",uid:1},uid:3649,uri:"https://www.facebook.com/churchofra/"},{socialnetwork:{title:"Instagram",uid:5},uid:3650,uri:"https://www.instagram.com/amenra_official/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0N1jE1EIrhZjvQSfuLupUu",subtitle:"",thumbnail:"/fileadmin/_processed_/d/4/csm_amenra25_97189902a6.jpg",uid:1303},{artist:{country:[{nameLocalized:"Großbritannien",shortNameDe:"Großbritannien",shortNameEn:"United Kingdom",uid:74}],events:[],pathSegment:"angel-witch",title:"Angel Witch",uid:405},biography:"<p>Attention – it’s legend-alert! Who is ready for THE festival song living in your head rent-free in 2025?<br /> Once Kevin Heybourne and Angel Witch perform their song „Angel Witch“ taken off the album „Angel Witch“ and therefore unleash an unholy power. Your brain will be consumed by the song immediatly.<br /> That’s for sure – wanna bet?</p>",detailLink:"/de/programm/bands/band/angel-witch/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=OiqBMtVAWhQ",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Angel_Witch-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Angel_Witch-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30234}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3601,uri:"https://www.angelwitchcoven.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3602,uri:"https://www.facebook.com/angelwitchofficial"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6L48AOtGmQL1ELLoKML7cS",subtitle:"",thumbnail:"/fileadmin/_processed_/8/f/csm_Angel_Witch-WOA25-Ankuenderbild_b9a6c3cb94.jpg",uid:1287},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"annisokay",title:"Annisokay",uid:984},biography:'<p class="docData;DOCY;v5;2106;">Constant drops wear down the stone – and that’s how Annisokay have been relentlessly carving their name into the international metalcore scene for years. Pretty impressive for the guys from Halle, who just formed when they were snatched up by Electric Callboy to go on tour. Nowadays, Chris and the band are able to pack out venues themselves with their sensitive yet brutal synth-inspired core sound. And they’re always up for hitting festival fields like ours.</p>',detailLink:"/de/programm/bands/band/annisokay/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=TDL4vZk0nBw",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"annisokay_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/annisokay_25.jpg",title:"",type:2,uid:32662}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3706,uri:"https://www.facebook.com/annisokay"},{socialnetwork:{title:"Instagram",uid:5},uid:3707,uri:"https://www.instagram.com/annisokay/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"2BhO5MD5myhWXL82di1W8v",subtitle:"",thumbnail:"/fileadmin/_processed_/2/f/csm_annisokay_25_2f9b4efff7.jpg",uid:1323},{artist:{country:[{nameLocalized:"Finnland",shortNameDe:"Finnland",shortNameEn:"Finland",uid:67}],events:[],pathSegment:"apocalyptica",title:"Apocalyptica",uid:957},biography:"<p>There are only a handful of groups in the Metal universe that can claim that they have written history. Even less can claim, that they did it over and over again.<br /> Curtains up for Apocalyptica and their unique way in Metal. A band almost as old as the W:O:A. A band who not only play Metal classics on classical instruments but they have also become a classic themselves.<br /> We can not wait for another spectacular show on the Holy Ground.</p>",detailLink:"/de/programm/bands/band/apocalyptica/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=-5OGVn8bkbA",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Apokalyptica-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Apokalyptica-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30169}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3568,uri:"https://www.apocalyptica.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3569,uri:"https://www.facebook.com/Apocalyptica/"},{socialnetwork:{title:"Instagram",uid:5},uid:3570,uri:"https://www.instagram.com/apocalypticaofficial/?hl=de"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4Lm0pUvmisUHMdoky5ch2I",subtitle:"",thumbnail:"/fileadmin/_processed_/4/b/csm_Apokalyptica-WOA25-Ankuenderbild_32a618c395.jpg",uid:1275},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"august-burns-red",title:"August Burns Red",uid:965},biography:`<p>August Burns Red, the American Metalcore titans, are returning to Wacken! Formed in 2003, the band is known for their technical prowess, powerful breakdowns, and thought-provoking lyrics. With standout albums like "Messengers" and "Constellations", they've earned a massive global following. Their intense live performances are a testament to their energy and skill. Don't miss August Burns Red at Wacken 2025!</p>`,detailLink:"/de/programm/bands/band/august-burns-red/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=BTQQtHJ-fDY",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"august_burns_red24.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/august_burns_red24.jpg",title:"",type:2,uid:30332}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3619,uri:"https://www.facebook.com/augustburnsred/?locale=de_DE"},{socialnetwork:{title:"Instagram",uid:5},uid:3620,uri:"https://www.instagram.com/augustburnsred/"},{socialnetwork:{title:"Homepage",uid:8},uid:3621,uri:"https://www.google.com/search?q=august+burns+red+homepage&client=safari&sca_esv=a36414378d11ac08&sca_upv=1&rls=en&ei=BIezZtvwIJCHxc8PqprBuAQ&oq=august+burns+red+homepa&gs_lp=Egxnd3Mtd2l6LXNlcnAiF2F1Z3VzdCBidXJucyByZWQgaG9tZXBhKgIIADIHECEYoAEYCjIHECEYoAEYC"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5p9CTsn5ueGU4oScNX1axu",subtitle:"",thumbnail:"/fileadmin/_processed_/0/e/csm_august_burns_red24_a0e17bb878.jpg",uid:1294},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"avralize",title:"Avralize",uid:985},biography:'<p class="docData;DOCY;v5;2540;">Do you know that feeling when you’re looking at a restaurant’s menu and think how terrible it is to have to choose just one dish? Maybe you’d like to try the steak with fish and raspberry sorbet after all? Avralize are the fusion kitchen of modern Metalcore. Here, you get steak, fish, and raspberry sorbet—or, more fittingly: the young band from Baden-Württemberg sets no boundaries for their style. Their music effortlessly blends elements of Funk, Pop, Metal, and electronic music. The best of all cuisines, so to speak. Enjoy!</p>',detailLink:"/de/programm/bands/band/avralize/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=vjJMUD4CbY8",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"avralize25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/avralize25.jpg",title:"",type:2,uid:32663}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3708,uri:"https://avralize.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3709,uri:"https://www.facebook.com/avralizemusic"},{socialnetwork:{title:"Instagram",uid:5},uid:3710,uri:"https://www.instagram.com/avralizemusic/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6h9Yjv46RWsgt2NQ1F6Jb5",subtitle:"",thumbnail:"/fileadmin/_processed_/5/3/csm_avralize25_3c9c5b00e0.jpg",uid:1324},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"bad-loverz",title:"Bad Loverz",uid:1020},biography:'<p class="docData;DOCY;v5;2926;">Things that are so 80s: teased-up hair, spandex pants, Miami Vice, and, of course, the Thundersack. Don’t believe us? Then get ready for Bad Loverz! The sleazy best buds of Saltatio Mortis won’t just shake up your local disco—they are this year’s neon-colored wrecking crew for those of you with exceptional taste. Just like every good Cuba Libre needs a strong shot of rum, the Thundersack belongs to the 80s. Wanna bet?</p>',detailLink:"/de/programm/bands/band/bad-loverz/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=euXN0eyVbK4",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"bad_loverz_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/bad_loverz_25.jpg",title:"",type:2,uid:34059}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3851,uri:"https://badloverz.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3852,uri:"https://www.facebook.com/profile.php?id=61572561506249"},{socialnetwork:{title:"Instagram",uid:5},uid:3853,uri:"https://www.instagram.com/badloverz_official/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3Z4scvNZyLu70b20EEKEw1",subtitle:"",thumbnail:"/fileadmin/_processed_/a/f/csm_bad_loverz_25_da1c8ab7fd.jpg",uid:1376},{artist:{country:[{nameLocalized:"Dänemark",shortNameDe:"Dänemark",shortNameEn:"Denmark",uid:56}],events:[{artists:[{title:"Baest",uid:551}],end:"1691090100",festival:null,festivalday:{end:"1691110800",start:"1691042400",title:"Thursday",uid:14},images:null,media:null,performance:{title:"Meet & Greet",uid:9},stage:{description:"",latitude:"",longitude:"",pid:167,sorting:"3840",subtitle:"",title:"Meet & Greet II",uid:20},start:"1691087400",subtitle:"",sysLanguageUid:"-1",teaser:"",title:"",uid:1365}],pathSegment:"baest",title:"Baest",uid:551},biography:`<p class="docData;DOCY;v5;2624;">Some beasts cannot be tamed. They are destined to follow their own path—unwavering, like a steamroller that simply crushes everything in its way.</p>\r
<p>The Danish equivalent of this power-packed machine is the five-piece band Baest. Not even ten years after their formation, they’ve already risen to the top tier of Denmark’s Metal elite and have brought their furious blend of all things Extreme Metal to the stages of W:O:A. Now, they return with their new album Colossal in tow, ready to put the Landgasthof’s structural integrity to the test.</p>`,detailLink:"/de/programm/bands/band/baest/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=_1g33gUpK0I",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"baest_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/baest_25.jpg",title:"",type:2,uid:34294}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3962,uri:"https://baestband.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3963,uri:"https://www.facebook.com/baestband/"},{socialnetwork:{title:"Instagram",uid:5},uid:3964,uri:"https://www.instagram.com/baestband/"},{socialnetwork:{title:"Youtube",uid:6},uid:3965,uri:"https://www.youtube.com/baestband"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4UtjZRQc6qXhAd1kqyLvqp",subtitle:"",thumbnail:"/fileadmin/_processed_/c/7/csm_baest_25_033f87c02f.jpg",uid:1418},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"bap",title:"BAP",uid:1005},biography:`<p>BAP is a Rhineland institution and an inexplicable phenomenon. Rocking out with straight guitars and emotional lyrics in cologne dialect they conquered hearts all over Germany since the 1980s. Hits like “Verdamp lang her,” “Kristallnaach,” and “Do kanns Zaubere” will break Wacken boundaries once more in the festival’s history. We are sure even Metal-hardened music lovers can appreciate the band, who have undoubtedly done more for Cologne’s international reputation than some of the city’s other sons.</p>\r
<p>As musical but also political active figures BAP rightfully earned their place as legends at this year’s W:O:A, it will also be bands first appearance on the Holy Ground. We’re so ready!</p>`,detailLink:"/de/programm/bands/band/bap/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=7nQufUHaE2E",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"BAP.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/BAP.jpg",title:"",type:2,uid:33273}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3790,uri:"https://www.facebook.com/NiedeckensBAP/"},{socialnetwork:{title:"Homepage",uid:8},uid:3791,uri:"https://bap.de"},{socialnetwork:{title:"Instagram",uid:5},uid:3792,uri:"https://www.instagram.com/niedeckensbap/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"39ukKqQOSUFJDAM9OLKQZg",subtitle:"",thumbnail:"/fileadmin/_processed_/c/9/csm_BAP_3b1ee1d2ab.jpg",uid:1353},{artist:{country:[{nameLocalized:"Großbritannien",shortNameDe:"Großbritannien",shortNameEn:"United Kingdom",uid:74}],events:[],pathSegment:"benediction",title:"Benediction",uid:398},biography:'<p class="docData;DOCY;v5;2000;">Benediction are finally back! 26 years after the British Death Metal outfit last set foot on the Holy Ground, they have returned. And that’s not all: you won’t even have to miss out on Dave Ingram. Get ready for late ’80s British Death Metal, get ready for rapid-fire double bass blasts and get ready for the pit! It’s going to be old-school.</p>',detailLink:"/de/programm/bands/band/benediction/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=GgQKuZNIukU",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"benediction_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/benediction_25.jpg",title:"",type:2,uid:30715}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3628,uri:"https://www.facebook.com/Benedictionband/"},{socialnetwork:{title:"Instagram",uid:5},uid:3629,uri:"https://www.instagram.com/benediction_band"},{socialnetwork:{title:"Youtube",uid:6},uid:3630,uri:"https://www.youtube.com/watch?v=MUcd_koHUn8"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"1Lx9Dy5gi2OLlJBBs7GYO7",subtitle:"",thumbnail:"/fileadmin/_processed_/0/9/csm_benediction_25_4080a52f06.jpg",uid:1297},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[{artists:[{title:"Beyond The Black",uid:84}],end:"1722693600",festival:null,festivalday:{end:"1722740400",start:"1722664800",title:"Saturday",uid:22},images:null,media:null,performance:{title:"Concert",uid:1},stage:{description:"",latitude:"",longitude:"",pid:167,sorting:"256",subtitle:"powered by LGH Wacken",title:"LGH Clubstage",uid:21},start:"1722690000",subtitle:"",sysLanguageUid:"-1",teaser:"",title:"Unplugged and Q&A",uid:1687}],pathSegment:"beyond-the-black",title:"Beyond The Black",uid:84},biography:"<p>To introduce Beyond The Black might seem a little pointless – the German symphonic Metal superstars with frontwoman Jennifer Haben have become modern Metals giants in the meantime.<br /> Especially their breathtaking live-shows put them into the top tier of Heavy Metal – and somehow we might have introduced them now a little bit.</p>",detailLink:"/de/programm/bands/band/beyond-the-black/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=QKW7_jOjTQ8",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Beyond_The_Black-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Beyond_The_Black-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30235}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3603,uri:"http://beyond-the-black.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3604,uri:"https://www.facebook.com/beyondtheblackofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3605,uri:"https://www.instagram.com/beyondtheblack_official"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6swnqiL41Bd4gO2fnAXXrf",subtitle:"",thumbnail:"/fileadmin/_processed_/0/a/csm_Beyond_The_Black-WOA25-Ankuenderbild_4b9cd3da21.jpg",uid:1288},{artist:{country:[{nameLocalized:"Irland",shortNameDe:"Irland",shortNameEn:"Ireland",uid:97}],events:[],pathSegment:"boomtown-rats",title:"Boomtown Rats",uid:1003},biography:`<p class="docData;DOCY;v5;3716;">Bob Geldof, The Boomtown Rats, Wacken. What might feel strange at first glance actually became a reality back in 2017. And because the New Wave legends, led by their iconic frontman, completely enchanted both you and us, we just had to experience it all over again.</p>\r
<p>Formed in the mid-70s, the band gained worldwide fame with their hit “I Don’t Like Mondays,” winning over not only audiences everywhere but also the hearts of Holger and Thomas. The two Wacken founders have spared no effort in fulfilling yet another&nbsp; dream for themselves, while bringing in an act once again whose flair and notoriety are hard to match.</p>\r
<p>Get your voices ready: <em>Tell me why? I don’t like Mondays! Tell me why? …</em></p>`,detailLink:"/de/programm/bands/band/boomtown-rats/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=l7c6GAKxN2g",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"the_boomtown_rats_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/the_boomtown_rats_25.jpg",title:"",type:2,uid:32951}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3784,uri:"https://www.theboomtownratsofficial.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3785,uri:"https://www.facebook.com/theboomtownrats"},{socialnetwork:{title:"Instagram",uid:5},uid:3786,uri:"https://www.instagram.com/boomtownratsofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"40oYPr305MsT2lsiXr9fX9",subtitle:"",thumbnail:"/fileadmin/_processed_/e/f/csm_the_boomtown_rats_25_815a5b66c9.jpg",uid:1351},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"brazing-bull",title:"BraZing Bull",uid:1054},biography:`<p class="docData;DOCY;v5;6340;">Metal without nostalgia is like W:O:A without fans. Theoretically possible, but practically unthinkable.</p>\r
<p>BraZing Bull also dare to look back—without shutting themselves off from modern influences. Their&nbsp;Nu-Metal has everything&nbsp;Nu-Metal needs.</p>\r
<p>Enriched with more or less subtle synth elements, these guys from Itzehoe have crafted an explosive mix that has been setting off wildfires across Europe for the past 11 years—blazes that even the tears of all the traditionalists can’t put out.</p>\r
<p>Next stop: Wacken Landgasthof.</p>`,detailLink:"/de/programm/bands/band/brazing-bull/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=8f7huZQdc3Q",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"brazzing_bull25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/brazzing_bull25.jpg",title:"",type:2,uid:34321}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3971,uri:"https://www.facebook.com/BraZingBull/?locale=de_DE"},{socialnetwork:{title:"Instagram",uid:5},uid:3972,uri:"https://www.instagram.com/brazing_bull"},{socialnetwork:{title:"Youtube",uid:6},uid:3973,uri:"https://www.youtube.com/watch?v=8f7huZQdc3Q"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"7MXwtBko4mgKtLP89Yr74x",subtitle:"",thumbnail:"/fileadmin/_processed_/9/2/csm_brazzing_bull25_f95c736775.jpg",uid:1421},{artist:{country:[{nameLocalized:"Schweiz",shortNameDe:"Schweiz",shortNameEn:"Switzerland",uid:41}],events:[],pathSegment:"broken-fate",title:"Broken Fate",uid:1055},biography:`<p class="docData;DOCY;v5;4923;">An angry dice, showing hardness and brutality in its eyes no matter how it falls? That can only be fate.</p>\r
<p>In the case of Broken Fate, this destiny is even etched in their name. The Swiss group now boasts 18 solid years in the&nbsp;Heavy-Metal cosmos, and despite their driving, modern sound, they’re no greenhorns. If you like it heavy, then Broken Fate—with their blend of&nbsp;Thrash-&nbsp;and&nbsp;Death&nbsp;Metal rampaging across their new album Horizon—are a low-risk, high-reward gamble. Enough talk—let the dice speak!</p>`,detailLink:"/de/programm/bands/band/broken-fate/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=kHM1EJytwBQ",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"broken_fate25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/broken_fate25.jpg",title:"",type:2,uid:34322}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3974,uri:"http://www.broken-fate.ch/"},{socialnetwork:{title:"Facebook",uid:1},uid:3975,uri:"https://www.facebook.com/brokenfateCH"},{socialnetwork:{title:"Instagram",uid:5},uid:3976,uri:"https://www.instagram.com/broken_fate"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"7DHsq6kys16uhpHBpaQbEN",subtitle:"",thumbnail:"/fileadmin/_processed_/5/0/csm_broken_fate25_427d9c5ec8.jpg",uid:1422},{artist:{country:[{nameLocalized:"Schweden",shortNameDe:"Schweden",shortNameEn:"Sweden",uid:186}],events:[],pathSegment:"brothers-of-metal",title:"Brothers of Metal",uid:324},biography:"<p>What would you do with 8 people? You could start a handball club or put rings on 80 fingers.<br /> Or you found a Metal band, call it Brothers of Metal and then perform Power-Metal on our Wacken Open Air stages!</p>",detailLink:"/de/programm/bands/band/brothers-of-metal/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=Be_CyeFqziY",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Brothers_of_Metal-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Brothers_of_Metal-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30236}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3606,uri:"https://www.facebook.com/brothersofmetalofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3607,uri:"https://www.instagram.com/brothersofmetalofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0WPCPYm5IDNtQjuJOGNPcy",subtitle:"",thumbnail:"/fileadmin/_processed_/5/b/csm_Brothers_of_Metal-WOA25-Ankuenderbild_27a384474d.jpg",uid:1289},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"call-of-charon",title:"Call Of Charon",uid:1056},biography:`<p class="docData;DOCY;v5;5239;">The Styx flows through Wacken, and the ferryman is ready—if you listen closely, you can already hear him.</p>\r
<p>More precisely, it’s five ferrymen in total, who, while rowing you across the infernal river of the underworld, treat you to bone-crushing&nbsp;Death&nbsp;Metal. Anyone who’s known Call of Charon from Duisburg for more than a few sentences knows the band has long been wreaking havoc with their blend of deadly&nbsp;Metal and the sawing precision of&nbsp;Hardcore. Nearly 20 years and more than 150 live shows alongside scene giants like Thy Art Is Murder or Napalm Death prove that the band’s impeccable reputation is well-earned.&nbsp;Bring two coins—the ferrymen don’t wait.</p>`,detailLink:"/de/programm/bands/band/call-of-charon/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=H8u3I4_PAVw",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"call_of_charon25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/call_of_charon25.jpg",title:"",type:2,uid:34323}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3977,uri:"https://www.callofcharon.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3978,uri:"https://www.facebook.com/callofcharon/"},{socialnetwork:{title:"Instagram",uid:5},uid:3979,uri:"https://www.instagram.com/callofcharon/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"2vWCnf6why3xveo17IPuyC",subtitle:"",thumbnail:"/fileadmin/_processed_/a/5/csm_call_of_charon25_2c144e815e.jpg",uid:1423},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"callejon",title:"Callejon",uid:971},biography:"<p>The founding fathers of German Metalcore are back to honor the Holy Ground. A lot has happened since they last graced these stages in 2016—new albums, and additionally in 2024, quite a spectacular shake-up in the lineup. With fresh band members, Callejon are now ready to take another spin on the wild excitement and insatiable energy that leads to the bittersweet longing, the kind that knows eternity can only be found in the fleeting nature of all things.<br /> &nbsp;</p>",detailLink:"/de/programm/bands/band/callejon/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=m-rumep8WdI",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"callejon25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/callejon25.jpg",title:"",type:2,uid:32215}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3651,uri:"https://www.callejon.de/"},{socialnetwork:{title:"Facebook",uid:1},uid:3652,uri:"https://www.facebook.com/@callejon"},{socialnetwork:{title:"Instagram",uid:5},uid:3653,uri:"https://www.instagram.com/callejon/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"1ce15ppX5OYxPsBVESZG3W",subtitle:"",thumbnail:"/fileadmin/_processed_/0/6/csm_callejon25_c86c940092.jpg",uid:1304},{artist:{country:[{nameLocalized:"Frankreich",shortNameDe:"Frankreich",shortNameEn:"France",uid:72}],events:[],pathSegment:"celeste",title:"Celeste",uid:943},biography:"<p>It is not the easiest task putting the French avant-gardists Celeste into a box. The band is known to be one of the best of what modern Black Metal has to offer for more than 15 years.<br /> The band’s influences are as diverse as the study of the classic color theory. Black is described as the absence of all colors – Celeste is the darkest of Black-Metal. The absence of genre-borders and their corset provide the ultimate darkness.</p>",detailLink:"/de/programm/bands/band/celeste/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=bvyb7LaFZUo",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Celeste-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Celeste-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30156}}],networkuri:[{socialnetwork:{title:"Instagram",uid:5},uid:3530,uri:"https://www.instagram.com/celeste_band/"},{socialnetwork:{title:"Facebook",uid:1},uid:3531,uri:"https://www.facebook.com/celesteband/"},{socialnetwork:{title:"Homepage",uid:8},uid:3532,uri:"https://celesteband.com/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"16HYItTmZdhXM4Yz0CPtVy",subtitle:"",thumbnail:"/fileadmin/_processed_/7/f/csm_Celeste-WOA25-Ankuenderbild_61e253d3af.jpg",uid:1260},{artist:{country:[{nameLocalized:"Schweden",shortNameDe:"Schweden",shortNameEn:"Sweden",uid:186}],events:[],pathSegment:"clawfinger",title:"Clawfinger",uid:390},biography:`<p>Clawfinger, the Swedish Rap-Metal pioneers, are set to ignite Wacken 2025! Formed in 1989, Clawfinger is renowned for their aggressive blend of Metal and Rap, delivering hard-hitting lyrics and powerful performances.<br /> With iconic tracks like "Do What I Say", they've carved a unique niche in the Metal world. Their dynamic live shows and genre-defying sound promise an stirring experience. Get ready for Clawfinger at Wacken 2025!</p>`,detailLink:"/de/programm/bands/band/clawfinger/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=47Yb2aWmuVI",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Clawfinger-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Clawfinger-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30226}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3589,uri:"http://www.clawfinger.net/"},{socialnetwork:{title:"Facebook",uid:1},uid:3590,uri:"https://www.facebook.com/clawfinger.net/"},{socialnetwork:{title:"Instagram",uid:5},uid:3591,uri:"https://www.instagram.com/clawfingerofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"1xE3snzm12GBK259IqEFlY",subtitle:"",thumbnail:"/fileadmin/_processed_/d/9/csm_Clawfinger-WOA25-Ankuenderbild_cf938e0fc1.jpg",uid:1282},{artist:{country:[{nameLocalized:"Australien",shortNameDe:"Australien",shortNameEn:"Australia",uid:14}],events:[],pathSegment:"clowns",title:"Clowns",uid:960},biography:"<p>Chances are, that the genre-mixing Clowns might travelt the farthest to the Holy Ground in 2025.<br /> The Austrialians are also rumored to disturb the mullet balance extensively, we might have to have a closer look on this subject.<br /> Besides that, we hired them as demolition constructors – busy people, these clowns.</p>",detailLink:"/de/programm/bands/band/clowns/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=OHCNVTg3O2Q&list=OLAK5uy_lFQM7jQqLWxUMxDx0O7z2w1X568kzeV2c",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Clowns-WOA25-Ankuenderbild2.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Clowns-WOA25-Ankuenderbild2.jpg",title:"",type:2,uid:30225}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3577,uri:"https://clownsband.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3578,uri:"https://www.facebook.com/clownsband/"},{socialnetwork:{title:"Instagram",uid:5},uid:3579,uri:"https://www.instagram.com/clownsband/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"2TuGrkN9bcjWU1GcrUarYn",subtitle:"",thumbnail:"/fileadmin/_processed_/4/4/csm_Clowns-WOA25-Ankuenderbild2_2cd41284a0.jpg",uid:1278},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"coppelius",title:"Coppelius",uid:133},biography:`<p class="docData;DOCY;v5;2874;">We hope you’ve got your opera glasses ready, because Coppelius are coming! Esteemed audience, dear Metalheads,&nbsp;rooted in Berlin, these guys have already graced our stages more than once and are bringing their unique brand of Chambercore to the Holy Ground – complete with “exotic” instruments like cello, double bass, and clarinet.</p>\r
<p>Those lucky enough to have witnessed the six-piece live at W:O:A before know exactly how capable they are of making your manes fly and your fists rise to the sky. The Holy Ground becomes an opera house, because here at Wacken – and with Coppelius – culture is still spelled with a capital C!</p>`,detailLink:"/de/programm/bands/band/coppelius/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=fCrijbbUJ8o",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"coppelius_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/coppelius_25.jpg",title:"",type:2,uid:33704}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3806,uri:"https://coppeliushilft.de"},{socialnetwork:{title:"Facebook",uid:1},uid:3807,uri:"https://www.facebook.com/CoppeliusHilft/"},{socialnetwork:{title:"Instagram",uid:5},uid:3808,uri:"https://www.instagram.com/coppeliushilft/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6Jg19FkSE124yxi2J2wdP4",subtitle:"",thumbnail:"/fileadmin/_processed_/4/9/csm_coppelius_25_61bd705118.jpg",uid:1361},{artist:{country:[{nameLocalized:"Finnland",shortNameDe:"Finnland",shortNameEn:"Finland",uid:67}],events:[],pathSegment:"crownshift",title:"Crownshift",uid:961},biography:"<p>Scandinavia – in modern Metal it is nearly a synonym for quality. That’s why it is no wonder why this supergroup (members of Children of Bodom, Finntroll &amp; Wintersun) is the real deal right now.<br /> After 2023 we are very glad that they decided to return to the W:O:A once again.</p>",detailLink:"/de/programm/bands/band/crownshift/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=7OzTbJEucW0",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"crownshit_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/crownshit_25.jpg",title:"",type:2,uid:30264}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3580,uri:"https://www.crownshiftofficial.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3581,uri:"https://www.facebook.com/crownshiftofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3582,uri:"https://www.instagram.com/crownshiftofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6Fd8KYTCfbveVIsHVSr2y6",subtitle:"",thumbnail:"/fileadmin/_processed_/8/6/csm_crownshit_25_f9c3db038b.jpg",uid:1279},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"cypecore",title:"Cypecore",uid:616},biography:"<p>Interstellar bullseye: They fit perfectly with this year's W:O:A motto and are bringing their latest album „<em>Make Me Real“</em> along for the ride. CYPECORE will take you into their very own post-apocalyptic world full of industrial sounds, heavy riffs, and dystopic lyrics. It already became apparent during this year‘s motto show: The third operation on the Holy Ground is imminent - more brutal and catchy than ever before.</p>",detailLink:"/de/programm/bands/band/cypecore/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=15zYyU02BZ0",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"cypecore25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/cypecore25.jpg",title:"",type:2,uid:32668}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3723,uri:"https://www.cypecore.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3724,uri:"https://www.facebook.com/Cypecore"},{socialnetwork:{title:"Instagram",uid:5},uid:3725,uri:"https://www.instagram.com/cypecore/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"2Ym9WvIrSd6TCZZgqacWWn",subtitle:"",thumbnail:"/fileadmin/_processed_/b/5/csm_cypecore25_2b7b1e570e.jpg",uid:1329},{artist:{country:[{nameLocalized:"Schweden",shortNameDe:"Schweden",shortNameEn:"Sweden",uid:186}],events:[],pathSegment:"dark-funeral",title:"Dark Funeral",uid:4},biography:'<p class="docData;DOCY;v5;2658;">Darkness is descending upon Wacken. The gates of hell are opening, and from them rise Sweden’s masters of darkness—Dark Funeral. After more than three decades of the blackest Metal and several appearances on our (Un-)Holy Ground, this Black Metal institution is back, ready to satisfy the Horned One himself with a very special show. With blackened hymns like Unchain My Soul, To Carve Another Wound, and The Arrival of Satan’s Empire, they will surely throw the gates of hell wide open!</p>',detailLink:"/de/programm/bands/band/dark-funeral/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=JCN8qkWVu1w",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"dark_funeral_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/dark_funeral_25.jpg",title:"",type:2,uid:34063}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3862,uri:"https://www.darkfuneral.se"},{socialnetwork:{title:"Facebook",uid:1},uid:3863,uri:"https://www.facebook.com/darkfuneral"},{socialnetwork:{title:"Instagram",uid:5},uid:3864,uri:"https://www.instagram.com/darkfuneralofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"21ojeH5LNADIGzJKc3hIlE",subtitle:"",thumbnail:"/fileadmin/_processed_/0/8/csm_dark_funeral_25_34855aa3aa.jpg",uid:1380},{artist:{country:[{nameLocalized:"Polen",shortNameDe:"Polen",shortNameEn:"Poland",uid:170}],events:[],pathSegment:"decapitated",title:"Decapitated",uid:941},biography:"<p>Some bands become famous because of their undeniable musical abilites, others become legends because of tragic circumstances, e.g passing away of band members.<br /> Decapitated is easily put in both categories. Yet, in 2025, a powerful, technical skilled Death Metal machine is ready for the Holy Ground, just waiting to unleash it’s deadly riffs.</p>",detailLink:"/de/programm/bands/band/decapitated/",externalMediaRatio:"16by9",externalMediaSource:"https://www.decapitatedband.net/",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Decapitated-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Decapitated-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30153}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3525,uri:"https://www.facebook.com/decapitated/"},{socialnetwork:{title:"Instagram",uid:5},uid:3526,uri:"https://www.instagram.com/decapitatedband/"},{socialnetwork:{title:"Homepage",uid:8},uid:3527,uri:"https://www.decapitatedband.net/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"17MbhJOaaPHuWnRaWU9xkc",subtitle:"",thumbnail:"/fileadmin/_processed_/0/4/csm_Decapitated-WOA25-Ankuenderbild_244905b8e3.jpg",uid:1258},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"deine-cousine",title:"Deine Cousine",uid:201},biography:`<p class="docData;DOCY;v5;3056;">Deine Cousine is the kind of artist who makes you feel like you’ve just discovered the coolest underground gem – even though she’s already carved out her own niche and easily fills big venues.</p>\r
<p>She sings about everything that moves her: life, love, the casual "What am I even doing?" and "What’s going on with this world?" – always without taking herself too seriously, but still with a whole lot of poetry.</p>\r
<p>In short: Deine Cousine is the artist you can introduce to your friends next time with a “You don’t know her?” and everyone will shake their heads in surprise. *Not yet*, though! After conquering the Wacken grounds once again, even the last unfaithful will be turned into a believer!</p>`,detailLink:"/de/programm/bands/band/deine-cousine/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=a_uyALs83kg",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"deine_cousine25.jpg",publicUrl:"/fileadmin/user_upload/news_images/deine_cousine25.jpg",title:"",type:2,uid:32926}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3733,uri:"https://deinecousine.de"},{socialnetwork:{title:"Facebook",uid:1},uid:3734,uri:"https://www.facebook.com/deinecousine"},{socialnetwork:{title:"Instagram",uid:5},uid:3735,uri:"https://www.instagram.com/deine.cousine/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"579hwkWz1UQx97t0tzYv1Y",subtitle:"",thumbnail:"/fileadmin/_processed_/a/5/csm_deine_cousine25_2bf310757a.jpg",uid:1333},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"destruction",title:"Destruction",uid:936},biography:"<p>Teutonen-Alarm! Seit über 40 Jahren bespielen Destruction die Bühnen dieser Welt. Zusammen mit Kreator und Sodom gehören sie unbestritten zur Speerspitze des deutschen Thrash. Und auch beim W:O:A sind sie keine Unbekannten – 2025 wird die gut geSCHMIERte Maschine ihre Hochgeschwindigkeitsgranaten wieder auf unseren Holy Ground abfeuern. Geht in Deckung!</p>",detailLink:"/de/programm/bands/band/destruction/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=_ctRQ465GLE",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Destruction-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Destruction-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30147}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3512,uri:"https://www.facebook.com/destruction/?locale=pt_BR"},{socialnetwork:{title:"Instagram",uid:5},uid:3513,uri:"https://www.instagram.com/destruction_official"},{socialnetwork:{title:"Homepage",uid:8},uid:3514,uri:"https://www.destruction.de/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5d6KI8frPEo3qGsIL8Sak2",subtitle:"",thumbnail:"/fileadmin/_processed_/5/d/csm_Destruction-WOA25-Ankuenderbild_eb8fa786e7.jpg",uid:1253},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"die-apokalyptischen-reiter",title:"Die Apokalyptischen Reiter",uid:995},biography:`<p class="docData;DOCY;v5;3257;">Unique – Not uncommon in Metal, yet there are some bands that stand out even more. Enter Die Apokalyptischen Reiter!</p>\r
<p>Throughout their long career, the band has often demanded courage from their fans—courage they themselves have consistently demonstrated—and they’ve been rewarded time and again. Few bands in Germany can count on such a loyal and dedicated fan base.</p>\r
<p>With their wild blend of various elements of heavy music and German lyrics, they’ve captivated the Holy Ground on multiple occasions. Their musical range is truly impressive. The seals are broken, the riders ride again, and they’re coming to Wacken!</p>`,detailLink:"/de/programm/bands/band/die-apokalyptischen-reiter/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=aeXMN-68lHI",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"die_apokalyptischen_reiter_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/die_apokalyptischen_reiter_25.jpg",title:"",type:2,uid:32934}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3756,uri:"https://reitermania.de"},{socialnetwork:{title:"Facebook",uid:1},uid:3757,uri:"https://www.facebook.com/Reitermania/"},{socialnetwork:{title:"Instagram",uid:5},uid:3758,uri:"https://www.instagram.com/reitermania/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"04L8hbMJRQ5vFnLeDgA8xn",subtitle:"",thumbnail:"/fileadmin/_processed_/9/7/csm_die_apokalyptischen_reiter_25_5b0cb988fa.jpg",uid:1341},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"die-kassierer",title:"Die Kassierer",uid:49},biography:"<p>Chill the beer, refresh yourself and warm up your vocal cords: DIE KASSIERER are inviting you to a boozy bash in Wacken. Join Wölfi and co. in philosophizing about raging thirst for beer and nasty STDs until you can belt out every lyric at the best party of the year. No one’s getting scolded for vulgar language, promise!</p>",detailLink:"/de/programm/bands/band/die-kassierer/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=I7hq88Z_Yq8",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"die_kassierer_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/die_kassierer_25.jpg",title:"",type:2,uid:32944}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3768,uri:"https://www.kassierer.de/"},{socialnetwork:{title:"Facebook",uid:1},uid:3769,uri:"https://www.facebook.com/Kassierer/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"2rkUO6EuQHFdR9rrakgfJR",subtitle:"",thumbnail:"/fileadmin/_processed_/6/a/csm_die_kassierer_25_6cd9352c67.jpg",uid:1345},{artist:{country:[{nameLocalized:"Norwegen",shortNameDe:"Norwegen",shortNameEn:"Norway",uid:158}],events:[],pathSegment:"dimmu-borgir",title:"Dimmu Borgir",uid:956},biography:"<p>For another time the unholy fortress sends their evil representatives to Wacken and persuade all the Metalheads to headbang. Since their founding in 1993, the Norwegians have earned the reputation of being one of the most popular Metal bands in the world.<br /> Songs like „Progenies of the Great Apocalypse“ or „Sorgens Kammer“ are an established part in the collective Metal brain.<br /> <br /> The band is especially memorable to both you and us from 2012, when they, also thanks to an orchestra, transformed the Holy Ground into the Unholy Ground and enveloped the W:O:A with their bombastic Black Metal in delightfully eerie darkness.<br /> We look forward to something remarkable!</p>",detailLink:"/de/programm/bands/band/dimmu-borgir/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=cb26HASeyvM",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"dimmu_borgir24.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/dimmu_borgir24.jpg",title:"",type:2,uid:31004}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3565,uri:"https://www.dimmu-borgir.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3566,uri:"https://www.facebook.com/dimmuborgir/"},{socialnetwork:{title:"Instagram",uid:5},uid:3567,uri:"https://www.instagram.com/dimmuborgir/?hl=de"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6e8ISIsI7UQZPyEorefAhK",subtitle:"",thumbnail:"/fileadmin/_processed_/c/d/csm_dimmu_borgir24_67b6b22ad9.jpg",uid:1274},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"dirkschneider",title:"Dirkschneider",uid:283},biography:`<p>Maybe the greatest Metal album of the '80s? With possibly <em>the</em> greatest Metal anthem ever created? No one can escape the power of "Balls to the Wall," and when it’s Udo Dirkschneider himself delivering the iconic fist-pumping scream – it doesn’t get any better than that. Or does it? Since 2023, Udo’s band has been graced with the cherry on top: bass god Peter Baltes is back. We’re beyond stoked and can’t wait for this absolutely legendary show where we will be celebrating the 40th anniversary of this epic record!</p>`,detailLink:"/de/programm/bands/band/dirkschneider/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=OczPkwrA-ZA",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"dirkschneider25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/dirkschneider25.jpg",title:"",type:2,uid:32216}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3654,uri:"https://www.udo-online.com/news-98.html"},{socialnetwork:{title:"Facebook",uid:1},uid:3655,uri:"https://www.facebook.com/DIRKSCHNEIDEROfficial"},{socialnetwork:{title:"Youtube",uid:6},uid:3656,uri:"https://www.youtube.com/user/UDOtubetv"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3Ki97iRlfQmVk6qw5tXULX",subtitle:"",thumbnail:"/fileadmin/_processed_/5/e/csm_dirkschneider25_aaa2c43d38.jpg",uid:1305},{artist:{country:[{nameLocalized:"Italien",shortNameDe:"Italien",shortNameEn:"Italy",uid:104}],events:[],pathSegment:"dogma",title:"Dogma",uid:972},biography:`<p>„Dogma is what you want it to be. A cult, a sect, a secret society, a band, a musical, a documentary…You decide what we are. We demand only one thing: to be part of your new life. Welcome to your new life. Welcome to Dogma.”</p>\r
<p>Prepare to sin with Dogma! Over the years, Dogma has risen to become an unstoppable force, and we’re thrilled to witness this spectacle here in Wacken. The four women—Lilith (vocals), Lamia (lead guitar), Nixe (bass), and Abrahel (drums)—are on a mission: using their music as a weapon against ignorance and oppression. They excel at inspiring their audience to question everything and challenge the status quo. We can’t wait to welcome them to the Holy Ground.</p>`,detailLink:"/de/programm/bands/band/dogma/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=h7Qg_EU_ehI",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"dogma_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/dogma_25.jpg",title:"",type:2,uid:32217}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3657,uri:"https://officialdogma.com/"},{socialnetwork:{title:"Instagram",uid:5},uid:3658,uri:"https://www.instagram.com/officialdogma/"},{socialnetwork:{title:"Facebook",uid:1},uid:3659,uri:"https://www.facebook.com/@theofficialdogma"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4R6XPuqGShFESRVkCePaxj",subtitle:"",thumbnail:"/fileadmin/_processed_/7/4/csm_dogma_25_a12354dfa1.jpg",uid:1306},{artist:{country:[{nameLocalized:"Dänemark",shortNameDe:"Dänemark",shortNameEn:"Denmark",uid:56}],events:[],pathSegment:"dominum",title:"Dominum",uid:962},biography:"<p>Dr. Dead lets his zombies dance. Dominum will infect you with their Power Metal and they don’t even have to bite. At least until you want them to.<br /> One of the most extraordinary bands of German Metal will redeclare the Holy Ground into a buffet. There is no escape Metalheads!</p>",detailLink:"/de/programm/bands/band/dominum/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=ASdCjFE2vI0",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Dominum-WOA25-Ankuenderbild4.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Dominum-WOA25-Ankuenderbild4.jpg",title:"",type:2,uid:30224}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3583,uri:"https://www.dominumofficial.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3584,uri:"https://www.facebook.com/realdominum/?locale=de_DE"},{socialnetwork:{title:"Instagram",uid:5},uid:3585,uri:"https://www.instagram.com/realdominum"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4Nm9FxM65RZa6EgFV2z8S9",subtitle:"",thumbnail:"/fileadmin/_processed_/e/9/csm_Dominum-WOA25-Ankuenderbild4_21a34011b8.jpg",uid:1280},{artist:{country:[{nameLocalized:"Niederlande",shortNameDe:"Niederlande",shortNameEn:"Netherlands",uid:157}],events:[],pathSegment:"dool",title:"Dool",uid:944},biography:"<p>Dool’s dominating theme is change. Change in life, change in line-ups, and change in music. Which is very fitting considering the band’s name translates in dutch to “wander”.<br /> Let the 5 guys of Dool take you on a journey through different genres of Metal music. Maybe, in the end, it will change your perspective too?</p>",detailLink:"/de/programm/bands/band/dool/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=FAOJe3lSXqI&list=OLAK5uy_mMCPUp-0w0I2jH0gw7GUHrok_2u2a5KiI",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Dool-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Dool-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30155}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3533,uri:"https://allthosewhowanderaredool.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3534,uri:"https://www.facebook.com/allthosewhowanderaredool/?locale=de_DE"},{socialnetwork:{title:"Instagram",uid:5},uid:3535,uri:"https://www.instagram.com/allthosewhowanderaredool/?hl=de"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"101HSR6JTJqe3DBh6rb8kz",subtitle:"",thumbnail:"/fileadmin/_processed_/f/b/csm_Dool-WOA25-Ankuenderbild_54fbbdf7e5.jpg",uid:1261},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"dope",title:"Dope",uid:353},biography:'<p>Their songs can be heard in <em>Guitar Hero III</em>, WWE, and the soundtrack to <em>The Fast and the Furious</em>. In other words: the American Industrial Metal powerhouse DOPE has made its mark with hits like "Die MF Die" and the cover of "You Spin Me Round (Like A Record)" by Dead Or Alive, becoming the music heroes of every serious game night and every wild rock party. Since the late 90s Edsel Dope and his fellows are entertaining you and in 2025 they will finally rock with you to the highlights of their seven albums at the W:O:A.</p>',detailLink:"/de/programm/bands/band/dope/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=sAPriwCgsXo",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"dope25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/dope25.jpg",title:"",type:2,uid:32669}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3726,uri:"https://dopetheband.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3727,uri:"https://www.facebook.com/Dopetheband/"},{socialnetwork:{title:"Instagram",uid:5},uid:3728,uri:"https://www.instagram.com/dopetheband"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"7fWgqc4HJi3pcHhK8hKg2p",subtitle:"",thumbnail:"/fileadmin/_processed_/a/a/csm_dope25_e11858a564.jpg",uid:1330},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"drowning-pool",title:"Drowning Pool",uid:1022},biography:'<p class="docData;DOCY;v5;2246;">Grab your towels and rush through the pit to claim a front-row spot for Drowning Pool! With bangers like Bodies and Rise Up, there won’t be any dry eyes—because this unstoppable surge of energy is exactly why Drowning Pool had to finally tear up the Holy Ground after 28 years of band history. Last year, they released their first new song in 14 years, and now we can expect even more. Let the bodies hit the floor—Wacken is ready!</p>',detailLink:"/de/programm/bands/band/drowning-pool/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=x73tpPiJ_d0",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"drowning_pool_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/drowning_pool_25.jpg",title:"",type:2,uid:34064}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3865,uri:"https://drowningpool.live"},{socialnetwork:{title:"Facebook",uid:1},uid:3866,uri:"https://www.facebook.com/drowningpool"},{socialnetwork:{title:"Instagram",uid:5},uid:3867,uri:"https://www.instagram.com/drowningpoolofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"1E4r4z7ivGUcSAnCbINJ9v",subtitle:"",thumbnail:"/fileadmin/_processed_/9/e/csm_drowning_pool_25_72bfc6a9fa.jpg",uid:1381},{artist:{country:[{nameLocalized:"Tschechische Republik",shortNameDe:"Tschechische Republik",shortNameEn:"Czech Republic",uid:53}],events:[],pathSegment:"dymytry-paradox",title:"Dymytry Paradox",uid:1023},biography:'<p class="docData;DOCY;v5;3304;">Starting as a Czech-language Metalcore band, Dymytry are no longer just an exotic insider tip. The five-piece has already completed multiple tours across Europe, and their discography includes two albums in English alongside a vocalist change. After collaborating with Hämatom for the first time in 2018, their appearance on Wacken’s Holy Ground is not just logical—it’s long overdue. With their electrifying yet crushingly heavy Metalcore anthems, Dymytry will make it easy for us to fall in love. Guaranteed!</p>',detailLink:"/de/programm/bands/band/dymytry-paradox/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=l0YScUFm6ls",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"dymytry_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/dymytry_25.jpg",title:"",type:2,uid:34065}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3868,uri:"https://www.dymytry.cz/"},{socialnetwork:{title:"Facebook",uid:1},uid:3869,uri:"https://www.facebook.com/dymytrycz"},{socialnetwork:{title:"Instagram",uid:5},uid:3870,uri:"https://www.instagram.com/dymytry_cz_official/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"74jZjGsZ4aBEZbtrvytbIZ",subtitle:"",thumbnail:"/fileadmin/_processed_/e/4/csm_dymytry_25_7f48a4012c.jpg",uid:1382},{artist:{country:[{nameLocalized:"Frankreich",shortNameDe:"Frankreich",shortNameEn:"France",uid:72}],events:[],pathSegment:"eihwar",title:"Eihwar",uid:1004},biography:'<p class="docData;DOCY;v5;1982;">In a parallel universe where Vikings discovered synthesizers and started headbanging, Eihwar already are superstars! Preparing the Holy Ground for a Nordic invasion, the W:O:A is facing Eihwar’s brutal pagan dancefloor music, combining Nordic folk sounds, ritual chants, war drums, and powerful electro beats. Get ready to enter the trance, Metalheads!</p>',detailLink:"/de/programm/bands/band/eihwar/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=OUrS7NoG7g8",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"eihwar_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/eihwar_25.jpg",title:"",type:2,uid:32954}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3787,uri:"https://eihwar.my.canva.site"},{socialnetwork:{title:"Facebook",uid:1},uid:3788,uri:"https://www.facebook.com/eihwar.music"},{socialnetwork:{title:"Instagram",uid:5},uid:3789,uri:"https://www.instagram.com/eihwar.music/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"2VFxoCJQPfQauZujESPjQK",subtitle:"",thumbnail:"/fileadmin/_processed_/c/9/csm_eihwar_25_6feeccdb59.jpg",uid:1352},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"enemy-inside",title:"Enemy Inside",uid:573},biography:"<p>After their successful debut in 2023 Enemy Inside makes their return to Wacken. Founded by the German-Italian outstanding voice Nastassja Giulia and guitarist Evan K in 2017, they found their home between Dark-Rock and Modern Metal. Dominik Stotzem on bass-guitar and Dave Hadarik on guitar complete the line-up . As the Holy Ground already witnessed Enemy Inside proves themselves with intense and captivating moments during their live shows. Their presence is inevitable, which is why we are excited to welcome them again to see their mesmerizing show. &nbsp;</p>",detailLink:"/de/programm/bands/band/enemy-inside/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=AYLjMw2KCMM",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"enemy_inside25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/enemy_inside25.jpg",title:"",type:2,uid:32218}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3660,uri:"https://enemy-inside.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3661,uri:"https://www.facebook.com/WeAreEnemyInside/"},{socialnetwork:{title:"Instagram",uid:5},uid:3662,uri:"https://www.instagram.com/weareenemyinside/"},{socialnetwork:{title:"Youtube",uid:6},uid:3663,uri:"https://www.youtube.com/channel/UC7Xt2agmtcN60kxbOvYs25Q"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4DX0ctdZRMWec9KCiigIXy",subtitle:"",thumbnail:"/fileadmin/_processed_/5/4/csm_enemy_inside25_0c5b20e588.jpg",uid:1307},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"exhorder",title:"Exhorder",uid:945},biography:"<p>Imagine forming a band, release records, go on tour, and basically live out your dreams for 6 years. And then, the dream suddenly implodes.<br /> 27 years later: You’re back with a loud bang! Exhorder are back to fire up and explode on the Holy Ground in 2025.<br /> Along with them: Their new record Defectum Onium. The dream is alive again!</p>",detailLink:"/de/programm/bands/band/exhorder/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=ea8OpEJxmiM",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Exhorder-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Exhorder-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30157}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3536,uri:"https://www.exhorder.com/"},{socialnetwork:{title:"Instagram",uid:5},uid:3537,uri:"https://www.instagram.com/exhorderofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5kuYamMO00pHPdRQcAXWTl",subtitle:'"Slaughter in the Vatican" Show',thumbnail:"/fileadmin/_processed_/8/a/csm_Exhorder-WOA25-Ankuenderbild_0aeb91b447.jpg",uid:1262},{artist:{country:[{nameLocalized:"Weißrussland",shortNameDe:"Weißrussland",shortNameEn:"Belarus",uid:34}],events:[],pathSegment:"extermination-dismemberment",title:"Extermination Dismemberment",uid:1025},biography:'<p class="docData;DOCY;v5;2886;">Extermination Dismemberment—let that name roll off your tongue for a moment. And once you have, you’ll surely taste first-class Death Metal, enriched with a pinch of Slam and a voice that sounds like it emerged from a gurgling swamp. The band from Belarus has been around for over 15 years and is known for sheer brutality and live shows that are nothing short of demolition. For fans of the genre and anyone who can handle a serious dose of heaviness, Extermination Dismemberment is an absolute must!</p>',detailLink:"/de/programm/bands/band/extermination-dismemberment/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=dinGnXVYA04",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"extermination_dismemberment_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/extermination_dismemberment_25.jpg",title:"",type:2,uid:34067}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3874,uri:"https://exterminationdismemberment.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3875,uri:"https://www.facebook.com/edsbdm"},{socialnetwork:{title:"Instagram",uid:5},uid:3876,uri:"https://www.instagram.com/edismemberment/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"2kmN6qYkywddUoh7JIUdZi",subtitle:"",thumbnail:"/fileadmin/_processed_/1/0/csm_extermination_dismemberment_25_2d49e631f4.jpg",uid:1384},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"extinct",title:"Extinct",uid:688},biography:`<p class="docData;DOCY;v5;4800;">Teutonic&nbsp;Thrash the way it’s meant to be: fast, raw, aggressive, and with a healthy dose of political and social critique—that’s Extinct.</p>\r
<p>Thrash aficionados get their full fix from this trio from Rendsburg, because Helge, Leda, and Schulzi can do everything their big brothers and sisters from overseas can—at least just as well. Who needs the Bay Area when you’ve got Schleswig-Holstein? Not only can the three celebrate over 22 years of Extinct, but they can also absolutely tear down the&nbsp;Landgasthof. Extinct? Far from it—this band is alive and dangerously on fire!</p>`,detailLink:"/de/programm/bands/band/extinct/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=2xNjHlUOWbA",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"extinct_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/extinct_25.jpg",title:"",type:2,uid:34324}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3980,uri:"https://www.facebook.com/extinctmetal/"},{socialnetwork:{title:"Instagram",uid:5},uid:3981,uri:"https://www.instagram.com/extinct_band.official/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"2ym0yKyd40x4XY846pFGeU",subtitle:"",thumbnail:"/fileadmin/_processed_/8/2/csm_extinct_25_30fc657cb4.jpg",uid:1424},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"fear-factory",title:"Fear Factory",uid:998},biography:'<p class="docData;DOCY;v5;2458;">2025 is a year FEAR FACTORY fans won’t forget. On one hand, guitarist Dino Cazares has announced a classic FEAR FACTORY album, marking the first release with new vocalist Milo Silvestro. On the other hand, the band boasts an impressive legacy of eleven Industrial Metal albums, making it increasingly challenging to craft a comprehensive setlist. But no matter which Industrial grooves the Americans unleash during their fourth W:O:A appearance, one thing is certain: it’s going to be loud and heavy!</p>',detailLink:"/de/programm/bands/band/fear-factory/",externalMediaRatio:"16by9",externalMediaSource:"https://youtu.be/JRLvrcDjBMU?feature=shared",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"fear_factory_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/fear_factory_25.jpg",title:"",type:2,uid:32945}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3770,uri:"https://fearfactory.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3771,uri:"https://www.facebook.com/fearfactory/"},{socialnetwork:{title:"Instagram",uid:5},uid:3772,uri:"https://www.instagram.com/fearfactory"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"74Hj7BmnUXyx2udrIEIKwX",subtitle:"",thumbnail:"/fileadmin/_processed_/6/a/csm_fear_factory_25_4aa5840c8d.jpg",uid:1346},{artist:{country:[{nameLocalized:"Norwegen",shortNameDe:"Norwegen",shortNameEn:"Norway",uid:158}],events:[],pathSegment:"fight-the-fight",title:"Fight The Fight",uid:210},biography:"<p>How many friends from your school days are you still in touch with? Fight The Fight from Norway have known each other since their time together in Norwegian classrooms. With their debut album in 2017, they already managed to stir things up – including the Colosseum that we call the&nbsp; Holy Ground. Their blend of Groove, Hardcore, Metal, and the catchiness of their songs makes them seasoned gladiators who will once again give their all to claim victory in the battle in 2025.</p>",detailLink:"/de/programm/bands/band/fight-the-fight/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=5hMY3hEQAlQ",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"fight_the_fight_25.jpg",publicUrl:"/fileadmin/user_upload/news_images/fight_the_fight_25.jpg",title:"",type:2,uid:32927}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3736,uri:"https://www.facebook.com/Fightthefightband/"},{socialnetwork:{title:"Instagram",uid:5},uid:3737,uri:"https://www.instagram.com/fightthefightband/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"7AXB6I4MlqHgJXM1yIyjkX",subtitle:"",thumbnail:"/fileadmin/_processed_/0/6/csm_fight_the_fight_25_657147eb1a.jpg",uid:1334},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"fit-for-a-king",title:"Fit For A King",uid:1024},biography:`<p class="docData;DOCY;v5;2882;">From the rattlesnake- and scorpion-infested deserts of the Lone Star State to the lush green fields of Planet Wacken, where at most, a stray cow might wander from time to time.</p>\r
<p>But for the four Americans in Fit For A King, the culture shock should be minimal. Their brutal mix of Metalcore and sugar-coated choruses is just what’s needed to get the Holy Ground fired up. With 18 years of band history, the group is arriving at Wacken just in time for their “coming of age” debut. Nothing stands in the way of absolute mayhem!</p>`,detailLink:"/de/programm/bands/band/fit-for-a-king/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=XHYDdab_Bo4",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"fit_for_a_king_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/fit_for_a_king_25.jpg",title:"",type:2,uid:34066}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3871,uri:"https://fitforakingband.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3872,uri:"https://www.facebook.com/fitforakingband/"},{socialnetwork:{title:"Instagram",uid:5},uid:3873,uri:"https://www.instagram.com/fitforakingtx/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0OgdRTPItr9dw4XYp4JJUx",subtitle:"",thumbnail:"/fileadmin/_processed_/e/9/csm_fit_for_a_king_25_16398617d2.jpg",uid:1383},{artist:{country:[{nameLocalized:"Niederlande",shortNameDe:"Niederlande",shortNameEn:"Netherlands",uid:157}],events:[],pathSegment:"floor-jansen",title:"Floor Jansen",uid:999},biography:'<p class="docData;DOCY;v5;2665;">Without a doubt she is a frontwoman and musician of the highest caliber! FLOOR JANSEN made a name for herself in the Metal scene with After Forever and ReVamp, and since 2013, she has been captivating the masses as the vocalist of Nightwish. Following her Hard Rock venture with Northward, the Dutch artist has found her personal center with her solo album „<em>Paragon“</em>: Melodic, rocking, Pop-infused, and absolutely perfect for an unforgettable W:O:A set.</p>',detailLink:"/de/programm/bands/band/floor-jansen/",externalMediaRatio:"16by9",externalMediaSource:"https://youtu.be/yZQ1o80Kt_Y",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"floor_jansen_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/floor_jansen_25.jpg",title:"",type:2,uid:32946}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3773,uri:"https://www.floorjansen.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3774,uri:"https://www.facebook.com/floorjansen.singer"},{socialnetwork:{title:"Instagram",uid:5},uid:3775,uri:"https://www.instagram.com/floor_jansen_official/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"2ZNTJ9Bu9QMJwBboMSpQgJ",subtitle:"",thumbnail:"/fileadmin/_processed_/c/c/csm_floor_jansen_25_aba82c49c4.jpg",uid:1347},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"forbidden",title:"Forbidden",uid:978},biography:'<p class="docData;DOCY;v5;2658;">Forbidden are like the cigarette your parents refused to let you smoke. Like the liquor they didn’t want you to drink, or those friends they disapproved of. Of course, you did all of it anyway, because nothing felt as good! Well, except maybe taking a dive into the moshpit – which will safely happen when these Thrashers take the stage. Safe like the grounding your parents gave you after your first bender! With Forbidden, an absolute Thrash legend is coming to the Holy Ground, and this time, no one can stop you. Go get your kicks!</p>',detailLink:"/de/programm/bands/band/forbidden/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=Lm6TPJgiN6A",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"forbidden_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/forbidden_25.jpg",title:"",type:2,uid:32633}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3684,uri:"https://officialforbidden.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3685,uri:"https://www.facebook.com/forbiddenofficial"},{socialnetwork:{title:"Instagram",uid:5},uid:3686,uri:"https://www.instagram.com/official_forbidden/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5MhPZVXE28sD9rXE3GU1uN",subtitle:"",thumbnail:"/fileadmin/_processed_/7/e/csm_forbidden_25_54de2fd914.jpg",uid:1315},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"from-fall-to-spring",title:"From Fall To Spring",uid:1026},biography:`<p class="docData;DOCY;v5;3210;">Who doesn’t know the classic playground rule: Two corners, one penalty kick? Applied to From Fall To Spring, the rule would probably go like this: Two times ESC selection, one time Wacken!</p>\r
<p>We’re pretty sure that the melodic Metalcore of this Saarland-based sextet is much better suited for us than for some TV studio. After all, where else could you celebrate Metal more appropriately than on the Holy Ground, surrounded by countless other Metalheads? From Fall To Spring – all the points!</p>`,detailLink:"/de/programm/bands/band/from-fall-to-spring/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=KZQcD8ZDySE",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"from_fall_to_spring_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/from_fall_to_spring_25.jpg",title:"",type:2,uid:34068}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3877,uri:"https://fromfalltospring.de"},{socialnetwork:{title:"Facebook",uid:1},uid:3878,uri:"https://www.facebook.com/From.Fall.to.Spring"},{socialnetwork:{title:"Instagram",uid:5},uid:3879,uri:"https://www.instagram.com/from.fall.to.spring/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"373XSzgRHjl6imFLdGNlQm",subtitle:"",thumbnail:"/fileadmin/_processed_/9/e/csm_from_fall_to_spring_25_c086836fde.jpg",uid:1385},{artist:{country:[{nameLocalized:"Schweden",shortNameDe:"Schweden",shortNameEn:"Sweden",uid:186}],events:[],pathSegment:"gehennah",title:"Gehennah",uid:1008},biography:`<p class="docData;DOCY;v5;2295;">Somewhere between Venom, Motörhead, and Entombed, the Swedish GEHENNAH have carved out their niche. With influences like these, it’s only fitting to unleash an EP called Metal Police!&nbsp;But anyone who steps in front of the stage for these Scandinavians will quickly realize that Gehennah have much more to offer—and that their Blood Metal is more than capable of summoning hell itself onto the Wacken field.</p>\r
<p>A promising W:O:A debut!</p>`,detailLink:"/de/programm/bands/band/gehennah/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=8edvl_j8fHU",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"gehennah_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/gehennah_25.jpg",title:"",type:2,uid:33612}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3796,uri:"https://www.facebook.com/gehennah.metal/"},{socialnetwork:{title:"Instagram",uid:5},uid:3797,uri:"https://www.instagram.com/gehennah.official/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0zVjHf0H46AZqaxSl8C4Ko",subtitle:"",thumbnail:"/fileadmin/_processed_/a/3/csm_gehennah_25_2c973c9459.jpg",uid:1356},{artist:{country:[{nameLocalized:"Frankreich",shortNameDe:"Frankreich",shortNameEn:"France",uid:72}],events:[],pathSegment:"gojira",title:"Gojira",uid:946},biography:"<p>Buckle up - Gojira are coming back! The hype around the band remains unbroken - completely justified. The wide spectrum of styles, which are virtuosly united in their music, has already made them living legends for many of you.<br /> It’s rare for a band to command the stage as well as the music so breathtakingly as the frenchmen do. The only thing that can top the inauguration of the Olympic Games in Paris last year is a Headliner slot at W:O:A. Let’s get started!</p>",detailLink:"/de/programm/bands/band/gojira/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=kl-2GUMijPM",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Gojira-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Gojira-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30158}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3538,uri:"https://www.gojira-music.com/"},{socialnetwork:{title:"Instagram",uid:5},uid:3539,uri:"https://www.instagram.com/gojiraofficial/"},{socialnetwork:{title:"Facebook",uid:1},uid:3540,uri:"https://www.facebook.com/GojiraMusic/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0GDGKpJFhVpcjIGF8N6Ewt",subtitle:"",thumbnail:"/fileadmin/_processed_/6/d/csm_Gojira-WOA25-Ankuenderbild_b5154c78ac.jpg",uid:1263},{artist:{country:[{nameLocalized:"Großbritannien",shortNameDe:"Großbritannien",shortNameEn:"United Kingdom",uid:74}],events:[],pathSegment:"graphic",title:"Graphic Nature",uid:1027},biography:'<p class="docData;DOCY;v5;3552;">Who are&nbsp;you&nbsp;when&nbsp;no&nbsp;one&nbsp;is&nbsp;watching? In the case of Graphic Nature, the correct answer would probably be Metalcore infused with Nu-Metal and electronic elements. But this question also perfectly fits the name of their latest release. In their fateful seventh year, this band from Kent, UK, finally lands in Wacken. Their unique blend is further enriched by lyrics exploring mental health topics. Sometimes, things can get a little more thought-provoking.</p>',detailLink:"/de/programm/bands/band/graphic/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=hFwzev3ezTY",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"graphic_nature_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/graphic_nature_25.jpg",title:"",type:2,uid:34069}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3880,uri:"https://www.facebook.com/graphicnature404"},{socialnetwork:{title:"Instagram",uid:5},uid:3881,uri:"https://www.instagram.com/graphicnature404/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0QUcDHMfwBsMAufKXbzhkH",subtitle:"",thumbnail:"/fileadmin/_processed_/c/8/csm_graphic_nature_25_311ee40b14.jpg",uid:1386},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"grave-digger",title:"Grave Digger",uid:294},biography:"<p>Is this the smell of a legend? Chris Boltendahl and the mighty Grave Digger have been belonging to German Metal music for such a long time that their legend-status is well justified and earned.<br /> Grave Digger are a real institution after 45 years of experience and will be celebrating this anniversary with us on the Holy Ground.<br /> Real Teutonic Metal will be awaited for everyone who wants to dry their hair infront of the stage.</p>",detailLink:"/de/programm/bands/band/grave-digger/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=xtShAqcxhkY",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"gravedigger25b.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/gravedigger25b.jpg",title:"",type:2,uid:32194}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3592,uri:"https://www.grave-digger-clan.de/"},{socialnetwork:{title:"Facebook",uid:1},uid:3593,uri:"https://www.facebook.com/gravediggerofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3594,uri:"https://www.instagram.com/gravediggerband/?hl=de"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6mfghV4I1CD17FOhDKq7cJ",subtitle:"45th Anniversary Show",thumbnail:"/fileadmin/_processed_/1/3/csm_gravedigger25b_dc6e593869.jpg",uid:1283},{artist:{country:[{nameLocalized:"Schweden",shortNameDe:"Schweden",shortNameEn:"Sweden",uid:186}],events:[],pathSegment:"graveyard",title:"Graveyard",uid:1021},biography:'<p class="docData;DOCY;v5;2180;">Mustache wearers, bell-bottom aficionados, and cowboy boot lovers, take note: Graveyard is coming to the Holy Ground! The return of the Swedish retro quartet will not only thrill fans of the past but also anyone who loves authentic, handcrafted Rock. Rarely has a tribute to the glorious ’70s sounded this good. When Graveyard cranks their amps up to 11, only the toughest will keep their eyes dry.</p>',detailLink:"/de/programm/bands/band/graveyard/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=72DZFXOP5d0",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"graveyard_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/graveyard_25.jpg",title:"",type:2,uid:34060}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3854,uri:"https://www.facebook.com/graveyardofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3855,uri:"https://www.instagram.com/graveyardmusic/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0hU5urLse5h1Z0b4zQkovL",subtitle:"",thumbnail:"/fileadmin/_processed_/e/4/csm_graveyard_25_5cad211c62.jpg",uid:1377},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"guns-n-roses",title:"Guns N’ Roses",uid:983},biography:"<p>Guns N’ Roses endure as the most dynamic, dangerous, and definitive American rock band in history to this day. Embedded in popular culture, their landmark diamond-selling 1987 opus,&nbsp;<em>Appetite For Destruction</em>, stands out as&nbsp;<em>“the best-selling U.S. debut album ever”&nbsp;</em>and&nbsp;<em>“the 11</em><em><sup>th</sup></em><em>&nbsp;best-selling U.S. album of all&nbsp;</em>time,<em>”&nbsp;</em>while their&nbsp;<em>Not In This Lifetime… Tour&nbsp;</em>(2016-2019) ranked as the&nbsp;<em>“fourth-highest grossing concert tour of all time</em>.<em>”&nbsp;</em>During 1991, Guns N’ Roses shook the world with the one-two punch of the 7x-platinum&nbsp;<em>Use Your Illusion I</em>&nbsp;and&nbsp;<em>Use Your Illusion II</em>, clinching the top two spots of the&nbsp;<em>Billboard</em>&nbsp;200 upon arrival. With total sales of 100 million units thus far, their catalog also consists of&nbsp;<em>G N’ R Lies</em>&nbsp;(5x-platinum),&nbsp;<em>The Spaghetti Incident?</em>(platinum),&nbsp;<em>Greatest Hits&nbsp;</em>(5x-platinum), and&nbsp;<em>Chinese Democracy</em>&nbsp;(platinum). Not to mention, they are one of the most-streamed rock bands in the world with an average of 24 million monthly listeners on Spotify. Following the reunion of the century, they headlined&nbsp;<em>Coachella</em>&nbsp;and sold 5 million-plus tickets on the&nbsp;<em>Not In This Lifetime… Tour</em>. However, Guns N’ Roses never stop with more touring on the horizon and other surprises—the<em>&nbsp;“Nightrain”</em>&nbsp;keeps rolling at full speed.&nbsp;&nbsp;&nbsp;<br /> <br /> Guns N’ Roses are Axl Rose (vocals, piano), Duff McKagan (bass), Slash (lead guitar), Dizzy Reed (keyboard), Richard Fortus (rhythm guitar), Frank Ferrer (drums), and Melissa Reese (keyboard).  &nbsp;</p>",detailLink:"/de/programm/bands/band/guns-n-roses/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=FcJfZ9jjwrY",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"GunsNRoses_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/GunsNRoses_25.jpg",title:"",type:2,uid:32599}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3703,uri:"https://www.gunsnroses.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3704,uri:"https://www.facebook.com/gunsnroses"},{socialnetwork:{title:"Instagram",uid:5},uid:3705,uri:"https://www.instagram.com/gunsnroses/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3qm84nBOXUEQ2vnTfUTTFC",subtitle:"",thumbnail:"/fileadmin/_processed_/b/f/csm_GunsNRoses_25_004b10f80c.jpg",uid:1322},{artist:{country:[{nameLocalized:"Dänemark",shortNameDe:"Dänemark",shortNameEn:"Denmark",uid:56}],events:[],pathSegment:"guttural-disgorge",title:"Guttural Disgorge",uid:1052},biography:`<p class="docData;DOCY;v5;3418;">We are red, we are white, we are Danish dynamite!</p>\r
<p>That alongside Neckbreakker, Guttural Disgorge is also part of Denmark’s young and rising Death Metal scene, is thanks to their relentlessly crushing Slam and their grotesquely twisted cover artworks.</p>\r
<p>Here, the beatdown comes first—ID checks later.</p>\r
<p>But if you’ve already made it to Wacken as teenagers and after just two years as a band, you must be doing a lot of things right.</p>\r
<p>Need some moshpit inspiration? Turn the volume on their debut album First Degree Murder up to 11.</p>\r
<p>Can the Landgasthof withstand this chainsaw onslaught?</p>`,detailLink:"/de/programm/bands/band/guttural-disgorge/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=41p5N_tXsis",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"guttural_disgorge_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/guttural_disgorge_25.jpg",title:"",type:2,uid:34295}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3966,uri:"https://www.facebook.com/p/Guttural-Disgorge-61555686605170/"},{socialnetwork:{title:"Instagram",uid:5},uid:3967,uri:"https://www.instagram.com/guttural.disgorge/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6vlW47l7HYnEr8kLoj8aMT",subtitle:"",thumbnail:"/fileadmin/_processed_/f/5/csm_guttural_disgorge_25_03de708a5e.jpg",uid:1419},{artist:{country:[{nameLocalized:"Japan",shortNameDe:"Japan",shortNameEn:"Japan",uid:107}],events:[],pathSegment:"hanabie",title:"Hanabie",uid:947},biography:`<p>Here comes Hanabie - The Japanese Metal phenomenon, that currently sets the world on fire.</p>\r
<p>In their repertoire: Electrifying live-shows and mesmerizing sounds.<br /> The band formed in Tokyo, that combines Metalcore elements with Japanese Pop-Music, will enchant the W:O:A 2025. Here comes: The Beast from The East!</p>`,detailLink:"/de/programm/bands/band/hanabie/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=vdZFDaCjQ0w",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Hanabie-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Hanabie-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30159}}],networkuri:[{socialnetwork:{title:"Instagram",uid:5},uid:3541,uri:"https://www.instagram.com/ha_na_bie_/"},{socialnetwork:{title:"Homepage",uid:8},uid:3542,uri:"https://hanabie.jp/en/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4N2I7VsF86h59tbsvVoB1h",subtitle:"",thumbnail:"/fileadmin/_processed_/4/a/csm_Hanabie-WOA25-Ankuenderbild_943ee8cf36.jpg",uid:1264},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"harpyie",title:"Harpyie",uid:89},biography:'<p class="docData;DOCY;v5;2538;">What might appear dark and menacing to others is exactly what we are craving for.<em>&nbsp;</em>Harpyie, named after the demonic birds of Greek mythology, are spreading their dark wings and landing on the Holy Ground. They’re bringing along their recent&nbsp;album&nbsp;Voodoo. The band has been going strong for more than&nbsp;a decade, blending medieval melodies with Metal and modern sounds. But Voodoo marks a new era – breaking free from genre boundaries and blinders. We can’t wait to see what they’ll unleash!</p>',detailLink:"/de/programm/bands/band/harpyie/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=7bSuiImchqQ",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Harpyie_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Harpyie_25.jpg",title:"",type:2,uid:33705}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3809,uri:"https://www.harpyien.de"},{socialnetwork:{title:"Facebook",uid:1},uid:3810,uri:"https://www.facebook.com/harpyien"},{socialnetwork:{title:"Instagram",uid:5},uid:3811,uri:"https://www.instagram.com/harpyieband/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6Z48DAdZXTdQ65IiDAyKRC",subtitle:"",thumbnail:"/fileadmin/_processed_/b/1/csm_Harpyie_25_4c063153a2.jpg",uid:1362},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"heavysaurus",title:"Heavysaurus",uid:997},biography:"<p>At a first glance they are summoners of a long forgotten time. No way! Because the dinos of HEAVYSAURUS entertain the whole offspring of our loud and favourite music. Plea to all young W:O:A fans: Once the colourful primeval rockers turn on the amps, show your parents how much power you got! Pommesgabel reload!</p>",detailLink:"/de/programm/bands/band/heavysaurus/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=F4sYN2YeCtU",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"heavysaurus_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/heavysaurus_25.jpg",title:"",type:2,uid:32942}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3762,uri:"https://www.heavysaurus.de/"},{socialnetwork:{title:"Facebook",uid:1},uid:3763,uri:"https://www.facebook.com/HeavysaurusDE"},{socialnetwork:{title:"Instagram",uid:5},uid:3764,uri:"https://www.instagram.com/heavysaurus/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6uyCfgv8FWIc2mifriVXqw",subtitle:"",thumbnail:"/fileadmin/_processed_/e/e/csm_heavysaurus_25_c0dec6db3b.jpg",uid:1343},{artist:{country:[{nameLocalized:"Schweden",shortNameDe:"Schweden",shortNameEn:"Sweden",uid:186}],events:[],pathSegment:"hellbutcher",title:"Hellbutcher",uid:937},biography:"<p>You’ll get Hellbutcher out of Nifelheim, but never Nifelheim out of the Hellbutcher. The name already tells us what’s awaiting us. Of course, it’s the same taste that we have always liked and admired.<br /> They provide the best mix out of Black Metal, Motörhead and traditional Metal a la Judas Priest! The gates of hell open their portals and spit out the Scandinavians onto the Holy Ground – It can not get better than this.</p>",detailLink:"/de/programm/bands/band/hellbutcher/",externalMediaRatio:"16by9",externalMediaSource:"",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Hellbutcher-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Hellbutcher-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30148}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3515,uri:"https://www.facebook.com/hellbutcherchile/"},{socialnetwork:{title:"Instagram",uid:5},uid:3516,uri:"https://www.instagram.com/hellbutcherband/"},{socialnetwork:{title:"Homepage",uid:8},uid:3517,uri:"https://hellbutcher.com/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0LNxFESoHHXMTsh5RIl8L2",subtitle:"",thumbnail:"/fileadmin/_processed_/2/9/csm_Hellbutcher-WOA25-Ankuenderbild_1b6a4ef55e.jpg",uid:1254},{artist:{country:[{nameLocalized:"Mexiko",shortNameDe:"Mexiko",shortNameEn:"Mexico",uid:148}],events:[],pathSegment:"hellmidian",title:"Hellmidian",uid:1045},biography:'<p class="docData;DOCY;v5;2196;">Hellmidian is a speed-heavy metal band from Oaxaca, Mexico, formed in 2012 by Daniel, Romel, Eluzai, and Toño Bega. Influenced by Helloween, Judas Priest, and Mexican legends like Cuero y Metal, they deliver fast, energetic metal with a mix of power and technique. Their EP Rising Up and singles like Raider have gained international attention, while their lyrics range from love and heartbreak to sci-fi and urban legends. Hellmidian continues to wave the flag of traditional heavy metal, sharing stages with bands like Voltax, Skull Fist, and Metalucifer.</p>',detailLink:"/de/programm/bands/band/hellmidian/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=ww0iAXTmMfM",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Hellmidian_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Hellmidian_25.jpg",title:"",type:2,uid:34165}}],networkuri:[{socialnetwork:{title:"Instagram",uid:5},uid:3947,uri:"https://www.instagram.com/hellmidianoax/"},{socialnetwork:{title:"Facebook",uid:1},uid:3948,uri:"https://www.facebook.com/hellmidian"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0gw0QsOkjiXyTg7JuBQnqo",subtitle:"Metal Battle - Mexico",thumbnail:"/fileadmin/_processed_/9/d/csm_Hellmidian_25_43fec72ff5.jpg",uid:1411},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"helmet",title:"Helmet",uid:1030},biography:'<p class="docData;DOCY;v5;3224;">Page Hamilton hasn’t always had an easy ride in the history of Helmet. From carrying the weight of influencing an entire generation of Nu-Metal bands to dealing with shifting lineups, he’s been through it all. Yet, the leader of this Alternative Metal legend has always surrounded himself with a powerhouse group of musicians, ensuring that Helmet’s shows remain unique, wild, and packed with raw energy. If you want to understand why Metal sounded the way it did at the start of the millennium, you can’t ignore Helmet!</p>',detailLink:"/de/programm/bands/band/helmet/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=jBfygUiS50g",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Helmet_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Helmet_25.jpg",title:"",type:2,uid:34074}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3894,uri:"https://www.helmetmusic.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3895,uri:"https://www.facebook.com/HelmetMusic/"},{socialnetwork:{title:"Instagram",uid:5},uid:3896,uri:"https://www.instagram.com/helmet_music/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0qB0cTENhSUc0feov5qbg0",subtitle:"",thumbnail:"/fileadmin/_processed_/e/9/csm_Helmet_25_8098d61731.jpg",uid:1391},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"helsott",title:"Helsott",uid:204},biography:'<p class="docData;DOCY;v5;2693;">Eric Dow and his band Helsott are considered as&nbsp;one of the leading forces of Pagan Metal in the United States. Their steel-like&nbsp;blend of traditional elements and Dow’s unmistakable voice has already thundered across the Wacken fields in previous years. Yet, it feels even more special this time&nbsp;around, as the Americans ascend&nbsp;onto the Holy Ground on Odin’s wings to celebrate their 15th anniversary. Rest assured – there will be no shortage of skull-splitting riffs and first-class drum storms for this occasion.</p>',detailLink:"/de/programm/bands/band/helsott/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=OZm2KJllfsw",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Helsott_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Helsott_25.jpg",title:"",type:2,uid:33706}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3812,uri:"http://helsott.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3813,uri:"https://www.facebook.com/helsott/"},{socialnetwork:{title:"Instagram",uid:5},uid:3814,uri:"https://www.instagram.com/helsott/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"12JDRY7qnVyd2VUbqCEEhp",subtitle:"",thumbnail:"/fileadmin/_processed_/f/3/csm_Helsott_25_64d9566556.jpg",uid:1363},{artist:{country:[{nameLocalized:"Niederlande",shortNameDe:"Niederlande",shortNameEn:"Netherlands",uid:157}],events:[],pathSegment:"hyla",title:"HYLA",uid:1050},biography:`<p class="docData;DOCY;v5;2507;">HYLA is a hard-hitting, passionate, and intense progressive metal force from the Netherlands. Fusing eccentric songwriting, rhythmically complex riffs, and ethereal soundscapes, the band crafts a distinct sonic identity rooted in existential and deeply personal lyricism.</p>\r
<p>Drawing vocal inspiration from Leprous and Jeff Buckley, dynamic composition from Opeth and The Contortionist, and channeling the aggression and groove of Meshuggah and Gojira, HYLA creates an immersive and emotionally charged experience. Their sound is massive, tight, and organic—crushing stages and captivating audiences with every performance.</p>`,detailLink:"/de/programm/bands/band/hyla/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=hpVCkl6OYJA",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Hyla_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Hyla_25.jpg",title:"",type:2,uid:34170}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3957,uri:"https://www.facebook.com/HylaProg"},{socialnetwork:{title:"Instagram",uid:5},uid:3958,uri:"https://www.instagram.com/hyla_band"},{socialnetwork:{title:"Youtube",uid:6},uid:3959,uri:"https://www.youtube.com/@Hylaband"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"7hpxHWdnM6cECjtgqMiWOo",subtitle:"Metal Battle - Netherlands",thumbnail:"/fileadmin/_processed_/2/f/csm_Hyla_25_3b01555a51.jpg",uid:1416},{artist:{country:[{nameLocalized:"Norwegen",shortNameDe:"Norwegen",shortNameEn:"Norway",uid:158}],events:[],pathSegment:"in-the-woods",title:"In The Woods",uid:940},biography:"<p>We proudly present to you one of the bands that was a birth attendant to a genre that later became known as Pagan Metal. In the Woods are deeply rooted in Black Metal, but are always evolving and playing within a genre they co-founded themselves.<br /> The band is looking back at a history full of changes in line-up and irregularity; however, today their fans can not only expect consistency but also quality.</p>",detailLink:"/de/programm/bands/band/in-the-woods/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=SVXayule47w",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"in_the_woods_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/in_the_woods_25.jpg",title:"",type:2,uid:33707}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3523,uri:"https://www.facebook.com/inthewoodsomnio/"},{socialnetwork:{title:"Instagram",uid:5},uid:3524,uri:"https://www.instagram.com/inthewoodsofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"41E3QF87uVy2sVvX2TobhI",subtitle:"",thumbnail:"/fileadmin/_processed_/6/3/csm_in_the_woods_25_e72ef69e9b.jpg",uid:1257},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"induction",title:"Induction",uid:1028},biography:'<p class="docData;DOCY;v5;2436;">Power Metal runs in the Hansen family’s blood. How else would you explain Tim Hansen stepping up to follow in his legendary father’s footsteps, emerging from the steel forges of Hamburg with his own band, ready to take the world by storm with anthemic vocals, blazing guitars, and heroic epics? With two albums under their belt and their latest single Medusa, Induction has come to stay – and they won’t need to be told twice!</p>',detailLink:"/de/programm/bands/band/induction/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=vK54r_Vw-dY",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"induction_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/induction_25.jpg",title:"",type:2,uid:34071}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3885,uri:"https://inductionofficial.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3886,uri:"https://www.facebook.com/inductionofficial"},{socialnetwork:{title:"Instagram",uid:5},uid:3887,uri:"https://www.instagram.com/inductionofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5mPSuVF1DeqeY3SpIt2f00",subtitle:"",thumbnail:"/fileadmin/_processed_/9/2/csm_induction_25_261b1a666e.jpg",uid:1388},{artist:{country:[{nameLocalized:"Dänemark",shortNameDe:"Dänemark",shortNameEn:"Denmark",uid:56}],events:[],pathSegment:"iotunn",title:"Iotunn",uid:948},biography:'<p>The Danish outfit Iotunn invites you on a cosmic journey on the Holy Ground. With floating soundscapes and immense vocal range, they open a portal to another galaxy right before your eyes. Epic songs reach out to you and pull you in. With their latest album "Kinship", the band has achieved a milestone that stands unmatched in the current Heavy Metal cosmos. The only question&nbsp;which remains: Are you ready to be drawn into the complexity of these masters?</p>',detailLink:"/de/programm/bands/band/iotunn/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=KSQG8r6tWaY&list=OLAK5uy_lw1gQ0p2hroa1R6w-6LHg9uWpijngSEM4",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Iotunn-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Iotunn-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30160}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3543,uri:"https://www.facebook.com/iotunn/"},{socialnetwork:{title:"Instagram",uid:5},uid:3544,uri:"https://www.instagram.com/iotunn/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3yJvUOZq6oH130RTa68hQz",subtitle:"",thumbnail:"/fileadmin/_processed_/3/4/csm_Iotunn-WOA25-Ankuenderbild_ee2138a7fb.jpg",uid:1265},{artist:{country:[{nameLocalized:"Schweden",shortNameDe:"Schweden",shortNameEn:"Sweden",uid:186}],events:[],pathSegment:"istapp",title:"Istapp",uid:942},biography:"<p>In the midst of summer Istapp promises to freeze the Holy Ground. The Swedish band tag along the freezing cold Scandinavian Winter to Wacken. They also bring their Black Metal along where not even the hotness of the sun can provide you from escaping the cozy discomfort of frost, which has to be felt with every inch of your body.&nbsp;</p>",detailLink:"/de/programm/bands/band/istapp/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/channel/UC0zyyw4uI6H3u9_PVVAp8bw",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Istapp-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Istapp-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30154}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3528,uri:"https://www.facebook.com/IstappOfficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3529,uri:"https://www.instagram.com/istappistagram/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6jiRPDlSiIzrd8dzFs2yzM",subtitle:"",thumbnail:"/fileadmin/_processed_/b/8/csm_Istapp-WOA25-Ankuenderbild_16ef4bc5dd.jpg",uid:1259},{artist:{country:[{nameLocalized:"Schweden",shortNameDe:"Schweden",shortNameEn:"Sweden",uid:186}],events:[],pathSegment:"katatonia",title:"Katatonia",uid:988},biography:"<p>Dark clouds gather over the Holy Ground, huge flights of black crows circle around the sky and there is a magic full moon shining on the firmament. This is the perfect setting for the KATATONIA show, where they unleash fulminating guitar riffs while you dwell in melancholic memories. Sweden’s grandmasters of darkness grace us with their mighty presence after eight years for the second time, presenting the current album „Sky Void Of Stars“. We shine with joy from inside and outside we wear a black, plain bandshirt: Right in the style of Lord Seth, Blakkheim and their mates.</p>",detailLink:"/de/programm/bands/band/katatonia/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=_ILWPwc4KaY",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"katatonia_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/katatonia_25.jpg",title:"",type:2,uid:32666}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3717,uri:"https://katatonia.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3718,uri:"https://www.facebook.com/katatonia"},{socialnetwork:{title:"Instagram",uid:5},uid:3719,uri:"https://www.instagram.com/katatoniaband/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"2CWWgbxApjbyByxBBCvGTm",subtitle:"",thumbnail:"/fileadmin/_processed_/2/d/csm_katatonia_25_e44b65dd06.jpg",uid:1327},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"kilt",title:"Kilt",uid:1059},biography:`<p class="docData;DOCY;v5;5011;">We love&nbsp;Metal – that much is clear. And we love to party. Sometimes both come together – like with Kilt.</p>\r
<p>Kiel’s answer to all things heavy and heavier is celebrating 25 years of existence. And of course, that calls for celebration: with brutal riff salvos, snarling vocals, and drum fills powerful enough to launch the dead from their graves.</p>\r
<p>It’s a shame this ferocious five-piece hasn’t released an album in over 10 years. Maybe their show at the Landgasthof will breathe new creativity into them, and the wait will finally be over – the time is ripe for a new&nbsp;Thrash/Death manifesto.</p>`,detailLink:"/de/programm/bands/band/kilt/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=6hdc1Mgl03g",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"kilt_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/kilt_25.jpg",title:"",type:2,uid:34327}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3988,uri:" https://www.facebook.com/Kilt.official/?locale=de_DE"},{socialnetwork:{title:"Instagram",uid:5},uid:3989,uri:"https://www.instagram.com/kilt_metal/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5anVfgg1k33e4OUNysbcOc",subtitle:"",thumbnail:"/fileadmin/_processed_/2/f/csm_kilt_25_02cffb3c61.jpg",uid:1427},{artist:{country:[{nameLocalized:"Dänemark",shortNameDe:"Dänemark",shortNameEn:"Denmark",uid:56}],events:[],pathSegment:"king-diamond",title:"King Diamond",uid:1002},biography:`<p class="docData;DOCY;v5;3649;">Few have influenced Metal as profoundly as the King! Whether with Mercyful Fate or as a solo artist, his unmistakable vocal style, thematic choices, aura of absolute evil, and the unease he and his equally talented bandmates—like Andy LaRocque—have conjured on stage for 40 years have paved the way for generations of Metal musicians and served as a lasting inspiration.</p>\r
<p>Albums like&nbsp;<em>Fatal Portrait, Abigail</em>, or&nbsp;<em>Them</em>&nbsp;belong without question in any Top 100 list of the greatest Metal albums of all time.</p>\r
<p>King Diamond is the musical embodiment of a horror film with a heavy occult twist!&nbsp;We can’t wait.</p>`,detailLink:"/de/programm/bands/band/king-diamond/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=HVW0ZfxFF08",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"king_diamond_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/king_diamond_25.jpg",title:"",type:2,uid:32950}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3781,uri:"https://kingdiamondcoven.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3782,uri:"https://www.facebook.com/kingdiamond"},{socialnetwork:{title:"Instagram",uid:5},uid:3783,uri:"https://www.instagram.com/kingdiamond/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5i0ph60TnwTlIGrOZAmcZa",subtitle:"",thumbnail:"/fileadmin/_processed_/4/9/csm_king_diamond_25_40047f199d.jpg",uid:1350},{artist:{country:[{nameLocalized:"Brasilien",shortNameDe:"Brasilien",shortNameEn:"Brazil",uid:29}],events:[],pathSegment:"krisiun",title:"Krisiun",uid:949},biography:"<p>Emerging from the deep forests and riverbeds of the Amazonas a deathbringing monster paths it’s way to the W:O:A 2025. Merciless guitar-riffs are drilling through everything that stands in their way.<br /> Nothing is capable to stand against this primordial power. It only stops just right before arriving at the Holy Ground. Krisiun are back in Wacken!</p>",detailLink:"/de/programm/bands/band/krisiun/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=y0xFqFlJfK8",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Krisiun-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Krisiun-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30161}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3545,uri:"https://www.facebook.com/krisiun.official/"},{socialnetwork:{title:"Instagram",uid:5},uid:3546,uri:"https://www.instagram.com/krisiun/"},{socialnetwork:{title:"Homepage",uid:8},uid:3547,uri:"https://krisiun.com.br"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3pzAW9xs16rX8fukH8wV6N",subtitle:"Special 90s Set",thumbnail:"/fileadmin/_processed_/5/f/csm_Krisiun-WOA25-Ankuenderbild_cd0a41aec4.jpg",uid:1266},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"kylesa",title:"Kylesa",uid:973},biography:"<p>After a decade away from the stage, we are beyond excited to welcome Kylesa back for their 25th anniversary with an almost exclusive performance on the Holy Ground! Phillip Cope and Laura Pleasants are masters at pushing boundaries and refuse to be confined to a single genre. Their sound is unmistakable and clearly could not be forgotten during the last ten years. We couldn’t be more thrilled that Kylesa is joining us for Wacken 2025—this is going to be an unforgettable experience.</p>",detailLink:"/de/programm/bands/band/kylesa/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=VlbC-hk25Aw",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"kylesa25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/kylesa25.jpg",title:"",type:2,uid:32219}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3664,uri:"https://www.kylesamusic.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3665,uri:"https://www.facebook.com/KYLESAmusic"},{socialnetwork:{title:"Instagram",uid:5},uid:3666,uri:"https://www.instagram.com/Kylesa_band/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"7mO0JGOATH8fVHvgCdZsXh",subtitle:"",thumbnail:"/fileadmin/_processed_/a/b/csm_kylesa25_dde1bd5836.jpg",uid:1308},{artist:{country:[{nameLocalized:"Großbritannien",shortNameDe:"Großbritannien",shortNameEn:"United Kingdom",uid:74}],events:[],pathSegment:"lake-malice",title:"Lake Malice",uid:981},biography:'<p class="docData;DOCY;v5;2963;">They are influenced by Japanese anime style and everyday life in all its painful and traumatic ways. Lake Malice from Brighton, UK, are musicians Alice Guala and Blake Cornwall. The duo has already been nominated twice at the Heavy Music Awards, played headline shows in their home country of England and in Germany. Now&nbsp;another highlight is added with their show at W:O:A 2025, that is promising to be quite some spectacle.</p>',detailLink:"/de/programm/bands/band/lake-malice/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=W-QSp4NkeoI",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"lake_malice25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/lake_malice25.jpg",title:"",type:2,uid:32577}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3695,uri:"https://www.facebook.com/lakemalice/"},{socialnetwork:{title:"Instagram",uid:5},uid:3696,uri:"https://www.instagram.com/lakemalice/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4zoN3D2RviWzWeHvkT3wWO",subtitle:"",thumbnail:"/fileadmin/_processed_/d/d/csm_lake_malice25_2cbab12b4a.jpg",uid:1319},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"lakeview",title:"Lakeview",uid:976},biography:'<p class="docData;DOCY;v5;3488;">What already works perfectly in small restaurants and church basements as well as in large arenas is even better suited for Wacken: The Country-Rock duo Lakeview from Nashville has plenty of real-life stories to tell on their self-titled debut album. Jesse and Luke got pure dynamite to share with the world - after all, they both had their hearts broken by the same woman, share a passion for Metalcore and a blue-collar background. The two-piece also already has proven its songwriting abilities for acts like Breaking Benjamin. The success of their first single "Home Team" is therefore no surprise. Next up in a so far highlight-driven career: The Holy Ground in Wacken.</p>',detailLink:"/de/programm/bands/band/lakeview/",externalMediaRatio:"16by9",externalMediaSource:"https://youtu.be/SJUpod5a9hY",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"lakeview_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/lakeview_25.jpg",title:"",type:2,uid:32571}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3678,uri:"https://www.lakeviewofficial.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3679,uri:"https://www.facebook.com/lakeviewofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3680,uri:"https://www.instagram.com/lakeview"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4m7IOKt2QRPsoHJSWBmeZD",subtitle:"",thumbnail:"/fileadmin/_processed_/4/8/csm_lakeview_25_f4fb48b76b.jpg",uid:1313},{artist:{country:[{nameLocalized:"Frankreich",shortNameDe:"Frankreich",shortNameEn:"France",uid:72}],events:[],pathSegment:"landmvrks",title:"Landmvrks",uid:986},biography:'<p class="docData;DOCY;v5;2354;">Ah, France. Baguettes, the Eiffel Tower, and chanson. And Metalcore! Landmvrks have managed to secure a spot at the top of the international Metalcore scene within just a decade. The band from Marseille has toured Europe, the USA, and Japan, and now they’re bringing their unique blend of aggression and irresistibly sweet choruses to the Holy Ground. A debut that will make genre fans’ hearts race and turn Wacken into the city of love!</p>',detailLink:"/de/programm/bands/band/landmvrks/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=MTfot89Ddqc",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"landmvrks25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/landmvrks25.jpg",title:"",type:2,uid:32664}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3711,uri:"https://www.landmvrks.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3712,uri:"https://www.facebook.com/LANDMVRKS/"},{socialnetwork:{title:"Instagram",uid:5},uid:3713,uri:"https://www.instagram.com/landmvrks/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6G43CiunIxMwb2tQ12vNP6",subtitle:"",thumbnail:"/fileadmin/_processed_/3/b/csm_landmvrks25_0c1fca38a7.jpg",uid:1325},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"letzte-instanz",title:"Letzte Instanz",uid:423},biography:'<p class="docData;DOCY;v5;2957;">We bid farewell – not in silence, but at the top of our lungs! 25+1 years of Letzte&nbsp;Instanz – one final time at Wacken. One last time, songs like Rapunzel and Morgenland will echo across our stage. The Dresden band, who were a W:O:A companion in various incarnations over the years, are a true institution in German music, known for their successful blend of medieval sounds, Rock, Classical music, and Electronic elements. As the curtain falls at the end of 2025, we’ll make sure to celebrate them properly – you have our word!</p>',detailLink:"/de/programm/bands/band/letzte-instanz/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=B_ZMt6VnGRM",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"letzte_Instanz_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/letzte_Instanz_25.jpg",title:"",type:2,uid:33708}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3815,uri:"https://www.letzte-instanz.de"},{socialnetwork:{title:"Facebook",uid:1},uid:3816,uri:"https://de-de.facebook.com/letzteinstanz/"},{socialnetwork:{title:"Instagram",uid:5},uid:3817,uri:"https://www.instagram.com/letzteinstanzband/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5aOk0TpKD3HlbC1jwCdu3M",subtitle:"",thumbnail:"/fileadmin/_processed_/f/d/csm_letzte_Instanz_25_ea1fbd75c5.jpg",uid:1364},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"liliac",title:"Liliac",uid:974},biography:"<p>What happens when five siblings grow up in a musical household with a father being a music producer? The answer: Liliac! Founded in 2015, the Rock band gained attention with a stunning performance on America’s Got Talent and has released several albums and cover songs. The Metal vamps are mysterious and theatrical, just as their band name suggests. Sprung out of the Romanian language Liliac means bat.</p>",detailLink:"/de/programm/bands/band/liliac/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=xrtMmOYoUCI",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"liliac25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/liliac25.jpg",title:"",type:2,uid:32220}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3667,uri:"https://www.liliacband.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3668,uri:"https://www.facebook.com/liliacband/"},{socialnetwork:{title:"Instagram",uid:5},uid:3669,uri:"https://www.instagram.com/liliacband/"},{socialnetwork:{title:"Youtube",uid:6},uid:3670,uri:"https://www.youtube.com/@LILIACBAND"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"59JYc4smLqWbRz93IzN5lw",subtitle:"",thumbnail:"/fileadmin/_processed_/3/0/csm_liliac25_2840a02f6d.jpg",uid:1309},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"lita-ford",title:"Lita Ford",uid:979},biography:`<p class="docData;DOCY;v5;2536;">First making a name for herself with The Runaways, later building a successful solo career and surviving a marriage to Chris Holmes (formerly of W.A.S.P.), Lita Ford lives and breathes Metal! Throughout her not-always-easy career, this exceptional guitarist and unforgettable singer has seen many highlights – but the Holy Ground and the unique Wacken experience were not among them. Until now.</p>\r
<p>In 2025, she will finally grace us with a show. Welcome to Wacken, Lita Ford!</p>`,detailLink:"/de/programm/bands/band/lita-ford/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=kIt3OGra3Lo",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"lita_ford_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/lita_ford_25.jpg",title:"",type:2,uid:32575}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3690,uri:"http://www.litafordonline.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3691,uri:"https://www.facebook.com/litaofficial"},{socialnetwork:{title:"Instagram",uid:5},uid:3692,uri:"https://www.instagram.com/litafordofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"77tBvvyd6SD4Y9Um1xcbxP",subtitle:"",thumbnail:"/fileadmin/_processed_/2/0/csm_lita_ford_25_7acf0e3606.jpg",uid:1317},{artist:{country:[{nameLocalized:"Dänemark",shortNameDe:"Dänemark",shortNameEn:"Denmark",uid:56}],events:[],pathSegment:"livlos",title:"Livlos",uid:1053},biography:`<p class="docData;DOCY;v5;3561;">What do you want? Melodic Death Metal from Denmark! Where do you want it? At W:O:A 2025! And when do you want it? Now!</p>\r
<p>Luckily, our neighbors from the north are sending one of their hottest Heavy Metal exports straight to Wacken: Livløs are ready to melt even the toughest hearts of hardened Metalheads.</p>\r
<p>For over a decade, this Danish five-piece has been feeding melancholic Metalheads without ever compromising on sheer heaviness.</p>\r
<p>With their latest album The Crescent King, Livløs undoubtedly have a red-hot iron in the fire—one they’ll use to set the Landgasthof ablaze. Because if there’s one thing we can truly use during a Wacken summer, it’s a solid dose of searing Metal!</p>`,detailLink:"/de/programm/bands/band/livlos/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=jr78395hYvU",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"livlos_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/livlos_25.jpg",title:"",type:2,uid:34296}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3968,uri:"https://livloesband.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3969,uri:"https://www.facebook.com/livloesband"},{socialnetwork:{title:"Instagram",uid:5},uid:3970,uri:"https://www.instagram.com/livloesband/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3upLnjEfkXlcb8IddTLQUA",subtitle:"",thumbnail:"/fileadmin/_processed_/4/a/csm_livlos_25_45de9871de.jpg",uid:1420},{artist:{country:[{nameLocalized:"Finnland",shortNameDe:"Finnland",shortNameEn:"Finland",uid:67}],events:[],pathSegment:"lost-society",title:"Lost Society",uid:424},biography:'<p class="docData;DOCY;v5;2552;">In 2012, they proudly climbed to third place on the podium at the Global Battle Of The Bands, representing their home country of Finland. A year later, they charted at #25 on the national charts with their debut album and received a nomination for the Emma Awards. The loud success continues. When guitarist and vocalist Samy Elbanna founded LOST SOCIETY at the age of 14, he could hardly have imagined it would become Finland’s number one Thrash Metal insider tip. Fast Loud Death — it’s going to be a blast!</p>',detailLink:"/de/programm/bands/band/lost-society/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=h4cbw8sD56Y",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"lost_society25.jpg",publicUrl:"/fileadmin/user_upload/news_images/lost_society25.jpg",title:"",type:2,uid:32931}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3747,uri:"https://lostsociety.fi/"},{socialnetwork:{title:"Facebook",uid:1},uid:3748,uri:"https://www.facebook.com/lostsocietyfinland"},{socialnetwork:{title:"Instagram",uid:5},uid:3749,uri:"https://www.instagram.com/lostsocietyfi"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5Vy1NbrZXTMTAGFa4Im6hN",subtitle:"",thumbnail:"/fileadmin/_processed_/3/f/csm_lost_society25_8049c4d017.jpg",uid:1338},{artist:{country:[],events:[],pathSegment:"macabre",title:"Macabre",uid:967},biography:'<p class="docData;DOCY;v5;2636;">When Chicago’s Macabre visited W:O:A for the first and only time in 2002 there was no Instagram or Whatsapp&nbsp;.The world was a different one than it is today. Long before Netflix discovered Jeffrey Dahmer, the group released a concept album about the Milwaukee serial killer 20 years earlier. In general, serial killers seem to have a special appeal to the Death Metal trio, as a large portion of their songs focus on this theme. Consistency also plays a big role: Macabre has existed with the same line-up since their founding in 1985.</p>',detailLink:"/de/programm/bands/band/macabre/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=7KevkZrLKi4&list=OLAK5uy_nYtF4TDnAzZwPARoeBDFADzgDMT2lf168&index=33",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"macabre_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/macabre_25.jpg",title:"",type:2,uid:30714}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3625,uri:"https://www.facebook.com/OFFICIALMACABRE/"},{socialnetwork:{title:"Instagram",uid:5},uid:3626,uri:"https://www.instagram.com/the.real.macabre/"},{socialnetwork:{title:"Youtube",uid:6},uid:3627,uri:"https://www.youtube.com/c/MURDERMETAL1985/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"2lbJzDX11fy6cLeFtlkUA8",subtitle:"40th Anniversary Show",thumbnail:"/fileadmin/_processed_/f/5/csm_macabre_25_2c71b42403.jpg",uid:1296},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"machine-head",title:"Machine Head",uid:955},biography:"<p>Only a few names in Wacken History can create such feelings of happiness and nostalgia like Robb Flynn and co. do. Their legendary 2009 show is part of the collective Wacken mind.<br /> And because it was that beautiful, we went ahead and invited the gentlemen again. The groove that underpins their Thrash Metal is unmatched in the Bay Area and probably worldwide.<br /> Additionally, there’s Robb’s undeniable Charisma. We suggest:&nbsp; Get your neck-muscles started.&nbsp;</p>",detailLink:"/de/programm/bands/band/machine-head/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=mgSHazBbDNU",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Machine_Head-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Machine_Head-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30167}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3562,uri:"https://www.machinehead1.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3563,uri:"https://www.facebook.com/MachineHead/"},{socialnetwork:{title:"Instagram",uid:5},uid:3564,uri:"https://www.instagram.com/machine_head/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0lVlNsuGaOr9vMHCZIAKMt",subtitle:"",thumbnail:"/fileadmin/_processed_/d/e/csm_Machine_Head-WOA25-Ankuenderbild_7c9b546fec.jpg",uid:1273},{artist:{country:[{nameLocalized:"Schweden",shortNameDe:"Schweden",shortNameEn:"Sweden",uid:186}],events:[],pathSegment:"majestica",title:"Majestica",uid:993},biography:'<p class="docData;DOCY;v5;2314;">Symphonic Power Metal is starting to roll again: In spring 2025, Swedish band MAJESTICA will release „<em>Power Train“</em>, delivering new music filled with epic choirs, triumphant melodies, and powerful riffs. We want to celebrate this with you and welcome the Swedes for their festival debut. The course is set - full speed ahead to W:O:A 2025!</p>',detailLink:"/de/programm/bands/band/majestica/",externalMediaRatio:"16by9",externalMediaSource:"https://youtu.be/UO37wJG1j2k?feature=shared",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"majestica_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/majestica_25.jpg",title:"",type:2,uid:32932}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3750,uri:"https://majesticametal.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3751,uri:"https://www.facebook.com/Majesticametal"},{socialnetwork:{title:"Instagram",uid:5},uid:3752,uri:"https://www.instagram.com/majesticametal"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"52lkxAYfC9ypaPJ2EB22ki",subtitle:"",thumbnail:"/fileadmin/_processed_/0/5/csm_majestica_25_ec1f11559a.jpg",uid:1339},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"mambo-kurt",title:"Mambo Kurt",uid:203},biography:`<p class="docData;DOCY;v5;2807;">Cult is a word that gets thrown around far too often. How quickly this status is declared, even for the most minor artistic contributions, becomes clear when someone steps onto the scene who is truly cult. Because let’s be honest – it doesn’t get much bigger than Mambo Kurt at W:O:A.</p>\r
<p>The maestro of the home organ is often mentioned in the same breath as the greats (Mozart!), and even that hardly does him justice! Sure, there are doubters – but anyone who has found themselves in the pit at Mambo’s show, swaying to the mesmerizing sounds of Jump or The Final Countdown, knows: We were right!</p>`,detailLink:"/de/programm/bands/band/mambo-kurt/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=G8ioTszy9D8",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"mambo_kurt24.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2024/mambo_kurt24.jpg",title:"",type:2,uid:34088}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3928,uri:"https://mambokurt.de"},{socialnetwork:{title:"Facebook",uid:1},uid:3929,uri:"https://www.facebook.com/mambokurtoffiziell/"},{socialnetwork:{title:"Instagram",uid:5},uid:3930,uri:"https://www.instagram.com/mamboookurt/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"29t2xhTM0SRjm8iTNVMynh",subtitle:"",thumbnail:"/fileadmin/_processed_/f/a/csm_mambo_kurt24_167233d66e.jpg",uid:1403},{artist:{country:[{nameLocalized:"Schweden",shortNameDe:"Schweden",shortNameEn:"Sweden",uid:186}],events:[],pathSegment:"maanegarm",title:"Månegarm",uid:1012},biography:"<p>Can you hear that? The wolves are on the loose! Månegarm have traveled all the way from Sweden to the Holy Ground, ready to ambush you with their furious mix of Black Metal, Folk, violin, and Viking pathos. Even after almost&nbsp;30 years, their relentless salvos show no sign&nbsp;of age – they’ll strike you mercilessly. Only during the rare calm, folk-driven passages you’ll&nbsp;have a chance to catch your breath. The hunt shall start!</p>",detailLink:"/de/programm/bands/band/maanegarm/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=_E0hu6Y6jG4",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"manegarm_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/manegarm_25.jpg",title:"",type:2,uid:33709}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3818,uri:"https://www.facebook.com/Manegarmsweden/"},{socialnetwork:{title:"Instagram",uid:5},uid:3819,uri:"https://www.instagram.com/manegarmofficial/"},{socialnetwork:{title:"Youtube",uid:6},uid:3820,uri:"https://www.youtube.com/watch?v=_E0hu6Y6jG4"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6jQgWQKirZ7IKDGN8fRtdA",subtitle:"",thumbnail:"/fileadmin/_processed_/6/2/csm_manegarm_25_1ebba06a50.jpg",uid:1365},{artist:{country:[{nameLocalized:"Kroatien",shortNameDe:"Kroatien",shortNameEn:"Croatia",uid:93}],events:[],pathSegment:"mark-my-words",title:"Mark My Words",uid:1041},biography:"<p>Mark My Words! is a metalcore band from Serbia, formed in 2019 by drummer Budimir Bošnjaković and guitarist/vocalist Marko Božović in Gornji Milanovac. Joined by bassist Vladimir Rasić, they debuted with the single Through My Eyes in 2020. After lineup changes and the addition of rhythm guitarist Đorđe Paunović and lead guitarist Lazar Pantelić, the band recorded their debut EP Nocturnal Lights. In 2025, they were selected to represent Serbia at the Wacken Metal Battle Balkan final in Zagreb, becoming the third Serbian band to perform at Wacken Open Air. Their first live shows in Serbia will follow the release of the EP.</p>",detailLink:"/de/programm/bands/band/mark-my-words/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=Y2XJ6R5vDAg",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"mark_my_words_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/mark_my_words_25.jpg",title:"",type:2,uid:34161}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3939,uri:"https://www.facebook.com/p/Mark-My-Words-100064254873682/"},{socialnetwork:{title:"Instagram",uid:5},uid:3940,uri:"https://www.instagram.com/markmywordsband/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5qCI4JhqFp93gTK0qNwSOE",subtitle:"Metal Battle Balkan Regions",thumbnail:"/fileadmin/_processed_/2/a/csm_mark_my_words_25_b3cb1ab9fb.jpg",uid:1407},{artist:{country:[{nameLocalized:"Italien",shortNameDe:"Italien",shortNameEn:"Italy",uid:104}],events:[],pathSegment:"master-boot-record",title:"Master Boot Record",uid:987},biography:'<p class="docData;DOCY;v5;2414;">Technology has taken a giant leap forward in this millennium. Fortunately, Master Boot Record harnesses the immense possibilities these tools offer to create their music, but you don’t need a degree in programming to enjoy it. Their style, somewhere between Heavy Metal, synthesizers, and classical music, also incorporates elements of video game soundtracks. Loading… W:O:A 2025.</p>',detailLink:"/de/programm/bands/band/master-boot-record/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=gzuK4AXAbcc",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"MBR_25b.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/MBR_25b.jpg",title:"",type:2,uid:32917}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3714,uri:"https://mbrserver.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3715,uri:"https://www.facebook.com/masterbootrecordmusic/"},{socialnetwork:{title:"Instagram",uid:5},uid:3716,uri:"https://www.instagram.com/masterbootrecord/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"77s5NAGQbxu8oLstaqSwHE",subtitle:"",thumbnail:"/fileadmin/_processed_/8/9/csm_MBR_25b_e0cfccaab0.jpg",uid:1326},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"mastodon",title:"Mastodon",uid:1e3},biography:'<p class="docData;DOCY;v5;2694;">They’ve achieved what other bands can only dream of: a Grammy Award, multiple Metal Hammer Golden Gods Awards and tours with giants like Tool and Slayer. Just in time for their 25th anniversary, the four-piece Progressive Metal powerhouse is promising nothing less than "a lot of music." We can’t wait for classics like „<em>Blood and Thunder“</em> and „<em>Oblivion“</em>, as well as all the Sludge-infused highlights yet to come.</p>',detailLink:"/de/programm/bands/band/mastodon/",externalMediaRatio:"16by9",externalMediaSource:"https://youtu.be/qJ1dc9BZaW8?feature=shared",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"mastodon25b.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/mastodon25b.jpg",title:"",type:2,uid:32949}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3776,uri:"https://www.mastodonrocks.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3777,uri:"https://www.facebook.com/Mastodon"},{socialnetwork:{title:"Instagram",uid:5},uid:3778,uri:"https://www.instagram.com/mastodonrocks"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"1Dvfqq39HxvCJ3GvfeIFuT",subtitle:"",thumbnail:"/fileadmin/_processed_/c/3/csm_mastodon25b_5933dd40f9.jpg",uid:1348},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"michael-schenker",title:"Michael Schenker",uid:958},biography:"<p>There are only a few guitarists on this earth which are called a genius, and it is justified. Without a doubt Michael Schenker is one of those.<br /> His career is one of a kind in which the German exceptionalist worked with many different artists, including U.F.O, and yet, his essence was always recognized.<br /> A legacy is putting it’s feet onto the Holy Ground and letting dreams come true with an U.F.O Set.</p>",detailLink:"/de/programm/bands/band/michael-schenker/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=uva_hpLTp_I&list=OLAK5uy_nh-cVXlOu65F2e0PFOmdf1x-R2RranIuE",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Michael_Schenker-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Michael_Schenker-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30232}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3571,uri:"https://michaelschenkerhimself.com"},{socialnetwork:{title:"Instagram",uid:5},uid:3572,uri:"https://www.instagram.com/michaelschenkerrocks/"},{socialnetwork:{title:"Facebook",uid:1},uid:3573,uri:"https://www.facebook.com/MichaelSchenkerRocks/?locale=de_DE"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0W36oDVidsOqEIAKUJV4dY",subtitle:"My years with UFO",thumbnail:"/fileadmin/_processed_/b/a/csm_Michael_Schenker-WOA25-Ankuenderbild_e464fefcfb.jpg",uid:1276},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"midnight",title:"Midnight",uid:518},biography:"<p>Messy, belligerent and vile – Midnight creates the soundtrack of fights. They deliver a catchy blend of Black and Speed Metal but also dirty Punk Rock which are relentlessly compulsive.<br /> <em>“I always want it to be loud and nasty.”</em> –&nbsp;One-Man-Army Athenar explains<em>.</em> That’s almost exactly what a Midnight show is about! With “Complete and Total Hell” they bring a mixture of their finest songs to the W:O:A.</p>",detailLink:"/de/programm/bands/band/midnight/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=v5BLur53iDg",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Midnight-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Midnight-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30233}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3600,uri:"https://www.facebook.com/Midnight-118528339160/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"28KjD5HkkDDytQzKW7JzTp",subtitle:'"Complete and Total Hell" Set',thumbnail:"/fileadmin/_processed_/7/a/csm_Midnight-WOA25-Ankuenderbild_11d16f7a5f.jpg",uid:1286},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"mimi-barks",title:"Mimi Barks",uid:935},biography:"<p>Time and time again the W:O:A pushed borders and tried out innovative things, that were unthinkable to other festivals.<br /> Mimi Barks and her Doom-Trap surely isn’t a typical Wacken artist. Or is she? What does it take to be a real Wacken artist?<br /> Mimi Barks is right here, right now just right! See you in Wacken!</p>",detailLink:"/de/programm/bands/band/mimi-barks/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=efbZIAosvt8",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Mimi_Barks-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Mimi_Barks-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30122}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3510,uri:"https://www.facebook.com/mimibarksofficial"},{socialnetwork:{title:"Instagram",uid:5},uid:3511,uri:"https://www.instagram.com/mimibarks/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5A4P1UOSqbSvJKoi3VYlCC",subtitle:"",thumbnail:"/fileadmin/_processed_/a/3/csm_Mimi_Barks-WOA25-Ankuenderbild_eda11086fa.jpg",uid:1252},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"ministry",title:"Ministry",uid:950},biography:"<p>For one last time Al Jourgesen wants to have another go! One last time Ministry, one last album, and of course, the biggest Metal Festival in the world. Legends among themselves.<br /> Thus W:O:A 2025 is allowed to watch the Grandmaster of Industrial at his profession once again. As soon as Al and Ministry enter the stage, there will be welding and hammering.<br /> As an inspiration for generations of subsequent bands, Ministry started as a Synth Pop Band in the 80s. How time has changed the band’s sound. There is almost a decade between their last W:O:A appearance and their comeback in 2025.<br /> See you soon Al – We are looking forward to see you!&nbsp;</p>",detailLink:"/de/programm/bands/band/ministry/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=KfRDCnZ0oJk",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Ministry-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Ministry-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30162}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3548,uri:"https://ministryband.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3549,uri:"https://www.facebook.com/WeAreMinistry/"},{socialnetwork:{title:"Instagram",uid:5},uid:3550,uri:"https://www.instagram.com/ministry_collector/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"https://www.youtube.com/watch?v=KfRDCnZ0oJk",subtitle:"",thumbnail:"/fileadmin/_processed_/0/6/csm_Ministry-WOA25-Ankuenderbild_91cd17e503.jpg",uid:1267},{artist:{country:[{nameLocalized:"Irland",shortNameDe:"Irland",shortNameEn:"Ireland",uid:97}],events:[],pathSegment:"miracle-of-sound",title:"Miracle of Sound",uid:1013},biography:'<p class="docData;DOCY;v5;2391;">Did someone mention Ireland, video games, TV shows, and movies? Say no more! Gavin Dunne, better known to many as Miracle of Sound, delivers the perfect soundtrack for the nerds among us –&nbsp;for almost 15 years! For his W:O:A debut, the Irish maestro will perform both on the Wackinger Stage and in Wacken’s church – a double shot&nbsp;for all of you who don’t want to miss his unique soundscapes, pulsating beats, the necessary dose of heaviness, and a wild mix of genres. Sláinte!</p>',detailLink:"/de/programm/bands/band/miracle-of-sound/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=Y_PITYbmrjU",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"miracle_of_sound_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/miracle_of_sound_25.jpg",title:"",type:2,uid:33710}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3821,uri:"https://miracleofsound.rocks/"},{socialnetwork:{title:"Facebook",uid:1},uid:3822,uri:"https://www.facebook.com/MiracleOfSound"},{socialnetwork:{title:"Instagram",uid:5},uid:3823,uri:"https://www.instagram.com/miracleofsound/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4FmJD0mpgQ70SNt2EKK8tq",subtitle:"",thumbnail:"/fileadmin/_processed_/6/1/csm_miracle_of_sound_25_28bd3f27e1.jpg",uid:1366},{artist:{country:[{nameLocalized:"Finnland",shortNameDe:"Finnland",shortNameEn:"Finland",uid:67}],events:[],pathSegment:"moonsorrow",title:"Moonsorrow",uid:939},biography:"<p>With Moonsorrow we not only invited specialists in finnish mythology, but also epic, lavish, and folky vibes onto the Holy Ground.<br /> Everyone who count’s themselves as a fan of the numbered things has to put them on their must-see list. But if we’re honest Moonsorrow are a must-see for everyone else too.</p>",detailLink:"/de/programm/bands/band/moonsorrow/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=btI0AiJAC70",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"moonsorrow_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/moonsorrow_25.jpg",title:"",type:2,uid:33711}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3521,uri:"https://www.facebook.com/moonsorrowofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3522,uri:"https://www.instagram.com/moonsorrowofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4PdaU6ArZ8JTZvCX9ZWuTI",subtitle:"",thumbnail:"/fileadmin/_processed_/3/a/csm_moonsorrow_25_c95b2ca045.jpg",uid:1256},{artist:{country:[{nameLocalized:"Malta",shortNameDe:"Malta",shortNameEn:"Malta",uid:144}],events:[],pathSegment:"morsrot",title:"Morsrot",uid:1044},biography:'<p class="docData;DOCY;v5;1980;">Morsrot is a Maltese metal band reshaping death metal with raw defiance and no boundaries. Formed in 2021 by teens Kieran Brannon and Gabriel Gellel during the Covid lockdown, they’ve since released Carnal Enslavement (demo) and Septicemia (EP), and shared stages with acts like KK’s Priest and Metal Church. Now joined by Jean Gouder (bass) and Kyle Drakard (drums), Morsrot becomes the first band to represent Malta at Wacken Open Air, bringing a fierce new wave of metal to the global stage.</p>',detailLink:"/de/programm/bands/band/morsrot/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=kAvUULnMQeY",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Morsrot_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Morsrot_25.jpg",title:"",type:2,uid:34164}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3945,uri:"https://www.facebook.com/morsrot"},{socialnetwork:{title:"Instagram",uid:5},uid:3946,uri:"https://www.instagram.com/morsrot/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0tuQ7xlCrNToUYXqLjZoTl",subtitle:"Metal Battle Malta",thumbnail:"/fileadmin/_processed_/2/f/csm_Morsrot_25_171198165d.jpg",uid:1410},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"mystopera",title:"Mystopera",uid:1014},biography:`<p class="docData;DOCY;v5;2769;">You love metal? You live for epic tales, told by mighty voices and masterful musicians? Then Mystopera is exactly what you need. With the help of exceptional voices from the worlds of Folk, Rock, and Metal, Meike Katrin Stein and Markus Engelfried have created a Folk Metal opera that brings the best of epic storytelling and anthemic songs to life on the Holy Ground.</p>\r
<p>A stirring experience – tailor-made for W:O:A and all of our fans!</p>`,detailLink:"/de/programm/bands/band/mystopera/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=kuznZRxMTG8",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"mystopera_25b.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/mystopera_25b.jpg",title:"",type:2,uid:33967}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3824,uri:"https://mystopera.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3825,uri:"https://www.facebook.com/Mystopera/"},{socialnetwork:{title:"Instagram",uid:5},uid:3826,uri:"https://www.instagram.com/mystopera/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0NSA6vyZe64qcVAVHStG5q",subtitle:"",thumbnail:"/fileadmin/_processed_/9/7/csm_mystopera_25b_39b064e5dd.jpg",uid:1367},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"nailbomb",title:"Nailbomb",uid:975},biography:"<p>Yes, you read that right—Nailbomb are coming to bring their Thrash to Wacken! Over 30 years ago, the band was formed by Max Cavalera and Alex Newport, and released just one album, “Point Blank”. Now, in 2025, they are back and on their way to the Holy Ground with even more rage to spread. The new lineup includes Igor Cavalera Jr. (guitar), Travis Stone (guitar), Johny Crow (bass), Alex Cha (sampler), and Adam Jarvis (drums). Be ready!</p>",detailLink:"/de/programm/bands/band/nailbomb/",externalMediaRatio:"16by9",externalMediaSource:"",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"nailbomb_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/nailbomb_25.jpg",title:"",type:2,uid:32221}}],networkuri:[{socialnetwork:{title:"Instagram",uid:5},uid:3671,uri:"https://www.instagram.com/nailbomb_band_official/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4Q6EFOghPrRjdwsF4p7Nzm",subtitle:"",thumbnail:"/fileadmin/_processed_/0/6/csm_nailbomb_25_52a22f7eb7.jpg",uid:1310},{artist:{country:[{nameLocalized:"Belgien",shortNameDe:"Belgien",shortNameEn:"Belgium",uid:20}],events:[],pathSegment:"nasty",title:"Nasty",uid:90},biography:'<p class="docData;DOCY;v5;2146;">The W:O:A Office for Physical Exercise and Athletic Activities strongly recommends that all Metalheads check out the Nasty Show at this year’s festival. For over two decades, the Belgian Beatdown Institution has been a go-to remedy for stiff joints and boredom. With eight studio albums under their belt and now their second appearance on the Holy Ground, the four-piece led by frontman Matti has more than enough experience and raw power to give you a proper thrashing.</p>',detailLink:"/de/programm/bands/band/nasty/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=UchTv7HsX2k",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"nasty_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/nasty_25.jpg",title:"",type:2,uid:34072}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3888,uri:"http://nastylc.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3889,uri:"https://www.facebook.com/getnasty/"},{socialnetwork:{title:"Instagram",uid:5},uid:3890,uri:"https://www.instagram.com/nastybandofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"7GnX7pGXdWtLObs16B1mFB",subtitle:"",thumbnail:"/fileadmin/_processed_/c/7/csm_nasty_25_d25b1c2c26.jpg",uid:1389},{artist:{country:[{nameLocalized:"Dänemark",shortNameDe:"Dänemark",shortNameEn:"Denmark",uid:56}],events:[],pathSegment:"neckbreakker",title:"Neckbreakker",uid:1029},biography:`<p class="docData;DOCY;v5;2922;">“Oh, what nice young men,” you can still hear your mother calling from the living room. “Yeah, they’re called Neckbreakker!” you reply. End of conversation.</p>\r
<p>These five Danes may fool some with their youthful faces, but we know their name speaks for itself. And when you leave home for Wacken, rest assured—Neckbreakker will deliver such an Old-School Death Metal beatdown that upon your return, you’ll be greeted with: “What on earth happened to you?!” Dare to join in—you won’t be disappointed!</p>`,detailLink:"/de/programm/bands/band/neckbreakker/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=lH5hWD7cMHs",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"neckbreakker_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/neckbreakker_25.jpg",title:"",type:2,uid:34073}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3891,uri:"https://neckbreakker.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3892,uri:"https://www.facebook.com/Neckbreakker"},{socialnetwork:{title:"Instagram",uid:5},uid:3893,uri:"https://www.instagram.com/neckbreakkerdeath/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4bEKeZm7yf8aOqam6RI4cJ",subtitle:"",thumbnail:"/fileadmin/_processed_/c/2/csm_neckbreakker_25_7014c09c2c.jpg",uid:1390},{artist:{country:[{nameLocalized:"Bahrain",shortNameDe:"Bahrain",shortNameEn:"Bahrain",uid:23}],events:[],pathSegment:"necrosin",title:"Necrosin",uid:1046},biography:'<p class="docData;DOCY;v5;1908;">Necrosin is a death-thrashing trio from Bahrain, where the heat is brutal—and so is the metal. Formed in 2018 by scene veterans Mohammad Tael and Mahmood Al Ansari, the band channels the raw aggression of ’80s thrash and death metal, paying homage to legends like Slayer, Death, Sepultura, and Bolt Thrower. With Omar Zainal on bass completing the lineup, Necrosin unleashed their debut EP and made their live debut in 2023, opening for Incantation in Dubai.</p>',detailLink:"/de/programm/bands/band/necrosin/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=Ysc-LG9V9jc",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Necrosin_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Necrosin_25.jpg",title:"",type:2,uid:34166}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3949,uri:"https://www.facebook.com/Necrosin.BH/"},{socialnetwork:{title:"Instagram",uid:5},uid:3950,uri:"https://www.instagram.com/Necrosin.BH/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3vtCKRwBV4a1kOfUarDbJD",subtitle:"Metal Battle - Middle East",thumbnail:"/fileadmin/_processed_/2/5/csm_Necrosin_25_b2485aa786.jpg",uid:1412},{artist:{country:[{nameLocalized:"Schweden",shortNameDe:"Schweden",shortNameEn:"Sweden",uid:186}],events:[{artists:[{title:"Nestor",uid:547}],end:"1691257500",festival:null,festivalday:{end:"1691283600",start:"1691215200",title:"Saturday",uid:16},images:null,media:null,performance:{title:"Concert",uid:1},stage:{description:"",latitude:"",longitude:"",pid:167,sorting:"1536",subtitle:"",title:"W:E:T Stage",uid:8},start:"1691254800",subtitle:"",sysLanguageUid:"-1",teaser:"",title:"",uid:1050}],pathSegment:"nestor",title:"Nestor",uid:547},biography:'<p class="docData;DOCY;v5;2916;">Who doesn’t miss the good old days when we were young, full of dreams, and ready to take on any challenge? That must have been exactly how Nestor felt—but unlike most, the Swedish sensation got to extend their youthful dreams. What many Hard Rockers in the ’80s never had the chance to achieve started to come true for them in 2021. With two albums that hit like a sky-high hairsprayed bomb, the five-piece climbed to the top of the bands longing for the days of hair spray, Opel Manta, and Baywatch. And honestly, don’t we all want a little piece of that time back?</p>',detailLink:"/de/programm/bands/band/nestor/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=dX0rAmeOL0c",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"nestor_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/nestor_25.jpg",title:"",type:2,uid:34070}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3882,uri:"https://www.nestortheband.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3883,uri:"https://www.facebook.com/nestortheband/"},{socialnetwork:{title:"Instagram",uid:5},uid:3884,uri:"https://www.instagram.com/nestor_theband/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0aO5KX4PsGlEqDM8rsH0ld",subtitle:"",thumbnail:"/fileadmin/_processed_/9/0/csm_nestor_25_dc95de51f9.jpg",uid:1387},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"night-demon",title:"Night Demon",uid:951},biography:"<p>For more than a decade, Night Demon have defiantly waved the flag of traditional Heavy Metal. Unwavering in the face of shifting industry trends and unscarred by global calamities.<br /> Jarvis Leatherby and his Night Demon bandmates nowadays stand for a true Heavy Metal spirit – a group known for their infectious live-shows. They will honor us with a special set for their 10-year Anniversary of „Curse of the Damned“.&nbsp;</p>",detailLink:"/de/programm/bands/band/night-demon/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=KP-04wAWof0&list=PLa1znBpqOHzLT0aP01zxqmVWR78KavHQa",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Night_Demon-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Night_Demon-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30163}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3551,uri:"https://www.facebook.com/nightdemonband/?locale=de_DE"},{socialnetwork:{title:"Instagram",uid:5},uid:3552,uri:"https://www.instagram.com/nightdemonmetal/?hl=de"},{socialnetwork:{title:"Homepage",uid:8},uid:3553,uri:"https://nightdemon.net/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5klvF93hycKWPsqssBXY9A",subtitle:'"Curse of the Dammned" 10th Anniversary Show',thumbnail:"/fileadmin/_processed_/3/9/csm_Night_Demon-WOA25-Ankuenderbild_39336183e3.jpg",uid:1268},{artist:{country:[{nameLocalized:"Frankreich",shortNameDe:"Frankreich",shortNameEn:"France",uid:72}],events:[],pathSegment:"nightmare",title:"Nightmare",uid:1031},biography:'<p class="docData;DOCY;v5;3084;">If you’re searching for French legends of our genre, sooner or later, you’ll run into Nightmare. Born in Grenoble in the late ’70s, the band has been in the game for over four decades—aside from a ten-year hiatus between 1988 and 1999. Even after all these years and a few lineup changes, their Power Metal remains innovative, relevant, and packed with the right dose of Heavy Metal swagger. Their latest album, Encrypted, proves that Nightmare is more than ready to visit the Holy Ground once again.</p>',detailLink:"/de/programm/bands/band/nightmare/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=svsGWvgKCTU",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"nightmare_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/nightmare_25.jpg",title:"",type:2,uid:34076}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3900,uri:"https://nightmare.band"},{socialnetwork:{title:"Facebook",uid:1},uid:3901,uri:"https://www.facebook.com/nightmare.france"},{socialnetwork:{title:"Instagram",uid:5},uid:3902,uri:"https://www.instagram.com/nightmare_band.official/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3gSYde7QNAYJhvZnRtSCG5",subtitle:"",thumbnail:"/fileadmin/_processed_/7/1/csm_nightmare_25_faf3cf394e.jpg",uid:1393},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"non-est-deus",title:"Non Est Deus",uid:1032},biography:`<p class="docData;DOCY;v5;2397;">The name says it all: Black Metal in all its god-denying glory. Founded in 2017 by Kanonenfieber frontman and Feldmarschall Noise, Non Est Deus delivers uncompromising Black Metal in all its facets—piercingly cold guitars, bone-chilling screams that spiral into sheer frenzy, and one clear message: Non Est Deus – There is no God.</p>\r
<p>They say your first time on the Holy Ground is unforgettable. This band will make sure of it their’s will be, too.</p>`,detailLink:"/de/programm/bands/band/non-est-deus/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=brduLUjSqQA",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"non_est_deus_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/non_est_deus_25.jpg",title:"",type:2,uid:34077}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3903,uri:"https://www.facebook.com/nonestdeusbm/"},{socialnetwork:{title:"Instagram",uid:5},uid:3904,uri:"https://www.instagram.com/non_est_deus/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3CAMaX2bss4c0E7K4O0dTf",subtitle:"",thumbnail:"/fileadmin/_processed_/8/0/csm_non_est_deus_25_777f239c72.jpg",uid:1394},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"nyktophobia",title:"Nyktophobia",uid:989},biography:'<p class="docData;DOCY;v5;2561;">The German Melodic Death Metal quintet NYKTOPHOBIA has earned an impressive reputation in the scene - and for good reason: Experienced musicians, a knack for good label work, and a repertoire of four crushing full-length albums in the good old Gothenburg Metal style are essential factors behind their standing. No one needs to fear the dark anymore, as their latest album „<em>To The Stars“</em> sparkles far too impressively and magically in the night sky.</p>',detailLink:"/de/programm/bands/band/nyktophobia/",externalMediaRatio:"16by9",externalMediaSource:"https://youtu.be/bg0SvmTT6Ig?feature=shared",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"nyktophobia25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/nyktophobia25.jpg",title:"",type:2,uid:32670}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3729,uri:"https://www.facebook.com/nyktophobia/"},{socialnetwork:{title:"Instagram",uid:5},uid:3730,uri:"https://www.instagram.com/nyktophobiadeath/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4ufTytsSuwqjE1iSf1GiA5",subtitle:"",thumbnail:"/fileadmin/_processed_/4/1/csm_nyktophobia25_1619c4d6ad.jpg",uid:1331},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"obituary",title:"Obituary",uid:959},biography:"<p>Slowly We Rot? The band’s classic song might be named that way, but the American steamroller is yet far away from rotting.<br /> The iconic Tardy brothers visit Wacken to bring their Old-School take on Death-Metal. It could also be called a high-quality neck-breaker</p>",detailLink:"/de/programm/bands/band/obituary/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=H-4r3ZjRhts",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"obituary_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/obituary_25.jpg",title:"",type:2,uid:30717}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3574,uri:"Slowly We Rot? The band’s classic song might be named that way, but the American steamroller is yet far away from rotting. The iconic Tardy brothers visit Wacken to bring their Old-School take on Death-Metal. It could also be called a high-quality neck-br"},{socialnetwork:{title:"Facebook",uid:1},uid:3575,uri:"https://www.facebook.com/ObituaryBand/"},{socialnetwork:{title:"Instagram",uid:5},uid:3576,uri:"https://www.instagram.com/obituaryband/?hl=de"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0SbGI4sb8dAKFZnK7RFyhz",subtitle:"",thumbnail:"/fileadmin/_processed_/2/c/csm_obituary_25_787171a7c7.jpg",uid:1277},{artist:{country:[{nameLocalized:"Großbritannien",shortNameDe:"Großbritannien",shortNameEn:"United Kingdom",uid:74}],events:[],pathSegment:"orange-goblin",title:"Orange Goblin",uid:952},biography:"<p><em>“You either are Heavy Metal or you’re not!”</em> – Ben Ward, one of the founding fathers of Stoner Rock and Orange Goblin frontman, gets straight to the point.<br /> We couldn’t agree more, and that’s why we will let our eardrums thoroughly get blasted at Wacken Open Air 2025. Therefore, there is no better way than the stony, no-bullshit sounds of these Brits in the universe of heavy music.<br /> Exactly the taste we enjoy!</p>",detailLink:"/de/programm/bands/band/orange-goblin/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=0zfO6QQTlpk&list=OLAK5uy_m45SJD16phxX3R9zp2HUbsVZb1yrDumIQ&index=1",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Orange_Goblin-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Orange_Goblin-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30164}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3554,uri:"https://www.orangegoblinofficial.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3555,uri:"https://www.facebook.com/orangegoblinofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3556,uri:"https://www.instagram.com/orangegoblinofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3nutnJ57QnbWEdCWn2EyWo",subtitle:"30th Anniversary Show",thumbnail:"/fileadmin/_processed_/0/0/csm_Orange_Goblin-WOA25-Ankuenderbild_a33f1941f8.jpg",uid:1269},{artist:{country:[{nameLocalized:"Indien",shortNameDe:"Indien",shortNameEn:"India",uid:99}],events:[],pathSegment:"panchabhuta",title:"PANCHABHUTA",uid:1043},biography:'<p class="docData;DOCY;v5;1952;">Introducing Panchabhuta – a genre-defying music collective that fuses Hindustani and Carnatic classical traditions with progressive rock and metal. Inspired by Indian mythology and rooted in the ancient concept of the five cosmic elements, this five-member ensemble brings stories of gods, heroes, and cosmic forces to life through the sounds of the Sarod, Guitar, Bass, Ghatam, and Drums. The result is a powerful and immersive sonic journey that bridges tradition and modernity.</p>',detailLink:"/de/programm/bands/band/panchabhuta/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=NkuzZTkiYUo",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"phanchabuta_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/phanchabuta_25.jpg",title:"",type:2,uid:34163}}],networkuri:[{socialnetwork:{title:"Instagram",uid:5},uid:3943,uri:"https://www.instagram.com/panchabhuta_india/"},{socialnetwork:{title:"Facebook",uid:1},uid:3944,uri:"https://www.facebook.com/PanchabhutaIndia"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4rQaQsnJaDsf09Vo0fnLFR",subtitle:"Metal Battle - Indian Sub-continent",thumbnail:"/fileadmin/_processed_/4/6/csm_phanchabuta_25_90daed2ac6.jpg",uid:1409},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"papa-roach",title:"Papa Roach",uid:963},biography:`<p>Papa Roach, the iconic American Rock band, is set to ignite the stage at Wacken Open Air 2025!&nbsp;Formed in 1993, they've delivered explosive energy and raw emotion through hits like "Last Resort," "Scars," and "Help." With over two decades of relentless touring and numerous platinum albums, their powerful blend of Nu-Metal, Hard Rock, and Alternative continues to captivate fans worldwide. Frontman Jacoby Shaddix's dynamic presence and the band's electrifying performances promise an unforgettable experience at W:O:A. Get ready for a high-octane show that embodies the spirit of rock and resilience.</p>`,detailLink:"/de/programm/bands/band/papa-roach/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=z2zMwYf1bZ4",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Papa_Roach-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Papa_Roach-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30213}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3586,uri:"https://paparoachmerch.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3587,uri:"https://www.facebook.com/paparoach/"},{socialnetwork:{title:"Instagram",uid:5},uid:3588,uri:"https://www.instagram.com/paparoach/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4RddZ3iHvSpGV4dvATac9X",subtitle:"",thumbnail:"/fileadmin/_processed_/5/d/csm_Papa_Roach-WOA25-Ankuenderbild_9c2289c085.jpg",uid:1281},{artist:{country:[{nameLocalized:"Großbritannien",shortNameDe:"Großbritannien",shortNameEn:"United Kingdom",uid:74}],events:[],pathSegment:"party-cannon",title:"Party Cannon",uid:982},biography:'<p class="docData;DOCY;v5;2486;">Deathgrind has never been more colorful! Party Cannon brings you a hefty dose of Death Metal and Gore - always with a touch of humor. How else could a brightly colored band logo fit with such extreme brutality? Let’s fire up this cannon! But, put on your knee pads first, because - as the Scots titled their latest album - <em>Injuries Are Inevitable.</em></p>',detailLink:"/de/programm/bands/band/party-cannon/",externalMediaRatio:"16by9",externalMediaSource:"https://youtu.be/ZEv9EM4wPJg",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"party_cannon25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/party_cannon25.jpg",title:"",type:2,uid:32578}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3697,uri:"https://party-cannon.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3698,uri:"https://www.facebook.com/PartyCannonUK"},{socialnetwork:{title:"Instagram",uid:5},uid:3699,uri:"https://www.instagram.com/party_cannon_official/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5Oz5WX5xkESHBH5I4Wp09C",subtitle:"",thumbnail:"/fileadmin/_processed_/0/4/csm_party_cannon25_a495f904a3.jpg",uid:1320},{artist:{country:[{nameLocalized:"Chile",shortNameDe:"Chile",shortNameEn:"Chile",uid:44}],events:[],pathSegment:"pentagram-chile",title:"Pentagram (Chile)",uid:1009},biography:`<p class="docData;DOCY;v5;2834;">If you’re thinking of the quirky Doom gods, you’re not just off by a decade but miles away from the right genre. The Chileans in PENTAGRAM (CHILE) may also hail the Horned One, but they’ve been delighting his spirit and ears only since the 1980s. However, the South Americans take things to a whole different level of brutality.</p>\r
<p>With their blend of Black- and Death Metal, infused with the frenzy of Thrash, the band not only defied dictator Pinochet but also survived several lineup changes. Now, the Holy Ground awaits the unholy sounds of this cult formation once again.</p>`,detailLink:"/de/programm/bands/band/pentagram-chile/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=vk7-RNgucKg",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"pentagram_chile.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/pentagram_chile.jpg",title:"",type:2,uid:33613}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3798,uri:"https://www.facebook.com/PentagramChile1985/"},{socialnetwork:{title:"Instagram",uid:5},uid:3799,uri:"https://www.instagram.com/pentagramchile/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0xin7cSeEjVSsvNsKPHaJc",subtitle:"",thumbnail:"/fileadmin/_processed_/7/4/csm_pentagram_chile_dac2188062.jpg",uid:1357},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"peyton-parrish",title:"Peyton Parrish",uid:659},biography:"<p>The Vikings are on the loose! And Peyton Parrish is their leader. The extraordinary vocalist has already made a name for himself with contributions to the Vikings Soundtrack and several chart hits.<br /> The effortless switching between different genres of heavy music does make the American a gigantic phenomenon. He masters both the hardest and softest of sounds.<br /> After getting a taste in 2023, he returns this year and that with a band. Get your drinking horns ready!&nbsp;&nbsp;&nbsp;</p>",detailLink:"/de/programm/bands/band/peyton-parrish/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=cBNVQ4HsMag",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Peyton_Parrish-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Peyton_Parrish-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30238}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3608,uri:"https://www.facebook.com/ParrishFans/"},{socialnetwork:{title:"Instagram",uid:5},uid:3609,uri:"https://www.instagram.com/peytonparrishmusic/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"62uiaKAdkbY94iXJnXyKzc",subtitle:"",thumbnail:"/fileadmin/_processed_/8/1/csm_Peyton_Parrish-WOA25-Ankuenderbild_f0a06e9ecf.jpg",uid:1290},{artist:{country:[{nameLocalized:"Schweden",shortNameDe:"Schweden",shortNameEn:"Sweden",uid:186}],events:[],pathSegment:"primal-instinct",title:"Primal Instinct",uid:1049},biography:'<p class="docData;DOCY;v5;2308;">Hailing from Sweden, Primal Instinct began as a small rock/metal act in 2015 and has since evolved into a genre-bending force. Fusing elements of rock, metal, punk, and country, their raw sound has drawn a diverse and growing audience. Their debut album Terrified (2018) introduced this primal energy, while Devastation (2021) showcased their growth and depth. In 2024, the release of the heavier, darker singles The End of You and I, Primal, and Death Is My Name cemented their evolution. Known for powerful storytelling and high-energy performances, Primal Instinct has made their mark across Sweden with numerous sold-out bar and festival shows.</p>',detailLink:"/de/programm/bands/band/primal-instinct/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=MAXxHASMWeY",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Primal_Instinct_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Primal_Instinct_25.jpg",title:"",type:2,uid:34169}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3955,uri:"https://www.facebook.com/Primalinstinctband"},{socialnetwork:{title:"Instagram",uid:5},uid:3956,uri:"https://www.instagram.com/primalinstinctofficial"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6AT7R1PY9Ky7TtlJq8pZl9",subtitle:"Metal Battle - Sweden",thumbnail:"/fileadmin/_processed_/b/5/csm_Primal_Instinct_25_a37372409f.jpg",uid:1415},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"prong",title:"Prong",uid:99},biography:'<p>Since the mid-80s, PRONG have been an indispensable force in the Metal universe and inspired icons like Nine Inch Nails and Korn. The American Groove Metal masters, led by guitarist and vocalist Tommy Victor, keep the Punk spirit alive and deliver with their latest album<em>, </em>"State of Emergency"<em>,</em> a hard-hitting soundtrack pushing against the tide of time. Live in Wacken, once more!</p>',detailLink:"/de/programm/bands/band/prong/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=_yzSFc2kzr4",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"prong25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/prong25.jpg",title:"",type:2,uid:32222}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3672,uri:"https://prongmusic.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3673,uri:"https://www.facebook.com/prongmusic"},{socialnetwork:{title:"Instagram",uid:5},uid:3674,uri:"https://www.instagram.com/prongtheband/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6SER9tY2pDIDVWVf5Ql97B",subtitle:"",thumbnail:"/fileadmin/_processed_/4/1/csm_prong25_54af7e1b06.jpg",uid:1311},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"rauhbein",title:"Rauhbein",uid:496},biography:"<p>With honest lyrics, a rough voice, and catchy Folk Rock, Rauhbein have been entertaining their fans since 2019. Their love for boisterous songs like “Fass voller Whiskey” or “Hoch die Tassen” is no coincidence. Because band leader Henry M. Rauhbein had his best and most direct experiences as a pub musician during his time in Ireland. We want to celebrate this dedication to drinking, swaying and happiness with you at W:O:A 2025.</p>",detailLink:"/de/programm/bands/band/rauhbein/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=bLLo6WlXzio",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"rauhbein25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/rauhbein25.jpg",title:"",type:2,uid:32223}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3675,uri:"https://rauhbein.de/"},{socialnetwork:{title:"Facebook",uid:1},uid:3676,uri:"https://www.facebook.com/people/Rauhbein/100064058886424/"},{socialnetwork:{title:"Instagram",uid:5},uid:3677,uri:"https://www.instagram.com/rauhbein_offiziell/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0neCOkQjYXJMLW7cvOw6fe",subtitle:"",thumbnail:"/fileadmin/_processed_/c/1/csm_rauhbein25_af935e47d2.jpg",uid:1312},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"sacrifire",title:"Sacrifire",uid:1033},biography:'<p class="docData;DOCY;v5;2529;">If there’s one thing we truly love, it’s the darkness, the eerie, the obscure and the wild. And W:O:A practically stands for exactly that. Somewhere between Dark Doom and Gothic Metal, between Paradise Lost and Type O Negative — that’s where Sacrifire have made their home. Born from a fusion of members from bands like Warpath and DeTraktor, this group, haunting the scene for over six years now, brings everything needed to captivate both you and us to the fullest, making our dark hearts beat faster. A fire is burning here — one that’s sure to spread into a full-blown Metal wildfire. The Holy Ground is ready!</p>',detailLink:"/de/programm/bands/band/sacrifire/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=GOKlAYY8oyQ",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"sacrifire_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/sacrifire_25.jpg",title:"",type:2,uid:34078}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3905,uri:"https://www.sacrifire.de"},{socialnetwork:{title:"Facebook",uid:1},uid:3906,uri:"https://www.facebook.com/sacrifiremetal/"},{socialnetwork:{title:"Instagram",uid:5},uid:3907,uri:"https://www.instagram.com/sacrifire_metal/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3wPlKJbA4v8mHqU3ABjWAd",subtitle:"",thumbnail:"/fileadmin/_processed_/5/8/csm_sacrifire_25_1f33b228c4.jpg",uid:1395},{artist:{country:[{nameLocalized:"Schweiz",shortNameDe:"Schweiz",shortNameEn:"Switzerland",uid:41}],events:[],pathSegment:"saint-city-orchestra",title:"Saint City Orchestra",uid:1015},biography:'<p class="docData;DOCY;v5;2634;">Pocket knives, chocolate, cheese, and Irish Folk Punk. Any guesses? That’s right – we’re talking about Switzerland! More precisely, about the Saint City Orchestra. And the fact that their version of Irish Folk mixed with Punk is not only authentic but also absolutely electrifying, which&nbsp;has already been impressively demonstrated by the six musicians from St. Gallen in over 400 concerts. So, if you love pogo dancing as much as devouring fondue, you simply won’t be able to avoid this orchestra from the city of saints.</p>',detailLink:"/de/programm/bands/band/saint-city-orchestra/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=gcrGvsyOHn0",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"saint_city_orchestra_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/saint_city_orchestra_25.jpg",title:"",type:2,uid:33713}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3827,uri:"https://www.saintcityorchestra.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3828,uri:"https://www.facebook.com/saintcityorchestra/"},{socialnetwork:{title:"Instagram",uid:5},uid:3829,uri:"https://www.instagram.com/saintcityorchestra/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"76O3cqwlJRuvMLP07lD2I2",subtitle:"",thumbnail:"/fileadmin/_processed_/2/4/csm_saint_city_orchestra_25_d60b7c2dc6.jpg",uid:1368},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"saltatio-mortis",title:"Saltatio Mortis",uid:319},biography:"<p>Old love never rusts! The in 2000 in Germany founded band started out as street musicians. After dedicating their lives to medieval rock music, they have been touring Metal-, Rock-, and medieval festivals all over Germany.<br /> Since then the friendship between Saltatio Mortis and the W:O:A only grew. In the meantime, it’s love. With their strong and new record “Finsterwacht”, the Karlsruhe based band once again proved their reputation.<br /> For their 2025 return to the Holy Ground, they are throwing a huge party for their 25<sup>th</sup> Anniversary.</p>",detailLink:"/de/programm/bands/band/saltatio-mortis/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=2Cb0Q9lIRMU",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"saltatio_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2024/saltatio_25.jpg",title:"",type:2,uid:34090}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3597,uri:"https://www.saltatio-mortis.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3598,uri:"https://www.facebook.com/saltatiomortisofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3599,uri:"https://www.instagram.com/saltatiomortis/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"09Z51O0q4AwHl7FjUUlFKw",subtitle:"25th Anniversary Show",thumbnail:"/fileadmin/_processed_/c/d/csm_saltatio_25_9fb2d86191.jpg",uid:1285},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"samsas-traum",title:"Samsas Traum",uid:1016},biography:"<p>“When Gregor Samsa woke one morning from restless dreams, he found himself, to his great delight, back on the Holy Ground in Wacken.” That’s probably how Kafka’s Metamorphosis would sound if it had been written for the cult band Samsas&nbsp;Traum. Despite their 29-year band history, Samsas&nbsp;Traum, in 2025, still stands for music that defies categorization, blending a colorful assortment of hard soundscapes. It’s almost hard to believe that this year will be their first time gracing our stages.</p>",detailLink:"/de/programm/bands/band/samsas-traum/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=mW3ikqnTobk",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"samsas_traum_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/samsas_traum_25.jpg",title:"",type:2,uid:33714}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3830,uri:"https://www.samsas-traum.info"},{socialnetwork:{title:"Facebook",uid:1},uid:3831,uri:"https://www.facebook.com/samsastraum.offiziell"},{socialnetwork:{title:"Homepage",uid:8},uid:3832,uri:"https://www.instagram.com/samsas_traum/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"7oiKZE6ne6y747Kbi6P8Jg",subtitle:"",thumbnail:"/fileadmin/_processed_/e/b/csm_samsas_traum_25_49e6402a10.jpg",uid:1369},{artist:{country:[{nameLocalized:"Großbritannien",shortNameDe:"Großbritannien",shortNameEn:"United Kingdom",uid:74}],events:[],pathSegment:"saxon",title:"Saxon",uid:175},biography:`<p>Saxon, the legendary British Heavy Metal band, is set to rock the Wacken Open Air 2025! Formed in 1977, Saxon has been a driving force in the New Wave of British Heavy Metal, influencing countless bands with their powerful sound and electrifying performances.<br /> Known for iconic hits like "Wheels of Steel" and "Denim and Leather," they have released over 20 studio albums and toured the globe extensively. Saxon's high-energy shows and dedication to true Metal have earned them a loyal fan base and critical acclaim.<br /> Don’t miss their next stop at Wacken 2025!</p>`,detailLink:"/de/programm/bands/band/saxon/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=SWNJWPUKXaQ",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Saxon-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Saxon-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30230}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3595,uri:"https://saxon747.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3596,uri:"https://www.facebook.com/saxon/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"71vVmHeNgCVSa5SVmfvscU",subtitle:"",thumbnail:"/fileadmin/_processed_/9/5/csm_Saxon-WOA25-Ankuenderbild_ba75dff4f1.jpg",uid:1284},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"schandmaul",title:"Schandmaul",uid:560},biography:"<p>They sing of true heroes, rogues, and scoundrels, pay homage to the king of fools and have been telling tales from the otherworld for over a quarter of a century. Schandmaul are currently celebrating their anniversary with everything that goes with it: folky joy, songs from #1 and gold-certified albums and plenty of surprises. The cat is out of the bag: the Bavarian medieval rockers are gracing us with their spirited birthday show two years after their originally planned W:O:A performance!</p>",detailLink:"/de/programm/bands/band/schandmaul/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=DkXYei3r97E",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"schandmaul_25b.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/schandmaul_25b.jpg",title:"",type:2,uid:34109}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3700,uri:"https://www.schandmaul.de/"},{socialnetwork:{title:"Facebook",uid:1},uid:3701,uri:"https://www.facebook.com/Schandmaul"},{socialnetwork:{title:"Instagram",uid:5},uid:3702,uri:"https://www.instagram.com/schandmaulband/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"388Jc5WX2TxTOgGwXidDM7",subtitle:"",thumbnail:"/fileadmin/_processed_/5/4/csm_schandmaul_25b_374f2315cc.jpg",uid:1321},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"seasons-in-black",title:"Seasons in Black",uid:1034},biography:'<p class="docData;DOCY;v5;2706;">Black is a color of longing in our wonderful, loud cosmos. The fact that the Bavarian band Seasons in Black dresses entire seasons in black might be a bit beyond our horizon—after all, W:O:A is just one week of dark joy—but it’s not entirely unimaginable. Especially not when Seasons in Black storm over us with their Death Metal as if they’ve never done anything else. Hard to believe that in 29 years of band history, they’ve never made it to the Holy Ground.</p>',detailLink:"/de/programm/bands/band/seasons-in-black/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=yUTbGdepwJw",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"seasons_in_black_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/seasons_in_black_25.jpg",title:"",type:2,uid:34079}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3908,uri:"https://www.seasonsinblack.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3909,uri:"https://www.facebook.com/seasonsinblack"},{socialnetwork:{title:"Instagram",uid:5},uid:3910,uri:"https://www.instagram.com/seasonsinblackofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"7wD8wvpCVxcQhLC9eoTGO1",subtitle:"",thumbnail:"/fileadmin/_processed_/4/a/csm_seasons_in_black_25_29fa7ffd2d.jpg",uid:1396},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"setyoursails",title:"Setyoursails",uid:991},biography:"<p>From youth centers to the big stages of the world—what many bands dream of has become reality for Setyoursails. Founded in Cologne, this four-piece quickly earned a stellar reputation within the scene, showered by the press with praise. Their audiences grew larger and larger, and now the band is setting sail for Wacken. On board: highly melodic Metalcore packed with a whole lot of depth.</p>",detailLink:"/de/programm/bands/band/setyoursails/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=yYuJFjsXylQ",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"setyoursails25-02.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/setyoursails25-02.jpg",title:"",type:2,uid:32960}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3738,uri:"https://setyoursails.net"},{socialnetwork:{title:"Facebook",uid:1},uid:3739,uri:"https://www.facebook.com/setyoursailsband/"},{socialnetwork:{title:"Instagram",uid:5},uid:3740,uri:"https://www.instagram.com/setyoursailsband/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"01AynfThIqLCNevTuPSoYk",subtitle:"",thumbnail:"/fileadmin/_processed_/3/1/csm_setyoursails25-02_4c913a2208.jpg",uid:1335},{artist:{country:[{nameLocalized:"Großbritannien",shortNameDe:"Großbritannien",shortNameEn:"United Kingdom",uid:74}],events:[],pathSegment:"seven-sisters",title:"Seven Sisters",uid:1010},biography:`<p class="docData;DOCY;v5;2596;">Twin-lead guitars? Check! High-top sneakers and leather jackets? Check! A name borrowed from Greek mythology? Check, check! You love tight riffs with a strong NWOBHM influence? So do we! And since we keep our eyes and ears open all over the globe to find the crème de la crème of Metal, there was no way we could miss SEVEN SISTERS—brought to you by us, for you.</p>\r
<p>For over a decade, these four Londoners have been paying tribute to the golden days of Angel Witch and Tygers of Pan Tang. So, it’s about time they grace the Holy Ground. Buckle up—next stop: Wacken!</p>`,detailLink:"/de/programm/bands/band/seven-sisters/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=Q9SLm4Ef7-8",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"seven_sisters_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/seven_sisters_25.jpg",title:"",type:2,uid:33614}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3800,uri:"https://www.facebook.com/sevensistersheavymetal/"},{socialnetwork:{title:"Instagram",uid:5},uid:3801,uri:"https://www.instagram.com/Sevensistersheavymetal/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6rf2iCiDMTPHSuYDbB4NWG",subtitle:"",thumbnail:"/fileadmin/_processed_/3/4/csm_seven_sisters_25_657461736d.jpg",uid:1358},{artist:{country:[{nameLocalized:"Großbritannien",shortNameDe:"Großbritannien",shortNameEn:"United Kingdom",uid:74}],events:[],pathSegment:"seven-spires",title:"Seven Spires",uid:953},biography:"<p>A genre fluid band, consisting of best friends, who was founded at the Berkley College? Seven Spires tick all these boxes and have a lot more to give!<br /> The Extreme Metal group that loves to go for a deep dive into jazz was able to win over North-America, Europe as well as Asia.<br /> Right now, Wacken is calling!</p>",detailLink:"/de/programm/bands/band/seven-spires/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=k6qcBWGRgIg",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Seven_Spires-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Seven_Spires-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30165}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3557,uri:"https://www.sevenspiresband.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3558,uri:"https://www.facebook.com/sevenspiresband/"},{socialnetwork:{title:"Instagram",uid:5},uid:3559,uri:"https://www.instagram.com/sevenspiresband/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"2lP1T5oI2BjkLq9axMhG2o",subtitle:"",thumbnail:"/fileadmin/_processed_/1/8/csm_Seven_Spires-WOA25-Ankuenderbild_96ea94c222.jpg",uid:1270},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"shantallica",title:"Shantallica",uid:1017},biography:"<p>Shanty meets Metallica – Shantallica. The name already hints towards&nbsp;the genre crossover, and Shantallica deliver exactly the version of your favorite Metal Fab Four classics, you didn’t know you were looking for. Until now! Experience the songs of James, Lars, Robert, and Kirk in a completely unfamiliar yet strangely familiar way. The fact that these shanty-infused Metallica disciples haven’t made their way to our northern shores in their 15-year history is practically a crime. But we are now doing something about it! Enter Shantmen.</p>",detailLink:"/de/programm/bands/band/shantallica/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=PUwJA5tdaUQ",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"shantallica_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/shantallica_25.jpg",title:"",type:2,uid:33715}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3833,uri:"https://shantallica.de"},{socialnetwork:{title:"Facebook",uid:1},uid:3834,uri:"https://www.facebook.com/Shantallica/"},{socialnetwork:{title:"Instagram",uid:5},uid:3835,uri:"https://www.instagram.com/shantallica/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5AGWza1ESgJsObIvjTyyEt",subtitle:"",thumbnail:"/fileadmin/_processed_/a/d/csm_shantallica_25_bccf559527.jpg",uid:1370},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[{artists:[{title:"Skyline",uid:152}],end:"1722527100",festival:null,festivalday:{end:"1722560400",start:"1722492000",title:"Thursday",uid:20},images:null,media:null,performance:{title:"Meet & Greet",uid:9},stage:{description:"",latitude:"",longitude:"",pid:167,sorting:"3584",subtitle:"",title:"Meet & Greet I",uid:19},start:"1722524400",subtitle:"",sysLanguageUid:"-1",teaser:"",title:"",uid:1892}],pathSegment:"skyline",title:"Skyline",uid:152},biography:`<p class="docData;DOCY;v5;2327;">Skyline belongs to Wacken like Thomas Jensen, Holger Hübner, or the Skull! From humble beginnings in the Kuhle to tens of thousands of Metalheads rocking out on the Holy Ground, Skyline has seen it all and remains forever intertwined with the world’s biggest Metal festival.</p>\r
<p>This year, the original W:O:A headliner—once featuring Thomas Jensen on bass—returns to take the stage and turn up the heat once again!</p>`,detailLink:"/de/programm/bands/band/skyline/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=_57kh0nR28Y",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"skyline_2024.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2024/skyline_2024.jpg",title:"",type:2,uid:34094}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3931,uri:"https://skylineofficial.de"},{socialnetwork:{title:"Facebook",uid:1},uid:3932,uri:"https://www.facebook.com/SkylineOfficial"},{socialnetwork:{title:"Instagram",uid:5},uid:3933,uri:"https://www.instagram.com/skyline.wacken/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"648WDOhkiezX4fVNIfqbD4",subtitle:"",thumbnail:"/fileadmin/_processed_/6/5/csm_skyline_2024_a76c70015c.jpg",uid:1404},{artist:{country:[{nameLocalized:"Australien",shortNameDe:"Australien",shortNameEn:"Australia",uid:14}],events:[],pathSegment:"skynd",title:"Skynd",uid:170},biography:'<p class="docData;DOCY;v5;2342;">Skynd are back at W:O:A! The enigmatic singer of the same name and her partner Father return to the Holy Ground once again to captivate the crowd with a fusion of electronic music, brutal outbursts, and chilling lyrics inspired by real crimes. The Australian duo, who prefer to keep their identities under wraps, will make the long journey from Down Under once more—just for you!</p>',detailLink:"/de/programm/bands/band/skynd/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=KmpQcXTJfpk",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"skynd_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/skynd_25.jpg",title:"",type:2,uid:34075}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3897,uri:"https://skynd-music.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3898,uri:"https://www.facebook.com/skynd.music"},{socialnetwork:{title:"Instagram",uid:5},uid:3899,uri:"https://www.instagram.com/skynd_music/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3Ca8UhvMDcgM1zyfAZGw3M",subtitle:"",thumbnail:"/fileadmin/_processed_/f/d/csm_skynd_25_1d9aa36eb0.jpg",uid:1392},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"smoke-blow",title:"Smoke Blow",uid:990},biography:`<p class="docData;DOCY;v5;2753;">The honorable gentlemen of SMOKE BLOW are finally making their way back to the Holy Ground for another round. Whether they'll actually bring the tiniest backdrop in the world as they threaten to, one thing’s for sure: Frontman Letten still has the biggest mouth on the German pig-punk rock scene. Since 1997, the Kiel madmen have been unstoppable, and even though they like to keep a low profile for their Final Hands gigs, true fans know: Deep down, Smoke Blow will always be what they called themselves at the start of their career — the most anti-social band in the world. And that’s just the way we like it.</p>`,detailLink:"/de/programm/bands/band/smoke-blow/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=twqIrz1Rcp8",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"smoke_blow25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/smoke_blow25.jpg",title:"",type:2,uid:32671}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3731,uri:"https://www.facebook.com/smokeblow/"},{socialnetwork:{title:"Instagram",uid:5},uid:3732,uri:"https://www.instagram.com/smokeblow777/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"31pBLzx0eQ7MVVa7rg65c9",subtitle:"",thumbnail:"/fileadmin/_processed_/1/0/csm_smoke_blow25_5561950000.jpg",uid:1332},{artist:{country:[],events:[],pathSegment:"soen",title:"Soen",uid:396},biography:`<p class="docData;DOCY;v5;2322;">The supergroup SOEN has been making waves since 2004, capturing fans' hearts with their progressive, sophisticated Alternative Metal. Inspired by the pain and depths of human existence but also by hope, this Swedish quintet consistently resonates with the zeitgeist. Even two decades after their founding, they’re brimming with energy and captivating, powerful melodies. Welcome back to Wacken!</p>`,detailLink:"/de/programm/bands/band/soen/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=hwwwz8zbnM8",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"soen_25.jpg",publicUrl:"/fileadmin/user_upload/news_images/soen_25.jpg",title:"",type:2,uid:32929}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3741,uri:"https://soenmusic.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3742,uri:"https://www.facebook.com/SoenMusic"},{socialnetwork:{title:"Instagram",uid:5},uid:3743,uri:"https://www.instagram.com/soenmusic"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"38uWD5h115pdz278q4rwZW",subtitle:"",thumbnail:"/fileadmin/_processed_/1/c/csm_soen_25_51d59db65f.jpg",uid:1336},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"soulbound",title:"Soulbound",uid:1036},biography:'<p class="docData;DOCY;v5;3008;">Bielefeld doesn’t&nbsp;even&nbsp;exist. Oh yes, it does! And lucky for us, otherwise, we would have missed out on Soulbound! The five-piece from the “forbidden city” will bring their modern Metal, laced with electronic beats and reckless screams, to the Holy Ground for the first time. Alongside the mandatory pit workouts, there will also be plenty to feast your eyes on! If that doesn’t scream “deal”, we don’t know what does!</p>',detailLink:"/de/programm/bands/band/soulbound/",externalMediaRatio:"16by9",externalMediaSource:"77iKiudWCr75l34XsQAVpl",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"soulbound_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/soulbound_25.jpg",title:"",type:2,uid:34081}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3914,uri:"https://www.soulbound.de"},{socialnetwork:{title:"Facebook",uid:1},uid:3915,uri:"https://www.facebook.com/MusicSoulbound"},{socialnetwork:{title:"Instagram",uid:5},uid:3916,uri:"https://www.instagram.com/musicsoulbound/?hl=de"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"https://www.youtube.com/watch?v=xu-snf6Q-vk",subtitle:"",thumbnail:"/fileadmin/_processed_/a/b/csm_soulbound_25_8f788d674c.jpg",uid:1398},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"static-x",title:"Static-X",uid:356},biography:`<p class="docData;DOCY;v5;2808;">The survival of US alternative metal legends STATIC-X has often hung by a thread—just like two planned appearances at Wacken that had to be cancelled. So it's all the more exciting that it looks like it’s finally going to happen this time! To honor founding member and frontman Wayne Static, the original band members recorded their second album under the title Project Regeneration, bringing Wayne's last musical visions to life. Let us raise our fists high and scream along to anthems like The Only and Push It, while still pondering the true identity of Xer0. Not me thinking this has anything to do with Dope being also on the line up.</p>`,detailLink:"/de/programm/bands/band/static-x/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=oq_M1EY1Ei8",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"static_x_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/static_x_25.jpg",title:"",type:2,uid:32943}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3765,uri:"https://static-x.org/"},{socialnetwork:{title:"Facebook",uid:1},uid:3766,uri:"https://www.facebook.com/staticx"},{socialnetwork:{title:"Instagram",uid:5},uid:3767,uri:"https://www.instagram.com/staticxofficial"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"7JDSHlDdVTo7aZKdQZ53Vf",subtitle:"",thumbnail:"/fileadmin/_processed_/9/3/csm_static_x_25_c97cc2b2d0.jpg",uid:1344},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"suidakra",title:"Suidakra",uid:60},biography:'<p class="docData;DOCY;v5;3225;">All good things come in sevens! At least when it comes to Arkadius&nbsp;Antonik and SuidAkrA. The Melodic Death Metal institution with a heavy Folk twist has not only been a loyal companion to W:O:A, but also a valued&nbsp;guest on the Holy Ground. The fact that their last visit was over ten years ago makes the return of this mythical demolition squad just&nbsp;better. With their freshly forged album Darkanakrad, straight from the steel basins of North Rhine-Westphalia, the quartet will once again prove that, after more than 30 years in the business, they’ve lost none of their deadly precision.</p>',detailLink:"/de/programm/bands/band/suidakra/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=PlzrAeUbsqE",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"suidakra_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/suidakra_25.jpg",title:"",type:2,uid:33716}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3836,uri:"https://www.suidakra.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3837,uri:"https://www.facebook.com/Official.SuidAkrA/"},{socialnetwork:{title:"Instagram",uid:5},uid:3838,uri:"https://www.instagram.com/suidakra_official/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"77H7WLYHNHy0klUy1fGXIi",subtitle:"",thumbnail:"/fileadmin/_processed_/8/d/csm_suidakra_25_a433c28d2a.jpg",uid:1371},{artist:{country:[{nameLocalized:"Norwegen",shortNameDe:"Norwegen",shortNameEn:"Norway",uid:158}],events:[],pathSegment:"svarttjern",title:"Svarttjern",uid:969},biography:'<p class="docData;DOCY;v5;2592;">In Norwegian, the word stands for black tarn. It’s no coincidence that the painting of the same name by Norwegian artist August Cappelen evokes the same oppressive and bleak mood as the pitch-dark&nbsp;Black Metal of Svarttjern. You don’t believe us? Just take a closer look at the painting yourself and listen to the sounds of the five&nbsp;piece on the Holy Ground afterwards!</p>',detailLink:"/de/programm/bands/band/svarttjern/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=t1buXo_eTPs",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"svartjern_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/svartjern_25.jpg",title:"",type:2,uid:30718}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3634,uri:"https://www.facebook.com/svarttjern/"},{socialnetwork:{title:"Instagram",uid:5},uid:3635,uri:"https://www.instagram.com/svarttjernofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"34HkAxbpa90Btjkv8RA0wh",subtitle:"",thumbnail:"/fileadmin/_processed_/0/e/csm_svartjern_25_4424127695.jpg",uid:1299},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"tabernis",title:"Tabernis",uid:1018},biography:'<p class="docData;DOCY;v5;2067;">Beware of Tabernis! As seductive as the sweetest mead, as irresistible as the heaviest riff – they’ll mess with your head, and not only for headbanging. Mystical and otherworldly, these two beekeepers blend medieval sounds, tales from long-forgotten times, and the ancient art of honey-making into a truly unique mix. It’s easy to lose yourself in these sounds, so don’t say we didn’t warn you. A Holy Ground premiere to savor.</p>',detailLink:"/de/programm/bands/band/tabernis/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=z1UtaUykpIA",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"tabernis_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/tabernis_25.jpg",title:"",type:2,uid:33717}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3839,uri:"https://tabernis-music.com/de/"},{socialnetwork:{title:"Facebook",uid:1},uid:3840,uri:"https://www.facebook.com/people/Tabernis/61559926239521/?_rdr"},{socialnetwork:{title:"Instagram",uid:5},uid:3841,uri:"https://www.instagram.com/tabernis_music/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3Ob0nuOnI9FBBU2qOpAWkz",subtitle:"",thumbnail:"/fileadmin/_processed_/c/9/csm_tabernis_25_4fa18f822c.jpg",uid:1372},{artist:{country:[],events:[],pathSegment:"tarja-marko-hietela",title:"Tarja & Marko Hietela",uid:964},biography:`<p>Tarja Turunen – a whole generation of Metalheads is getting attentive when this name comes up. She was the start into the heavy parallel-universe for many; moreover, she wrote Metal history with Nightwish at the time.</p>\r
<p>After a series of successful performances in South America, where Marko Hietala supported Tarja as a special guest for several shows, the dynamic duo is to return to captivate European audiences with their enthralling collaboration.<br /> The show at Wacken, of the two ex-members of Nightwish, in 2025 promises to be an unforgettable experience as these two Wacken-familiar voices reunite on stage once again</p>`,detailLink:"/de/programm/bands/band/tarja-marko-hietela/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=6I75X2-qU8k",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Tarja_and_Marko_Hietala-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Tarja_and_Marko_Hietala-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30239}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3610,uri:"https://www.facebook.com/tarjaofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3611,uri:"https://www.instagram.com/tarjaofficial/"},{socialnetwork:{title:"Homepage",uid:8},uid:3612,uri:"https://tarjaturunen.com"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"5IRFMGI8aEtZdN07OYrBZc",subtitle:"",thumbnail:"/fileadmin/_processed_/1/4/csm_Tarja_and_Marko_Hietala-WOA25-Ankuenderbild_9718f63083.jpg",uid:1291},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"the-butcher-sisters",title:"The Butcher Sisters",uid:992},biography:`<p class="docData;DOCY;v5;2312;">Feeling the thirst for beer in Wacken? No problem! Put on your black sunglasses, adjust your fanny pack, grap some booze and get ready to shout a defiant 'UGA UGA BAM BAM'. For the first time, Mannheim's crossover party crew THE BUTCHER SISTERS is set to tear up the stages at W:O:A. They’re bringing along their brand-new third studio album, dropping in spring 2025. We’re pumped already!</p>`,detailLink:"/de/programm/bands/band/the-butcher-sisters/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=4JL8L7_6Ma0",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"The_Butcher_SIsters25.jpg",publicUrl:"/fileadmin/user_upload/news_images/The_Butcher_SIsters25.jpg",title:"",type:2,uid:32930}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3744,uri:"https://thebutchersisters.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3745,uri:"https://www.facebook.com/thebutchersisters/"},{socialnetwork:{title:"Instagram",uid:5},uid:3746,uri:"https://www.instagram.com/thebutchersisters"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6j8vGWE3wKAFEn0ngreusM",subtitle:"",thumbnail:"/fileadmin/_processed_/a/2/csm_The_Butcher_SIsters25_5bbd0a21d8.jpg",uid:1337},{artist:{country:[{nameLocalized:"Schweden",shortNameDe:"Schweden",shortNameEn:"Sweden",uid:186}],events:[],pathSegment:"the-hellacopters",title:"The Hellacopters",uid:1001},biography:`<p class="docData;DOCY;v5;2456;">THE HELLACOPTERS are one of the flagship bands of the unmistakable Swedish Punkrock 'n' Roll scene that turned everything upside down in the late '90s. Their music has already been awarded Gold multiple times in their home country and they are long-established as the loud and proud Kings of Coolness as well beyond their national borders. In 2025, they will once again live up to their reputation, touring with their ninth album „Overdriver“. We’re cranking up the volume to maximum!</p>`,detailLink:"/de/programm/bands/band/the-hellacopters/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=ww7iDotqQ0s",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"the_hellacopters_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/the_hellacopters_25.jpg",title:"",type:2,uid:32948}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3779,uri:"https://www.facebook.com/thehellacopters"},{socialnetwork:{title:"Instagram",uid:5},uid:3780,uri:"https://www.instagram.com/thehellacopters/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"1lsXuaLnHnfL7GoJXKkUtH",subtitle:"",thumbnail:"/fileadmin/_processed_/7/c/csm_the_hellacopters_25_dbf7167c4e.jpg",uid:1349},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"the-narrator",title:"The Narrator",uid:1057},biography:`<p class="docData;DOCY;v5;4535;">Alright, enough beating around the bush: At The Narrator from Essen, there’s no long negotiation—just straight-up delivery.</p>\r
<p>Ruthless riffs, crushingly heavy and radical, blend with anthemic singalong parts and plenty of fists raised high. A perfect storm brewed by four friends who couldn’t care less about genre boundaries.</p>\r
<p>With their first full-length album Lore, they already shifted into high gear in 2024. Now, they’re setting their sights on the Landgasthof. The storm warning has been issued!</p>`,detailLink:"/de/programm/bands/band/the-narrator/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=B_dyI9MrteE",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"The_Narrator_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/The_Narrator_25.jpg",title:"",type:2,uid:34325}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3982,uri:"https://www.thenarrator.de"},{socialnetwork:{title:"Facebook",uid:1},uid:3983,uri:"https://www.facebook.com/thenarratorhc"},{socialnetwork:{title:"Instagram",uid:5},uid:3984,uri:"https://www.instagram.com/thenarratorhc/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"7d1ZGbsel9lq6hwvWhPFgk",subtitle:"",thumbnail:"/fileadmin/_processed_/7/2/csm_The_Narrator_25_2467428650.jpg",uid:1425},{artist:{country:[{nameLocalized:"Australien",shortNameDe:"Australien",shortNameEn:"Australia",uid:14}],events:[],pathSegment:"the-rumjacks",title:"The Rumjacks",uid:158},biography:'<p class="docData;DOCY;v5;2699;">For some, a dog is a man’s best friend. Others are firm believers in good whiskey, and others in&nbsp;music. The Rumjacks from Australia combine at least two of these three passions on their new and sixth album Dead Anthems, which they luckily have packed for their second trip to the Holy Ground. Rousing Folk Punk anthems, delivered with a raspy voice and plenty of tin whistle. The perfect soundtrack to a day full of action in the moshpit.</p>',detailLink:"/de/programm/bands/band/the-rumjacks/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=yUaMZlZAZyg",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"the_rumjacks_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/the_rumjacks_25.jpg",title:"",type:2,uid:33718}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3842,uri:"https://therumjacks.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3843,uri:"https://www.facebook.com/TheRumjacks"},{socialnetwork:{title:"Instagram",uid:5},uid:3844,uri:"https://www.instagram.com/therumjacks/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"0w2KUuMj7dvP8dV4tzoltd",subtitle:"",thumbnail:"/fileadmin/_processed_/e/f/csm_the_rumjacks_25_88c8b1b5eb.jpg",uid:1373},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"timsen",title:"Timsen",uid:1006},biography:"<p>A chat with the postman is simply a matter of course for Timsen. That’s just how it is in the countryside. From the house band he founded with his brothers, to his sister’s guitar, and his first own drum set, Timsen found his way into music – and achieved success with Santiano. Step by step, he has continued to develop without losing touch with his roots: “For me, it’s really nice to sing in “Plattdeutsch” again and to release a North German album.” And where, if not at W:O:A, should he be able to present these songs appropriately? His performances with Santiano have ultimately made him a Wacken veteran.</p>",detailLink:"/de/programm/bands/band/timsen/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=ONHmLC6MUV8",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Timsen.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Timsen.jpg",title:"",type:2,uid:33272}}],networkuri:[{socialnetwork:{title:"Instagram",uid:5},uid:3793,uri:"https://www.instagram.com/timsen_vunhier_/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"7qcelJ9rfFFiTeXbPcbAOo",subtitle:"",thumbnail:"/fileadmin/_processed_/1/b/csm_Timsen_ecca7e1fac.jpg",uid:1354},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"torment",title:"Torment",uid:66},biography:`<p class="docData;DOCY;v5;3253;">At what point does one become a W:O:A legend? Asking for a friend.</p>\r
<p>The friend? German Thrash ’n’ Roll legends TORMENT, who are hitting the gas pedal on the Holy Ground for the seventh time—straight into the dust.</p>\r
<p>This flagship of German Thrash culture has been going strong for 41 years, and while many of their peers have slowed down or disappeared entirely, Torment just keeps going.</p>\r
<p>Who could stop them? And more importantly—who would even want to?</p>\r
<p>We want them. We need their unique blend of Thrash and Rock ’n’ Roll. So, better give your chiropractor a heads-up—this one’s gonna be wild!</p>`,detailLink:"/de/programm/bands/band/torment/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=MbGjbzjrJuo",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"torment_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/torment_25.jpg",title:"",type:2,uid:33615}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3802,uri:"https://www.facebook.com/p/Torment-100063508782987/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"",subtitle:"",thumbnail:"/fileadmin/_processed_/e/3/csm_torment_25_36ad72c664.jpg",uid:1359},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"torsten-straeter-1",title:"Torsten Sträter",uid:667},biography:`<p class="docData;DOCY;v5;2735;">Torsten Sträter’s current program is titled “Mach mal das große Licht an” (“Turn on the big light”). That makes him a perfect fit for W:O:A—where we don’t just have big lights, we have the best and loudest fans in the world!</p>\r
<p>It’s the perfect setup for the comedian’s first-ever appearance on the Holy Ground. A man who has navigated the highs and lows of life, sharing his experiences with audiences for over two decades, is about to witness something truly special.</p>\r
<p>Don’t worry, Torsten—the big light stays on!</p>`,detailLink:"/de/programm/bands/band/torsten-straeter-1/",externalMediaRatio:"16by9",externalMediaSource:"",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"torsten_straeter_2023.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2023/torsten_straeter_2023.jpg",title:"",type:2,uid:34095}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3934,uri:"https://torsten-straeter.de"},{socialnetwork:{title:"Facebook",uid:1},uid:3935,uri:"https://www.facebook.com/TorstenStraeterStraeter"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3Q1JqFy5L609CKH4cUjCCF",subtitle:"",thumbnail:"/fileadmin/_processed_/d/6/csm_torsten_straeter_2023_fd12ba1d88.jpg",uid:1405},{artist:{country:[{nameLocalized:"Brasilien",shortNameDe:"Brasilien",shortNameEn:"Brazil",uid:29}],events:[],pathSegment:"torture-squad",title:"Torture Squad",uid:1011},biography:`<p class="docData;DOCY;v5;2825;">Who doesn’t know that warm feeling that fills you when you reunite with old friends, despite the seemingly insurmountable distance that once lay between you?</p>\r
<p>This year, the Holy Ground will feel even warmer and more like home, because TORTURE SQUAD are feeling homesick and are paying us a (long-overdue) visit. And since there’s no better way to make us happy, the Brazilian legends and Wacken Metal Battle winners will no doubt spark a pit or two and blast us with their breakneck riffs.</p>\r
<p>Their furious blend of Death and Thrash Metal has ruled stages across the globe for over 30 years—welcome back!</p>`,detailLink:"/de/programm/bands/band/torture-squad/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=Y6sKb6GzY68",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"torture_squad_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/torture_squad_25.jpg",title:"",type:2,uid:33616}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3803,uri:"https://torturesquad.com.br"},{socialnetwork:{title:"Facebook",uid:1},uid:3804,uri:"https://www.facebook.com/torturesquad/"},{socialnetwork:{title:"Instagram",uid:5},uid:3805,uri:"https://www.instagram.com/torture_squad/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6E3iq1WfZbw2YEeTKVZYJR",subtitle:"",thumbnail:"/fileadmin/_processed_/d/b/csm_torture_squad_25_a5f039416a.jpg",uid:1360},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"tyson",title:"Tyson",uid:1060},biography:`<p class="docData;DOCY;v5;6026;">Tyson is bringing the noise!</p>\r
<p>But while their somewhat aged American namesake has since stepped out of the ring, Tyson (the band) are still standing tall and strong.</p>\r
<p>Brutal&nbsp;Metalcore collides with searing&nbsp;Thrash—every riff hits like a punch, every drum fill is a knockout.</p>\r
<p>Time has barely left a mark on this crew from Kiel, and they’re more than ready to serve up a few rounds of skull-crushing goodness.</p>\r
<p>Aaaaaand fight!</p>`,detailLink:"/de/programm/bands/band/tyson/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=Gj-mKydPlD0",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"tyson_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/tyson_25.jpg",title:"",type:2,uid:34328}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3990,uri:"https://www.facebook.com/tyson.hwm/"},{socialnetwork:{title:"Instagram",uid:5},uid:3991,uri:"https://www.instagram.com/tysonmetal/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3gmAj3KEQSIJ5gZlFooJz3",subtitle:"",thumbnail:"/fileadmin/_processed_/e/a/csm_tyson_25_f94ffcae82.jpg",uid:1428},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"ugly-kid-joe",title:"Ugly Kid Joe",uid:996},biography:'<p class="docData;DOCY;v5;2862;">It’s all about the mix! Or, in the case of Ugly Kid Joe: a pinch of Funk combined with equal parts of solid Heavy Metal and Hard Rock. This winning combination has allowed the band to reach new heights, even after a 13-year hiatus. Whitfield Crane, Klaus Eichstadt, and the rest of the crew are no strangers to the Holy Ground and will return to familiar stomping grounds in 2025. Perhaps their strongest ace up their sleeve is their humor: the band name alone proves it, as it’s a deliberate play on Pretty Boy Floyd (a US Glam band). We’re looking forward to an energetic live show—and so should you!</p>',detailLink:"/de/programm/bands/band/ugly-kid-joe/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=L8L2dRk6S_U",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"ugly_kid_joe25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/ugly_kid_joe25.jpg",title:"",type:2,uid:32935}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3759,uri:"https://uglykidjoe.net/"},{socialnetwork:{title:"Facebook",uid:1},uid:3760,uri:"https://www.facebook.com/uglykidjoetheband/"},{socialnetwork:{title:"Instagram",uid:5},uid:3761,uri:"https://www.instagram.com/uglykidjoeofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3XsgWn63EnA4wYZBjVyxjf",subtitle:"",thumbnail:"/fileadmin/_processed_/9/3/csm_ugly_kid_joe25_3ed58bddd8.jpg",uid:1342},{artist:{country:[{nameLocalized:"Großbritannien",shortNameDe:"Großbritannien",shortNameEn:"United Kingdom",uid:74}],events:[],pathSegment:"uk-subs",title:"UK Subs",uid:1039},biography:'<p class="docData;DOCY;v5;2368;">Charlie Harper (no joke!) and his crew have been at the forefront of Punk since the mid-70s. With a 49-year-long history, the UK Subs have seen more lineup changes than most, but Charlie remains the constant driving force behind the London legends. After inhaling the Wacken air in 1994, 2009, and 2017, 2025 is yet another year for the Subs! Living legends returning to where legends belong!</p>',detailLink:"/de/programm/bands/band/uk-subs/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=hSFfDbecdFw",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"UK_Subs_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/UK_Subs_25.jpg",title:"",type:2,uid:34085}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3926,uri:"https://www.facebook.com/UKSubs/"},{socialnetwork:{title:"Instagram",uid:5},uid:3927,uri:"https://www.instagram.com/uksubsofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4wsg78KGu80m8Xk37PY2uG",subtitle:"",thumbnail:"/fileadmin/_processed_/c/d/csm_UK_Subs_25_2d09477649.jpg",uid:1402},{artist:{country:[{nameLocalized:"Costa Rica",shortNameDe:"Costa Rica",shortNameEn:"Costa Rica",uid:48}],events:[],pathSegment:"umbra-conscientia",title:"Umbra Conscientia",uid:954},biography:'<p class="docData;DOCY;v5;2780;">It’s not an easy task to investigate who lit up who. But one thing is for sure: The tender flame of Black Metal blazes steadily in the co-production Umbra Conscienta. Somewhere between the speedy guitar attacks and floating, doomy parts, the Umbra Conscientia&nbsp;(which means shadow of sonsciousness) found their home in 2018 and are sweetly torturing our minds since then. The Costa&nbsp;Rican and German union will prove its firepower&nbsp;at&nbsp; W:O:A 2025.</p>',detailLink:"/de/programm/bands/band/umbra-conscientia/",externalMediaRatio:"16by9",externalMediaSource:"",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Umbra_Conscientia-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Umbra_Conscientia-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30166}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3560,uri:"https://www.facebook.com/UmbraConscientia/"},{socialnetwork:{title:"Instagram",uid:5},uid:3561,uri:"https://www.instagram.com/umbra_conscientia/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3VQSd6slqOJCxmtpiW5Icl",subtitle:"",thumbnail:"/fileadmin/_processed_/4/b/csm_Umbra_Conscientia-WOA25-Ankuenderbild_d7cbefeefa.jpg",uid:1272},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"v4a",title:"V4A",uid:1058},biography:`<p class="docData;DOCY;v5;5697;">Bands in our cosmos giving themselves brutal names to show their allegiance to&nbsp;Metal is nothing new.</p>\r
<p>But a band naming itself directly after a type of steel? That’s a rarity—even in our scene, which is hardly lacking in vivid imagery.</p>\r
<p>V4A from Puls don’t just symbolically stand for steel—they are the embodiment of everything we love about driving&nbsp;Rock and relentless&nbsp;Metal.</p>\r
<p>Time to expand the periodic table – V4A have already claimed their rightful place with us!</p>`,detailLink:"/de/programm/bands/band/v4a/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=g9rYAeVovIM",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"v4a_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/v4a_25.jpg",title:"",type:2,uid:34326}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3985,uri:"http://www.v4a-band.de"},{socialnetwork:{title:"Facebook",uid:1},uid:3986,uri:" https://www.facebook.com/V4ABand/"},{socialnetwork:{title:"Instagram",uid:5},uid:3987,uri:"https://www.instagram.com/v4a_band/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"",subtitle:"",thumbnail:"/fileadmin/_processed_/6/0/csm_v4a_25_8f853b64b0.jpg",uid:1426},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"vermaledeyt",title:"Vermaledeyt",uid:1019},biography:'<p class="docData;DOCY;v5;2431;">Vermaledeyt formed in 2004 and split up, ten years later in 2014. Another ten years later, they’re celebrating their grand comeback and will be on the W:O:A stage for the first time this year. What sounds like a modern fairytale is reality for the seven medieval enthusiasts, who, with their latest release Heimkehr, have provided the perfect thematic foundation for their Wacken debut. Get ready to dance when the minstrels finally strike up their tunes!</p>',detailLink:"/de/programm/bands/band/vermaledeyt/",externalMediaRatio:"16by9",externalMediaSource:"",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"vermaledyt_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/vermaledyt_25.jpg",title:"",type:2,uid:33719}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3845,uri:"https://vermaledeyt.de"},{socialnetwork:{title:"Facebook",uid:1},uid:3846,uri:"https://www.facebook.com/vermaledeyt"},{socialnetwork:{title:"Instagram",uid:5},uid:3847,uri:"https://www.instagram.com/vermaledeyt_official/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"1udsSNluoBclXFeSI2ipOc",subtitle:"",thumbnail:"/fileadmin/_processed_/9/1/csm_vermaledyt_25_1b75f369d2.jpg",uid:1374},{artist:{country:[{nameLocalized:"Venezuela",shortNameDe:"Venezuela",shortNameEn:"Venezuela",uid:225}],events:[],pathSegment:"vhill",title:"Vhill",uid:1042},biography:`<p class="docData;DOCY;v5;2102;">Originating from Ciudad Guayana, Venezuela, Vhill is a death metal band formed in 2018 that has overcome adversity—including the loss of founder Jorge Díaz during the pandemic—by regrouping in late 2023 to honor his legacy. With a powerful lineup featuring Joel Rodríguez (vocals), Samuel Duque and Marco Requena (guitars), Omar Zamora (bass), and Gregory Peraza (drums), their fresh, energetic sound won them the Wacken Metal Battle South America North title and cemented their status as a rising force in Venezuela's extreme metal scene.</p>`,detailLink:"/de/programm/bands/band/vhill/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=VyHXfMM0G0o",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"vhill_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/vhill_25.jpg",title:"",type:2,uid:34162}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3941,uri:"https://www.facebook.com/vhill.ve"},{socialnetwork:{title:"Instagram",uid:5},uid:3942,uri:"https://www.instagram.com/vhill.ve"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6M2q7FwuqSthak1213BCFs",subtitle:"Metal Battle South America (Northern Region)",thumbnail:"/fileadmin/_processed_/7/a/csm_vhill_25_b01cf24426.jpg",uid:1408},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"victory",title:"Victory",uid:911},biography:'<p class="docData;DOCY;v5;2422;">What Los Angeles and the Sunset Strip are to the US, Hanover is to Germany—albeit on a smaller scale. Eloy, Jane, Fury in the Slaughterhouse, the Scorpions, and of course, Victory. The Hard Rock veterans still know how to ignite a crowd even after decades in business. Don’t believe us? Then see for yourselves and turn the Holy Ground into a Victory fireworks with the band. With rockets like you and a scorching hot band, we are certain nothing will go wrong, right?&nbsp;</p>',detailLink:"/de/programm/bands/band/victory/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=D6HGy_OaC0A",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"victory25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/victory25.jpg",title:"",type:2,uid:32574}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3687,uri:"https://www.victory-band.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3688,uri:"https://www.facebook.com/victorybandofficial/"},{socialnetwork:{title:"Instagram",uid:5},uid:3689,uri:"https://www.instagram.com/victorybandofficially/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"71rNgVUS9VQlZoctS9pOe1",subtitle:"",thumbnail:"/fileadmin/_processed_/c/0/csm_victory25_573853e8a0.jpg",uid:1316},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"voodoo-kiss",title:"Voodoo Kiss",uid:1035},biography:'<p class="docData;DOCY;v5;2906;">Do you feel it? That twitch in your neck, the way your hands slowly give in to the urge to form our beloved Metal horns. If we didn’t know better, we’d say that Voodoo Kiss had a hand in this. But the Heavy Metal sorcerers, led by Summer Breeze founder Achim Ostertag, don’t rely on black magic—they rely on relentless riffs and bone-rattling vocals. With their powerful new album Feel the Curse in tow, they’re sure to lure more than a few of you to the stage.</p>',detailLink:"/de/programm/bands/band/voodoo-kiss/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=E0ob1UiVcp0",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"voodoo_kiss_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/voodoo_kiss_25.jpg",title:"",type:2,uid:34080}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3911,uri:"https://voodoo-kiss.de"},{socialnetwork:{title:"Facebook",uid:1},uid:3912,uri:"https://www.facebook.com/voodookiss95/"},{socialnetwork:{title:"Instagram",uid:5},uid:3913,uri:"https://www.instagram.com/voodookiss95/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3MgrQRVc1z0GJwI4SaK8tP",subtitle:"",thumbnail:"/fileadmin/_processed_/d/e/csm_voodoo_kiss_25_ec63fc4864.jpg",uid:1397},{artist:{country:[{nameLocalized:"Österreich",shortNameDe:"Österreich",shortNameEn:"Austria",uid:13}],events:[],pathSegment:"vulvarine",title:"Vulvarine",uid:1038},biography:"<p>Vulvarock—that’s how the four Viennese musicians of Vulvarine describe their explosive mix of Heavy Metal, high-energy Rock ‘n’ Roll à la The Hellacopters, and lyrics that revolve around their lives as Vulvarines. With their album Fast Lane in their cowboy boots, the band is heading to the Holy Ground just in time for their five-year anniversary—ready to shake things up. And they’ve already proven that they’re more than capable, having supported bands like Exciter, Thundermother, and The Baboon Show. For Vulvarine, there’s only one way forward: first Germany, then Wacken, and after that—the world! We’re&nbsp;ready.</p>",detailLink:"/de/programm/bands/band/vulvarine/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=PqieecS3IrI",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"vulvarine_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/vulvarine_25.jpg",title:"",type:2,uid:34083}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3920,uri:"https://vulvarine.band"},{socialnetwork:{title:"Facebook",uid:1},uid:3921,uri:"https://www.facebook.com/vulvarine.vienna"},{socialnetwork:{title:"Instagram",uid:5},uid:3922,uri:"https://www.instagram.com/vulvarine_band/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"16MG8AG1y22HDmY8IoI5lY",subtitle:"",thumbnail:"/fileadmin/_processed_/6/a/csm_vulvarine_25_a04776a3ae.jpg",uid:1400},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"wasp",title:"W.A.S.P.",uid:994},biography:"<p>How do raw meat, spinning saw blades, and rebellious lyrics fit together? That’s right: W.A.S.P is the answer. After over 40 years in the music business, Blackie Lawless and his crew are still bursting with energy. Whether it’s the fighting spirit of classics like „<em>I Wanna Be Somebody“</em> and „<em>Wild Child“</em> or the unbridled passion for playing their newer songs - they’ve got it all. Don’t miss out as the American Metal legends return to Wacken after more than 10 years bringing some surprises along for the ride!</p>",detailLink:"/de/programm/bands/band/wasp/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=lq5UQ8gWU-A",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"wasp_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/wasp_25.jpg",title:"",type:2,uid:32933}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3753,uri:"https://www.waspnation.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3754,uri:"https://www.facebook.com/W.A.S.P.Nation"},{socialnetwork:{title:"Instagram",uid:5},uid:3755,uri:"https://www.instagram.com/waspofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3BVkDHWRvLJEyKdvhLbjsq",subtitle:"",thumbnail:"/fileadmin/_processed_/0/7/csm_wasp_25_eead94abc4.jpg",uid:1340},{artist:{country:[{nameLocalized:"Deutschland",shortNameDe:"Deutschland",shortNameEn:"Germany",uid:54}],events:[],pathSegment:"wacken-firefighters",title:"Wacken Firefighters",uid:212},biography:'<p class="docData;DOCY;v5;2041;">What would Vienna be without its Philharmonic Orchestra? Tatooine without its Cantina Band? Or Wacken without its Firefighters? The answer is: incomplete! A tradition as old as our beloved festival itself and celebrated by you just as much as by us. That’s why they’ll once again shake the stage and the Holy Ground this year – the one and only Wacken Firefighters. Do you even truly love W:O:A if you don’t give your all with them?</p>',detailLink:"/de/programm/bands/band/wacken-firefighters/",externalMediaRatio:"16by9",externalMediaSource:"",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"wacken_firefighters_2019.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2019/wacken_firefighters_2019.jpg",title:"",type:2,uid:33720}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3848,uri:"https://www.wacken-firefighters.com"},{socialnetwork:{title:"Instagram",uid:5},uid:3849,uri:"https://www.instagram.com/wackenfirefighters/"},{socialnetwork:{title:"Facebook",uid:1},uid:3850,uri:"https://www.facebook.com/MZFF.Wacken.Firefighters"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"",subtitle:"",thumbnail:"/fileadmin/_processed_/8/b/csm_wacken_firefighters_2019_16c051f4ff.jpg",uid:1375},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"walls-of-jericho",title:"Walls of Jericho",uid:980},biography:"<p>For seven days, Joshua and his men were to march around the city of Jericho, breaking into an infernal war&nbsp;cry on the final day to bring the city’s walls crashing down. What sounds like the usual Wacken moshpit is actually the biblical story behind the name of the Hardcore band from Detroit, founded in 1998. Frontwoman Candace Kucsulain and her crew have proven time and time again that their aggressive Hardcore Punk is more than capable of tearing down walls. They’ll prove it once more with another electrifying show at W:O:A 2025. Get your dust boots ready—the pit is calling!</p>",detailLink:"/de/programm/bands/band/walls-of-jericho/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=VuQR2dAFD3c",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"walls_of_jericho25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/walls_of_jericho25.jpg",title:"",type:2,uid:32576}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3693,uri:"https://www.facebook.com/WallsofJericho/"},{socialnetwork:{title:"Instagram",uid:5},uid:3694,uri:"https://www.instagram.com/wojofficial"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"60cGRl68qyCBMqZi3tiHEU",subtitle:"",thumbnail:"/fileadmin/_processed_/4/2/csm_walls_of_jericho25_8c507edeee.jpg",uid:1318},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"warbringer",title:"Warbringer",uid:938},biography:"<p>Sometimes a band has to endure some setbacks in order to come back even stronger. Warbringer have been very welcomed guests in all the Thrash Departments of the globe for over 20 years.<br /> After playing Wacken a few times already; we gladly invited them back! It is going to be fast, it is going to be hard, and it is going to be loud. Maybe the one or the other Circle Pit will grab a tunnel to Australia.<br /> Let’s go!</p>",detailLink:"/de/programm/bands/band/warbringer/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=KAZE-Y8-1b0",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Warbringer-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Warbringer-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30149}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3518,uri:"https://www.warbringermusic.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3519,uri:"https://www.facebook.com/Warbringermusic/"},{socialnetwork:{title:"Instagram",uid:5},uid:3520,uri:"https://www.instagram.com/warbringermusic/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"4UKKKGkjNWx8KTUvea66k1",subtitle:"",thumbnail:"/fileadmin/_processed_/5/b/csm_Warbringer-WOA25-Ankuenderbild_0f9f898fd4.jpg",uid:1255},{artist:{country:[{nameLocalized:"Norwegen",shortNameDe:"Norwegen",shortNameEn:"Norway",uid:158}],events:[],pathSegment:"warkings",title:"Warkings",uid:110},biography:`<p class="docData;DOCY;v5;2366;">They are armed with heavy armor, sharp weapons, and Pure Power Metal, how they name their music style. All good things come in threes: And thus the mighty WARKINGS answer Odin's call and will once again grace the Holy Ground in 2025. The next great epic of this quintet awaits, and you can be sure you'll get your money’s worth with Metal anthems like 'Fight,' 'Maximus,' and 'Hephaistos.' Fight for metal, WARKINGS!</p>`,detailLink:"/de/programm/bands/band/warkings/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=j0n-aSinVbU",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"warkings25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/warkings25.jpg",title:"",type:2,uid:32667}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3720,uri:"https://www.warkings.rocks/"},{socialnetwork:{title:"Facebook",uid:1},uid:3721,uri:"https://www.facebook.com/warkingsmetal"},{socialnetwork:{title:"Instagram",uid:5},uid:3722,uri:"https://www.instagram.com/warkings_metal"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"7DXUeaMULtMVFmmaKFzH3E",subtitle:"",thumbnail:"/fileadmin/_processed_/b/8/csm_warkings25_756eb24085.jpg",uid:1328},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"wednesday-13",title:"Wednesday 13",uid:322},biography:'<p class="docData;DOCY;v5;2390;">I’m packing my bag for Wacken, and I’m bringing… eyeliner! A perfect choice, because for Wednesday 13, it’s absolutely essential. The US horror punks are celebrating their return to the Holy Ground with their new album Mid Death Crisis. Expect nightmares, a spectacular stage show, and plenty of action in the mosh pit. The last time we got this lucky was when a 13th fell on a Wednesday. Wait a minute…</p>',detailLink:"/de/programm/bands/band/wednesday-13/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=_K3VNoGwFY8",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"wednesday_13_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/wednesday_13_25.jpg",title:"",type:2,uid:34084}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3923,uri:"https://officialwednesday13.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3924,uri:"https://www.facebook.com/officialwednesday13"},{socialnetwork:{title:"Instagram",uid:5},uid:3925,uri:"https://www.instagram.com/mrmotherfucker13/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"6Cvzf33JDzCIw2eJU8npQo",subtitle:"",thumbnail:"/fileadmin/_processed_/6/4/csm_wednesday_13_25_05d81fe7c7.jpg",uid:1401},{artist:{country:[{nameLocalized:"Italien",shortNameDe:"Italien",shortNameEn:"Italy",uid:104}],events:[],pathSegment:"windrose",title:"Wind Rose",uid:966},biography:'<p>With their cover-version of the Minecraft-Song “Diggy Diggy Hole”, the Italian Power Metal band Wind Rose landed a gigantic hit. Not only Minecraft but also Tolkien is a big influence on the group. The realm of the dwarves captivated them so intensely that they dedicated their whole artistic direction towards them. With their 2024 release "Trollslayer", Wind Rose return to Wacken to take the Holy Ground like a storm. If their full dwarves-power is able to dig their way to the stage?</p>',detailLink:"/de/programm/bands/band/windrose/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=8ZXBm1NXBaI",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"windrose_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/windrose_25.jpg",title:"",type:2,uid:30313}}],networkuri:[{socialnetwork:{title:"Facebook",uid:1},uid:3622,uri:"https://www.facebook.com/windroseofficial/?locale=de_DE"},{socialnetwork:{title:"Instagram",uid:5},uid:3623,uri:"https://www.instagram.com/windroseofficial/?hl=de"},{socialnetwork:{title:"Homepage",uid:8},uid:3624,uri:"https://www.windroseofficial.com"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"67ps5pbKVO7V9Fcb4lTIXz",subtitle:"",thumbnail:"/fileadmin/_processed_/4/8/csm_windrose_25_ba8346e2fe.jpg",uid:1295},{artist:{country:[{nameLocalized:"Niederlande",shortNameDe:"Niederlande",shortNameEn:"Netherlands",uid:157}],events:[],pathSegment:"within-temptation",title:"Within Temptation",uid:23},biography:'<p class="docData;DOCY;v5;4286;">Founded back in 1996 by&nbsp;singer and fashion&nbsp;designer Sharon Den Adel and her partner Robert Westerholt, the&nbsp;successful&nbsp;Dutch sextet WITHIN TEMPTATION can&nbsp;proudly&nbsp;look back on huge, sold out shows all around&nbsp;the&nbsp;world, numerous&nbsp;gold and platin&nbsp;awards&nbsp;for #1 records in their&nbsp;home&nbsp;country&nbsp;as&nbsp;well&nbsp;as in Germany. And so we&nbsp;are happy to&nbsp;have&nbsp;the&nbsp;spear&nbsp;head&nbsp;of&nbsp;symphonic Alternative Metal on the Holy Ground for&nbsp;the&nbsp;fifth time, rocking&nbsp;their&nbsp;latest&nbsp;album „Bleed Out“&nbsp;with&nbsp;you. Let‘s&nbsp;cheer&nbsp;together&nbsp;loud and proud „Van harte welkom“!</p>',detailLink:"/de/programm/bands/band/within-temptation/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=tEqJhULw_9c&t=3s",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"Within_Temptation-WOA25-Ankuenderbild.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/Within_Temptation-WOA25-Ankuenderbild.jpg",title:"",type:2,uid:30241}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3616,uri:"https://www.within-temptation.com/"},{socialnetwork:{title:"Facebook",uid:1},uid:3617,uri:"https://www.facebook.com/wtofficial"},{socialnetwork:null,uid:3618,uri:"https://www.instagram.com/wtofficial/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"3hE8S8ohRErocpkY7uJW4a",subtitle:"",thumbnail:"/fileadmin/_processed_/e/8/csm_Within_Temptation-WOA25-Ankuenderbild_dd8a3c5c9f.jpg",uid:1293},{artist:{country:[{nameLocalized:"Vereinigte Staaten von Amerika",shortNameDe:"Vereinigte Staaten von Amerika",shortNameEn:"United States",uid:220}],events:[],pathSegment:"zeke",title:"Zeke",uid:1037},biography:`<p class="docData;DOCY;v5;2572;">They like it fast, they like it loud, and without any unnecessary fuss – the American legend Zeke is set to break new speed records with their Blues-infused Punk, enough to make even Napalm Death take notice.</p>\r
<p>For nearly 30 years, this high-performance machine has been running at full throttle, and now they’re making their way from laid-back Seattle to the Heavy Metal capital in Wacken. Their first time on the Holy Ground – proving once again: better late than never!</p>`,detailLink:"/de/programm/bands/band/zeke/",externalMediaRatio:"16by9",externalMediaSource:"https://www.youtube.com/watch?v=o4DimkAmjGg",extraDay:!1,festival:{runningOrderActive:!1,uid:9},images:[{originalResource:{alternative:"",description:"",name:"zeke_25.jpg",publicUrl:"/fileadmin/user_upload/bandimages/bands2025/zeke_25.jpg",title:"",type:2,uid:34082}}],networkuri:[{socialnetwork:{title:"Homepage",uid:8},uid:3917,uri:"https://www.zekeyou.com"},{socialnetwork:{title:"Facebook",uid:1},uid:3918,uri:"https://www.facebook.com/ZekeBand"},{socialnetwork:{title:"Instagram",uid:5},uid:3919,uri:"https://www.instagram.com/zekeband/"}],performance:[{title:"Concert",uid:1}],spotifyalbum:"",spotifyartist:"7HvjR3M6xzluBLTnioRzvu",subtitle:"",thumbnail:"/fileadmin/_processed_/6/4/csm_zeke_25_518cd158b0.jpg",uid:1399}];export{A as default};
